INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(64784, 'koKR', '9.0 Rated PvP Incentive - Shadowlands Season 2 Exclusive Mount', '', '', '', '', '', '', '', '', 39653),
(64651, 'koKR', '코브라 영혼', '숲의 심장부에 있는 여군주 무우운에게 코브라의 영혼을 가져가야 합니다.', '<탐욕스럽고 방어적인 코브라의 영혼입니다. 코브라의 형상을 불러낼 수 있게 될 것입니다.>', '', '', '', '', '', '숲의 심장부에 있는 여군주 무우운에게 코브라의 영혼을 가져가야 합니다.', 39653),
(64650, 'koKR', '하이에나 영혼', '숲의 심장부에 있는 여군주 무우운에게 하이에나의 영혼을 가져가야 합니다.', '<맹렬하고 원기 왕성한 하이에나의 영혼입니다. 하이에나의 형상을 불러낼 수 있게 될 것입니다.>', '', '', '', '', '', '숲의 심장부에 있는 여군주 무우운에게 하이에나의 영혼을 가져가야 합니다.', 39653),
(64640, 'koKR', 'AubriesTestQuestForJeff', '', '', '', '', '', '', '', '', 39653),
(64607, 'koKR', '타자베쉬: 밑지는 장사', '아우마날의 동업자를 물색해 도움을 제공해야 합니다.', '이야, 제 작품이 정말 잘 어울리십니다. 합법의 표상이 있다면 바로 그런 모습이 아닐까 싶어요!\n\n자, 제 재능을 빌려드렸으니 이번에는 나락 방랑자님께서 재능을 기부해 주실 차례입니다. 황금빛 선착장에 있는 제 동업자 페타지드를 찾아 힘을 빌려주세요.\n\n그럼 좋은 소식을 기다리죠.', '', '', '', '', '', '', 39653),
(64599, 'koKR', '지배의 성소 - 저주받은 자의 과업', '신화 난이도 지배의 성소에서 켈투자드로부터 성물함 조각 4개를 입수해야 합니다.', '이 전당에서 켈투자드의 존재감이 느껴지는구나. 성물함에서 조각을 찾아오너라. 그게 있으면 놈의 방으로 통하는 새로운 길을 열 수 있을 거다.\n\n네 개 정도면 충분해. 켈투자드가 또 부활하는 불상사는 피해야지 않겠나.', '', '', '', '', '', '', 39653),
(64598, 'koKR', '지배의 성소 - 저주받은 자의 과업', '영웅 난이도 지배의 성소에서 켈투자드로부터 성물함 조각 4개를 입수해야 합니다.', '이 전당에서 켈투자드의 존재감이 느껴지는구나. 성물함에서 조각을 찾아오너라. 그게 있으면 놈의 방으로 통하는 새로운 길을 열 수 있을 거다.\n\n네 개 정도면 충분해. 켈투자드가 또 부활하는 불상사는 피해야지 않겠나.', '', '', '', '', '', '', 39653),
(64597, 'koKR', '지배의 성소 - 저주받은 자의 과업', '일반 난이도 지배의 성소에서 켈투자드로부터 성물함 조각 4개를 입수해야 합니다.', '이 전당에서 켈투자드의 존재감이 느껴지는구나. 성물함에서 조각을 찾아오너라. 그게 있으면 놈의 방으로 통하는 새로운 길을 열 수 있을 거다.\n\n네 개 정도면 충분해. 켈투자드가 또 부활하는 불상사는 피해야지 않겠나.', '', '', '', '', '', '', 39653),
(64571, 'koKR', '타자베쉬: 현상범의 행방불명', '', '', '', '', '', '', '', '', 39653),
(64567, 'koKR', '사라진 학자', '코르시아에서 학자 로쉬르를 찾아야 합니다.', '아, 나락 방랑자님. 이렇게 돌아와 주시니 긍정적인 마음이 샘솟는군요. 마침 도움이 절실한 사안이 있습니다.\n\n아직도 행방이 묘연한 학자가 몇 있습니다. 마지막으로 봤을 때는 대궁정에서 연구에 매진하고 있었죠. 혹시 방황하고 있거나... 우리 삶의 방식을 무너뜨리려는 자들에게 잡혀가 끔찍한 일을 당하고 있는 건 아닌지 걱정됩니다.\n\n진상을 알아내는 대로 돌아오세요.\n\n목적의 길이 인도하기를.', '', '', '', '', '', '', 39653),
(64562, 'koKR', '치유사 급구 - 바로 당신을 원함!', '구도자의 성원에서 부상당한 성약의 단 아군 $1oa명을 회복시켜야 합니다.', '전장에 부상자가 많아도 너무 많소! \n\n\'두드려서 더 잘 작동하게 만들기\'가 세상 만물에 통하진 않는다오. 치유사가 더 필요하오.\n\n냉큼 내 장치를 갖고 나가서 부상자를 일으켜 세우시오!', '', '', '', '', '', '', 39653),
(64561, 'koKR', '관찰 기록', '코르시아 바람맞이 둥지와 각성의 강어귀에서 관찰 기록 $1oa개를 수집해야 합니다.', '안녕하세요, 나락 방랑자님. 잠시 시간 좀 내어주실 수 있으실는지요?\n\n분명 이미 알고 계시겠지만, 제 중개단에서는 조용히 코르시아 곳곳에 관찰 장치를 설치해 두었습니다. 그렇지만 회수하지 않은 자료는 아무짝에도 쓸모가 없죠. 해서 나락 방랑자님의 힘이 필요합니다.\n\n바람맞이 둥지와 각성의 강어귀라면 기록을 수집할 준비가 다 됐을 거예요. 장치 그 자체가 눈에 보이진 않을 거고, 자료가 밝은 보주의 형태로 나타날 겁니다.\n\n참, 아래쪽 땅도 살펴보는 거 잊지 마세요!\n\n자료를 모아다 주시면 두둑하게 챙겨드리지요.', '', '', '', '', '', '', 39653),
(64560, 'koKR', '령 회수 작업', '인도의 성역에 있는 포식자에게서 포식된 령 $1oa개를 회수해야 합니다.', '우리가 이곳에서 활동하려면 병력, 보급품, 령의 꾸준한 보급이 이뤄져야 한다. 말할 것도 없이 마지막 자원이 가장 조달하기 어렵지. 하지만 난 수완을 부릴 줄 안다. \n\n이 근처에 풍족한 령 공급원이 있다. 현재 인도의 성역에 들끓고 있는 포식자들을 말하는 것이야. 영혼에게서 끌어내는 것만큼 쉽진 않지만 충분한 힘이 따라준다면 같은 효율을 내지. 할 수 있겠느냐?', '', '', '', '', '', '', 39653),
(64557, 'koKR', '어둠 속에서의 발견', '저주받은 자의 탑 토르가스트에서 베니쉬를 찾아야 합니다.', '베 중개단으로 말할 것 같으면, 보물을 찾아 위험천만한 장소를 들쑤시는 것으로 명성이 자자합니다. 사리를 분별하는 능력이 똑바로 박혀 있었더라면 상품 취득과 판매는 자이 중개단에 맡겼을 텐데 말이죠. 애석하고 딱한 일입니다.\n\n그런데 한 베 중개단 구성원이 강력한 물품이 들어 있는 약탈 상자를 가지고 토르가스트에 들어가 자취를 감춰버렸습니다. 그렇게 하면 무사히 탐사하는 데 도움이라도 될 줄 알았나 봅니다. 정신을 놓아버린 건지, 원!', '', '', '', '', '', '', 39653),
(64556, 'koKR', '도움이 필요한 순간', '코르시아 전역에서 미카니코스, 타나시, 캘타스의 일일 퀘스트 3개를 완료해야 합니다.', '코르시아 주민들은 뼈저린 고초에 시달렸다. 우리가 제때 나타나지 않았으면 간수의 병력이 비밀의 도시를 완전히 짓밟아 버리고 잿더미만을 남겼겠지.\n\n도움이 필요한 자들을 돕는 것은 우리 활동의 연장선이라고 할 수 있다.\n\n동맹의 부름에 귀를 기울여라, 나락 방랑자. 아무리 사사로운 요소라도 그냥 넘어가는 일이 없게 하여 간수와 결탁한 자를 모조리 쓸어버리는 거다.', '', '', '', '', '', '', 39653),
(64555, 'koKR', '비밀 탐구', '코르시아에서 최전방 정찰병과 대화해야 합니다.', '성약의 단에서 저마다 뚜렷한 전문 분야를 가진 전문가를 보내주었다. 그중 몇몇이 이 미지의 땅을 답사하러 정찰에 나섰지.\n\n그들과 대화를 나눠 보거라. 다들 조사한 내용을 기록한 보고서를 작성해놨을 거다. 내게 가져오도록.', '', '', '', '', '', '', 39653),
(64554, 'koKR', '벤티르의 습격', '연옥의 요새와 망각의 표면에서 퀘스트 $1oa개를 완료해야 합니다.', '우리가 간수의 병력의 의표를 제대로 찔렀다. 연옥의 요새를 함락시키고 지배의 제단에 있는 그의 용사들을 무찌를 차례다!\n\n나락 방랑자, 네 도움이 필요하다. 전장에서 아군을 지원해다오!', '', '', '', '', '', '', 39653),
(64553, 'koKR', '령 용천의 전설', '죄악의 몰락지에 있는 전술가 사카아에게 령 용천의 전설을 전달해야 합니다.', '<코르시아 깊은 곳 어딘가에 숨겨져 있다는 신비로운 령의 샘에 대해 어느 기록관이 조사한 내용이 상세히 담겨 있는 일련의 쪽지입니다. 다만 기록이 완전하진 않습니다.\n\n죄악의 몰락지에 있는 전술가 사카아에게 가져가면 샘을 찾을 원정대를 꾸리는 데 도움을 받을 수 있을 것입니다.>', '', '', '', '', '', '죄악의 몰락지에 있는 전술가 사카아에게 령 용천의 전설을 전달해야 합니다.', 39653),
(64552, 'koKR', '령 용천의 전설', '엘리시안 요새에 있는 코로스에게 령 용천의 전설을 전달해야 합니다.', '<코르시아 깊은 곳 어딘가에 숨겨져 있다는 신비로운 령의 샘에 대해 어느 기록관이 조사한 내용이 상세히 담겨 있는 일련의 쪽지입니다. 다만 기록이 완전하진 않습니다.\n\n엘리시안 요새에 있는 코로스에게 가져가면 샘을 찾을 원정대를 꾸리는 데 도움을 받을 수 있을 것입니다.>', '', '', '', '', '', '엘리시안 요새에 있는 코로스에게 령 용천의 전설을 전달해야 합니다.', 39653),
(64551, 'koKR', '령 용천의 전설', '시초자의 권좌에 있는 메릭 펠드스카에게 령 용천의 전설을 전달해야 합니다.', '<코르시아 깊은 곳 어딘가에 숨겨져 있다는 신비로운 령의 샘에 대해 어느 기록관이 조사한 내용이 상세히 담겨 있는 일련의 쪽지입니다. 다만 기록이 완전하진 않습니다.\n\n시초자의 권좌에 있는 메릭 펠드스카에게 가져가면 샘을 찾을 원정대를 꾸리는 데 도움을 받을 수 있을 것입니다.>', '', '', '', '', '', '시초자의 권좌에 있는 메릭 펠드스카에게 령 용천의 전설을 전달해야 합니다.', 39653),
(64549, 'koKR', '령 용천의 전설', '숲의 심장부에 있는 감시자 베스퍼블룸에게 령 용천의 전설을 전달해야 합니다.', '<코르시아 깊은 곳 어딘가에 숨겨져 있다는 신비로운 령의 샘에 대해 어느 기록관이 조사한 내용이 상세히 담겨 있는 일련의 쪽지입니다. 다만 기록이 완전하진 않습니다.\n\n숲의 심장부에 있는 감시자 베스퍼블룸에게 가져가면 샘을 찾을 원정대를 꾸리는 데 도움을 받을 수 있을 것입니다.>', '', '', '', '', '', '숲의 심장부에 있는 감시자 베스퍼블룸에게 령 용천의 전설을 전달해야 합니다.', 39653),
(64541, 'koKR', '죽음의 대가', '', '', '', '', '', '', '', '', 39653),
(64532, 'koKR', '마지막 유물', '회고의 성물함에서 사라진 유물을 살펴본 후 연구 보고서: 고대 제단을 구매해야 합니다.', '희소식이 있습니다, $n 님. 마지막 남은 유실된 유물을 파악했습니다! \n\n찾아내기 쉽진 않겠지만, 제 연구가 도움이 되어줄 겁니다.\n\n사라진 유물을 검토하는 것도 이번이 마지막이에요. 조금만 더 하면 전부 다 찾아낼 수 있습니다!', '', '', '', '', '', '', 39653),
(64531, 'koKR', '모르제스', '', '', '', '', '', '', '', '', 39653),
(64530, 'koKR', '무덤날개 수정', '수호자의 안식처에 있는 돌장인에게 무덤날개 수정을 전달해야 합니다.', '<거대한 피조물의 몸체에서 떨어져 나온 큼지막한 수정 파편입니다. 안에 깃든 마력이 번쩍이며 파지직거립니다.\n\n수호자의 안식처에 있는 돌장인이라면 이 수정으로 무덤날개에 힘을 불어넣을 수 있을 것입니다.>', '', '', '', '', '', '수호자의 안식처에 있는 돌장인에게 무덤날개 수정을 전달해야 합니다.', 39653),
(64529, 'koKR', '온전한 아퀼론 핵', '수호자의 안식처에 있는 데오스에게 온전한 아퀼론 핵을 전달해야 합니다.', '<거대 포식자는 이 아퀼론 동력 핵을 움켜쥔 채로 죽었습니다. 주변에 널브러진 파괴된 아퀼론에서 뜯어낸 것이 분명합니다. 동력 핵 자체는 거의 온전해 보입니다.\n\n수호자의 안식처에 있는 데오스라면 핵이 필요한 아퀼론을 찾아줄 수 있을 것입니다.>', '', '', '', '', '', '수호자의 안식처에 있는 데오스에게 온전한 아퀼론 핵을 전달해야 합니다.', 39653),
(64528, 'koKR', '야생룡 안장', '수호자의 안식처에 있는 렐도른에게 야생룡 안장을 전달해야 합니다.', '<당신이 등에서 내려오자, 탈출한 야생룡이 몸을 흔들어 당신의 발치에 안장을 떨어뜨렸습니다. 그리고는 마지못해 곁을 떠나 나이트 페이를 따라 수호자의 안식처로 돌아갔습니다.\n\n수호자의 안식처에 있는 렐도른이라면 이러한 행동의 의미를 알지도 모릅니다.>', '', '', '', '', '', '수호자의 안식처에 있는 렐도른에게 야생룡 안장을 전달해야 합니다.', 39653),
(64527, 'koKR', '추격전 관찰', '전쟁 모드를 활성화하고 이 세상에 있는 플레이어 $1oa명을 처치해야 합니다.', '여러분 종족의 분쟁을 관찰하는 과정에서 사냥감의 탈출 비율이 높다는 사실을 알아냈습니다.\n\n우리의 관찰에 별다른 도움이 안 되는 현상이지요.\n\n하여 감시자께서 나락 방랑자님의 분쟁 강요 능력을 향상시켜줄 도구를 입수하셨답니다.\n\n이걸 드리기 전에 우선 분쟁에 참여할 의지가 있음을 증명해 주세요. 그럼 우리도 이 투자로 쏠쏠한 소득을 거둘 수 있을 거란 확신이 들겠죠.', '', '', '', '', '', '', 39653),
(64526, 'koKR', '수수께끼의 균열', '회고의 성물함에서 사라진 유물을 살펴본 후 로쉬르에게서 수리된 균열의 열쇠를 구매해야 합니다.', '도와주셔서 정말로 감사합니다, $n 님. 전서에서 온전한 유물을 몇 개 더 찾아냈습니다.\n\n그 유물들을 찾아낼 열쇠는 코르시아의 기묘한 균열 내부에 있습니다.\n\n균열에 들어갈 수단을 만들어 드릴 수도 있습니다. 그럼 더 많은 유물을 찾아낼 수 있을 테지요.\n\n늘 그래왔듯이 사라진 유물이 어떻게 생겼는지 확인하실 수 있도록 표본을 마련해 두었습니다. 출발하기 전에 확인해 보시길.', '', '', '', '', '', '', 39653),
(64522, 'koKR', '도난당한 코르시아 보급품', '수호자의 안식처에 있는 여공작 밍크스에게 도난당한 코르시아 보급품을 가져가야 합니다.', '<보급품에 죽음의 진군의 인장이 새겨져 있습니다. 균열의 공간에서 쥐도 새도 모르게 훔쳐낸 것입니다.\n\n수호자의 안식처에 있는 여공작 밍크스에게 전달하면 진심으로 고마워할 것입니다.>', '', '', '', '', '', '수호자의 안식처에 있는 여공작 밍크스에게 도난당한 코르시아 보급품을 가져가야 합니다.', 39653),
(64521, 'koKR', '저승살이 전투 계획서', '수호자의 안식처에 있는 여공작 밍크스에게 저승살이 전투 계획서를 가져가야 합니다.', '<이 전투 계획서에 코르시아로 진출할 방안과 지역에 주둔하는 죽음의 진군의 방어 능력에 대한 상세한 보고가 기술되어 있습니다.\n\n수호자의 안식처에 있는 여공작 밍크스라면 이 정보를 신속하게 적재적소에 전달할 수 있을 것입니다.>', '', '', '', '', '', '수호자의 안식처에 있는 여공작 밍크스에게 저승살이 전투 계획서를 가져가야 합니다.', 39653),
(64519, 'koKR', '잃어버린 금고', '회고의 성물함에서 사라진 유물을 살펴봐야 합니다.', '아직 코르시아에 남아 있을 가능성이 큰 유물에 대한 연구를 마쳤습니다. 소형 금고에 보관되어 있나 보더군요.\n\n나락 방랑자님께서 도와주신다면 그러한 금고의 입구를 수리할 수 있는 장치를 복원할 수 있습니다.\n\n여전히 행방이 묘연한 유물들의 복제품을 안치해 두었습니다. 한번 살펴보시고 찾아야 할 물건의 모습을 외워 두시길.', '', '', '', '', '', '', 39653),
(64513, 'koKR', '베레인의 머리카락', '베나리의 은거처에 있는 베나리에게 베레인의 머리카락을 가져가야 합니다.', '<베레인은 한동안 베나리를 추적해왔습니다. 그녀를 영구적으로 처리했음을 나타내는 증거를 제시하면 베나리가 매우 큰 흥미를 보일 것입니다.>', '', '', '', '', '', '베나리의 은거처에 있는 베나리에게 베레인의 머리카락을 가져가야 합니다.', 39653),
(64511, 'koKR', '사라진 유물', '회고의 성물함에서 사라진 유물을 살펴봐야 합니다.', '나락 방랑자님의 협조 덕택에 금고에서 사라진 유물에 관한 연구물을 더 복원해냈습니다.\n\n전서를 검토해보니 코르시아 내에 회수할 유물이 더 남아 있더군요.\n\n상자 안에 봉인되어 있는데, 처음 공격받았을 때 코르시아 곳곳으로 뿔뿔이 흩어진 것 같습니다.\n\n여기 유실된 유물을 정리해 두었습니다. 기억에 잘 새겨두세요. 무슨 일이 있어도 회수해야 합니다.', '', '', '', '', '', '', 39653),
(64509, 'koKR', '맵시 있는 덮개', '', '', '', '', '', '', '', '', 39653),
(64508, 'koKR', '[DNT] Conduit Energy', '', '', '', '', '', '', '', '', 39653),
(64506, 'koKR', '반드시 찾아야 하는 것', '회고의 성물함에서 어떤 유물이 사라졌는지 살펴봐야 합니다.', '전서에는 온갖 상세한 정보가 담겨 있습니다. 영원히 유실된 것부터... 오늘날까지도 존재하는 몇몇 물품에 대한 내용이 기재되어 있지요.\n\n일부 강력한 유물이 코르시아 어딘가에 남아 숨겨져 있을지도 모릅니다. \n\n성물함에 들어가 보세요. 온전하게 보존되어 코르시아에 남아 있는 유물을 확인하실 수 있을 겁니다.\n\n그 모습을 기억에 새겨두시길. 반드시 유물을 찾아서 제게 가지고 오셔야 합니다.', '', '', '', '', '', '', 39653),
