(64441, 'koKR', '느슨한 실타래', '책을 찾아 반납해야 합니다.', '<근처에 있는 벤티르 야영지의 탁자에서 떨어져 나온 것으로 보이는 책입니다.\n\n뿔동이가 보금자리의 재료로 써버리기 전에 반환하면 벤티르가 감사히 생각할 것입니다.>', '', '', '', '', '', '', 39653),
(64438, 'koKR', '장비 강화', '보조 학자 카베즈와 대화하여 코르시아에서 획득한 장비 하나를 강화해야 합니다.', '당신이 발견한 연구물은 수없이 많은 가능성을 여는 열쇠라 해도 과언이 아닙니다.\n\n일례로 코르시아에서 발견한 장비를 개량하는 데도 활용할 수 있겠지요.\n\n이 근처에 있는 제 조수와 대화를 나눠 보세요. 우리 연구물을 활용해 이 장비의 예전 힘을 되찾아줄 겁니다.', '', '', '', '', '', '', 39653),
(64437, 'koKR', '시초자에게 보고', '코르시아에 있는 시초자에게 가야 합니다.', '$n, 코르시아로 돌아가 시초자에게 겨울 여왕의 인장이 복원되었음을 알리거라.', '', '', '', '', '', '', 39653),
(64432, 'koKR', '약자에게 힘을', '피뢰침을 강화한 후 이를 사용해 나락살이를 처치해야 합니다.', '$p, 우리가 수집해오던 금속 조각에 흥미로운 성질이 있더구려. 나락살이 녀석들, 방어구에 마력을 주입해 내구도를 높이고 있는 것 같소.\n\n이 피뢰침을 받으시오. 첫 번째로 할 일은 벼락에 맞는 거요. 그런 표정 짓지 마시오. 괜찮을 테니까. 다만 나락살이의 금속으로 접지 효과를 내야 한다오. 코르시아에 박혀 있는, 바람맞이 둥지 근처의 큼지막한 사슬 정도면 좋은 자리가 되겠지.\n\n그렇게... 음... 충전을 마치거든 내 타우랄러스인 보라스를 보내 당신을 전장으로 보내주겠소.', '', '', '', '', '', '', 39653),
(64376, 'koKR', 'Tracking Quest', '', '', '', '', '', '', '', '', 39653),
(64368, 'koKR', '유물의 효율', '', '', '', '', '', '', '', '', 39653),
(64325, 'koKR', '죄악의 몰락지 역전용사', '오리보스 자치구에 있는 조소그를 만나야 합니다.', '$n, 당신의 승리 덕분에 죄악의 몰락지의 영향력이 더욱 커지고 있습니다!\n\n당신이 이룬 업적은 레벤드레스의 경계 너머까지 알려질 정도로 널리 인정받고 있습니다.\n\n오리보스의 전당에서도 당신이 거둔 승리에 대한 이야기가 울려 퍼지고 있는 모양입니다. 분쟁의 대가인 조소그가 자치구에서 당신과 만나고 싶다고 하더군요.\n\n전쟁의 기술에 상당한 관심을 갖고 있는 이들이니, 어서 가서 만나보시는 게 좋겠습니다.', '', '', '', '', '', '', 39653),
(64324, 'koKR', '강령군주 역전용사', '오리보스 자치구에 있는 조소그를 만나야 합니다.', '$n 님, 당신 덕분에 강령군주의 권능이 더욱 커지고 있습니다.\n\n당신이 이룩한 성취는 말드락서스의 경계 저 너머까지 널리 알려졌죠.\n\n오리보스의 온 전당에서도 당신이 거둔 승리에 대한 이야기가 울려퍼졌다고 합니다. 그래서인지 분쟁의 대가 조소그가 자치구에서 당신을 만나뵙고자 한다더군요.\n\n병법에 깊은 관심이 있는 이들이니, 어서 가서 만나보시는 게 어떻습니까?', '', '', '', '', '', '', 39653),
(64323, 'koKR', '키리안 역전용사', '오리보스 자치구에 있는 조소그를 만나야 합니다.', '$n, 덕분에 승천의 보루가 치유되고 있다. 승천의 길 또한 안전해졌지.\n\n당신 업적은 승천의 보루 경계 저 너머까지 널리 알려졌다.\n\n오리보스의 전당에서도 당신이 거둔 승리에 대한 이야기가 울려 퍼지고 있지. 분쟁의 대가인 조소그는 자치구에서 당신과 만나고 싶다고 하더군.\n\n전쟁의 기술에 큰 관심을 보이는 이들이니, 서둘러 만나보는 게 좋을 거다.', '', '', '', '', '', '', 39653),
(64322, 'koKR', '나이트 페이 역전용사', '오리보스 자치구에 있는 조소그를 만나야 합니다.', '당신 덕분에 꽤 오랜만에 몽환숲이 다시 안정을 되찾았어요.\n\n당신이 이룩한 성취는 몽환숲의 경계 저 너머까지 널리 알려졌죠.\n\n오리보스의 온 전당에서도 당신이 거둔 승리에 대한 이야기가 울려 퍼졌다고 해요. 그래서인지 분쟁의 대가 조소그가 자치구에서 당신을 만나 뵙고자 한다더군요.\n\n병법에 깊은 관심이 있는 이들이니, 어서 가서 만나보시는 게 어떨까요?', '', '', '', '', '', '', 39653),
(64314, 'koKR', '성약의 단의 재탄생', '시초자와 대화한 후, 각 성약의 단의 인장을 입수해야 합니다.', '지금까지 우린 간수가 나락을 에워싼 방벽을 부수고 어둠땅을 침공하지 못하게 막는 데만 정신이 팔렸었다.\n\n대신 그는 나락 그 자체를 확장해 오리보스를 집어삼키고 심판관의 인장을 차지했지.\n\n토르가스트 최정상에서 우리가 뭘 목격한 것인지는 나도 완전히 알지 못한다. 하나 시초자라면 십중팔구 알 터.\n\n만일의 사태를 대비한 그의 계획을 실행에 옮길 때가 된 것 같구나. 곧 성약의 단들이 인장을 갖고 도착할 거다. \n\n시작할 준비가 되었다고 시초자에게 알리거라.', '', '', '', '', '', '', 39653),
(64306, 'koKR', '퀘스트 완료 기준', '', '', '', '', '', '', '', '', 39653),
(64304, 'koKR', '새로운 기회의 장', '코르시아에서 플레이어 $1oa명을 처치해야 합니다.', '어디 급하게 갈 곳이라도 있으십니까? 아, 과연. 나락 방랑자님. 혹시 나락에 새로이 나타난 미지의 땅을 탐험하러 향하는 길은 아니신지요?\n\n그곳에 과연 어떤 비밀이 있을지 저도 호기심이 샘솟네요.\n\n이참에 상부상조의 정신을 다져보는 건 어떨까요?\n\n흥미가 동하셨다면 계속 논의를 나누면 될 일이고, 그렇지 않다면 갈 길을 가시면 됩니다. 일이야 다른 사람에게 맡기면 그만이라서 말이죠.', '', '', '', '', '', '', 39653),
(64292, 'koKR', '방랑자 멜리', '멜리를 입양해야 합니다.', '멜리를 찾아주시다니, 이 감사한 마음을 다 표현할 길이 없네요! 실은 제가 감당하기엔 살짝 역부족이 아닌가 싶어요.\n\n이 아이를 지켜봐 주실 수 있을까요? 아무래도 나락 방랑자님이 마음에 든 눈치예요!', '', '', '', '', '', '', 39653),
(64290, 'koKR', '연구 수집', '기록관 로쉬르와 대화하여 코르시아 유물을 반납하고 분류된 기록물을 받아야 합니다.', '조각을 모으느라 고생 많으셨습니다. 보관소를 복원하는 데 큰 보탬이 될 거예요. \n\n나락 방랑자님이 찾아주신 조각을 활용해 코르시아에서 유실된 것들에 대한 연구물을 확보할 수 있을 겁니다. \n\n그 이후에 코르시아에 있는 조각과 유물을 찾아 보관소를 보완하는 건 나락 방랑자님께 달려 있지만 말이에요.', '', '', '', '', '', '', 39653),
(64289, 'koKR', '조각 회수', '코르시아 전역의 희귀 생명체와 보물에서 유물 조각 50개를 회수해야 합니다.', '코르시아는 나락으로 끌려오면서 너무나 많은 것을 잃었습니다.\n\n값어치를 매길 수 없는 온갖 유물이 산산이 조각났죠. 심지어 몇몇 생명체가 그 잔재를 품고 다니는 것도 봤습니다. \n\n반드시 회수해야 합니다.\n\n간수의 병력에 맞서 싸우고 코르시아의 잔해를 살펴 한때 영광스러웠던 금고의 파편을 찾아 주세요.', '', '', '', '', '', '', 39653),
(64288, 'koKR', '베나리와 불멸의 동맹', '나락에 있는 베나리의 은거처에서 베나리와 대화해야 합니다.', '오시지요, 나락 방랑자님. 제 은거처로 말입니다.\n\n마지막으로 논의할 사안이 있습니다.\n\n...그리고 미행당하지 않게 주의하시길.', '', '', '', '', '', '', 39653),
(64287, 'koKR', '기록관의 전서와 불멸의 동맹', '코르시아 회고의 성물함에서 기록관 로쉬르와 대화해야 합니다.', '나락 방랑자님께서는 우리에게 무엇보다 소중한 것을 복원하는 데 큰 힘을 보태주셨습니다.\n\n준비를 마치는 대로 제 방에 와주셨으면 해요. 끝으로 논의할 얘기가 있습니다.', '', '', '', '', '', '', 39653),
(64282, 'koKR', '놀라움의 연속', '조바알의 금고를 찾아야 합니다.', '저에게 놀라움의 연속을 선사하시는군요, 나락 방랑자님. 설마 이곳에서 마주치리라곤 전혀 몰랐습니다!\n\n이렇게 만난 것도 인연인데, 협력하는 건 어떻겠습니까?\n\n간수는 이 균열 어딘가에 진귀한 물건이 가득 들어 있는 금고를 보유하고 있습니다. 위치만 알아내 주셔도 족합니다. 이곳으로 가져와 함께 열어보는 것도 좋은 방안이 되겠네요. 어쨌든 재물을 함께 나눠 갖는 겁니다!', '', '', '', '', '', '조바알의 금고 보유 여부에 상관없이 베나리와 대화해야 합니다.', 39653),
(64274, 'koKR', 'Tracking Quest', '', '', '', '', '', '', '', '', 39653),
(64273, 'koKR', '저승살이 퇴치 작업', '', '', '', '', '', '', '', '', 39653),
(64267, 'koKR', '베나리의 수수께끼 선물', '나락에 있는 베나리의 은거처에서 베나리와 대화해야 합니다.', '웬만큼 유능함을 발휘하면서 어떻게든 살아남는 나락 방랑자님의 순수한 끈기에 놀랐습니다. 당신을 보고 있으면 지금보다 훨씬 젊고 순진무구했던 과거의 제가 떠올라요. \n\n이걸 드릴 테니 앞으로도 수고해 주시길... 눈에 덜 띄는 곳에서 말이죠.', '', '', '', '', '', '', 39653),
(64266, 'koKR', '기록관의 전서 보급품', '코르시아 회고의 성물함에서 기록관 로쉬르와 대화해야 합니다.', '당신의 헌신이 있기에 코르시아의 역사가 온전하게 보존될 거란 생각을 하면 말로는 다 표현할 수 없는 온기가 마음을 한가득 채웁니다.\n\n그런 의미에서 제 감사한 마음을 나누고 싶습니다.', '', '', '', '', '', '', 39653),
(64216, 'koKR', '탑의 지식', '토르가스트에 무수히 많은 것이 든 상자를 놓아야 합니다.', '이 상자에 엮인 힘은 긍지와 기억을 먹이로 주어야지만 해방할 수 있네. 구조에 새겨진 주문이 낯이 익은데, 다른 영역에서 영혼을 흡수하거나 조율할 때 사용하는 것일세. 요컨대 이... 흉물은... 구원과 명예의 도구를 이용해 자물쇠를 만들어낸 걸세.\n\n토르가스트의 층을 정복하다 보면 자네의 실력, 속도, 효율이 모여 탑의 지식을 이룰 걸세. 그리고 그걸 상자에 먹이로 주는 게지.\n\n저 안에 담긴 힘을 손에 넣으려면 그렇게 해야 하네.', '', '', '', '', '', '토르가스트에 무수히 많은 것이 든 상자를 놓아야 합니다.', 39653),
(64214, 'koKR', '희망의 상징', '안두인의 나침반 조사를 도와야 합니다.', '안두인이 간수를 따라 관문을 통과하기 전에 무언가를 떨어뜨렸네.\n\n나는 잘 모르겠네만, 제이나가 잘 챙겨뒀지. 어쩌면 안두인이 여전히 간수에게 맞서 싸우고 있다는 걸 보여주는 증거일지도 모르네!\n\n그 물체의 정체는 무엇이며, 또 어린 왕이 왜 남겨뒀는지 알아내야 하네.', '', '', '', '', '', '', 39653),
(64213, 'koKR', '희망의 상징', '제이나를 도와 안두인의 나침반을 조사해야 합니다.', '안두인이 간수를 따라 관문을 통과하기 전에 무언가를 떨어뜨렸습니다.\n\n이것까지 간수의 계획은 아닐 겁니다. 안두인의 영혼이 아직 남아 있다는 증거가 분명해요!\n\n<손을 펼쳐 황금빛 나침반을 보여주는 제이나>\n\n이건 안두인 본인에게 개인적으로 큰 의미가 있는 물건입니다. 그의 존재감이 느껴져요.\n\n그가 왜 나침반을 남겨뒀는지 알아내보죠.', '', '', '', '', '', '', 39653),
(64212, 'koKR', '어둠 속의 출입구', '스랄과 대화하여 토르가스트 전투의 마지막 순간을 목격해야 합니다.', '조바알을 막기 위한 우리의 노력이 좌절되고 마는 것은 아닌지 걱정되는구나, 필멸자여.\n\n금단의 영역으로 통하는 길이 열리고... 추방당한 자가 먼 옛날에 빼앗긴 힘을 되찾고 말았어.\n\n네 동료들이 지배의 성소에서 돌아오는 게 느껴지는군. 무슨 일이 있었는지 내 소상히 알아야겠다.', '', '', '', '', '', '', 39653),
(64211, 'koKR', '어둠 속의 출입구', '제이나와 대화하여 토르가스트 전투의 마지막 순간을 목격해야 합니다.', '조바알을 막기 위한 우리의 노력이 좌절되고 마는 것은 아닌지 걱정되는구나, 필멸자여.\n\n금단의 영역으로 통하는 길이 열리고... 추방당한 자가 먼 옛날에 빼앗긴 힘을 되찾고 말았어.\n\n네 동료들이 지배의 성소에서 돌아오는 게 느껴지는군. 무슨 일이 있었는지 내 소상히 알아야겠다.', '', '', '', '', '', '', 39653),
(64210, 'koKR', '무수히 많은 것이 든 상자', '룬조각사에게 무수히 많은 것이 든 상자를 가져가야 합니다.', '아, 나락 방랑자님. 하긴 누가 또 있겠습니까마는. 머잖아 저는 사멸해 이곳에 영원히 사로잡힐 겁니다. 하지만 당신은 꺾이지 않고 계속 이 전당을 누빌 테죠!\n\n전 상자로 탑을 극복해 보이겠다는 원대한 포부가 있었습니다. 슬프게도 스스로의 역량을 과대평가하는 우를 범하고 만 것이지요.\n\n하지만 전 압니다. 당신에 대한 제 평가는 절대 과하지 않다는 걸. 상자를 받으세요. 주인이 될 자격이 있음을 증명해 주시길.', '', '', '', '', '', '', 39653),
(64202, 'koKR', '신들린 손놀림', '닐간니흐마트의 도움을 수락해야 합니다.', '나락 방랑자 너의 힘은... 조바알에게 육체를 분리당하기 전의 이 몸과 필적하는군.\n\n이 형상은 내 전체의 지극히 작은 일부에 불과하니라. 하지만 이걸로도 충분하지...\n\n조바알에게 맞서는 데 힘을 보태게 해다오. 나의 복수를 이루고 마리라.', '', '', '', '', '', '', 39653),
(64194, 'koKR', '시험용 전쟁 병기', '바람맞이 둥지에 있는 시험용 아틀레오스를 사용해 크락시스를 처치해야 합니다.', '나는 수석 제련장인으로서 더 나은 작품을 만들고자 늘 부단히 노력한다오!\n\n하지만 초대형 백인대장은 코르시아에 들여오기엔 너무 크다는 문제점이 있지. 이것이 내 해결책이오. 시험용 야전 거신인 아틀레오스라오. 키리안의 선봉대라 할 수 있지! \n\n이 백인대장은 시운전이 필요하오. 강력한 상대를 견제하려면 완벽해야지 않겠소.\n\n자, 아틀레오스에 올라타 나락의 야수를 무찌르시오! 단추란 단추는 죄다 누르는 거요!', '', '', '', '', '', '', 39653),
