(64168, 'koKR', '용사: 마라스미우스의 포자', '', '', '', '', '', '', '', '', 39653),
(64166, 'koKR', '종잡을 수 없는 기억', '찰나의 날개를 사용해 코르시아 기억을 수집해야 합니다.', '간수는 코르시아를 속박해 나락으로 끌어당겨 지대한 규모의 파괴를 초래했습니다. 비단 산맥과 건물뿐만이 아니라, 사람들도 휘말렸죠.\n\n삶과 희망, 기억을 품고 살아가던 이들 말이에요.\n\n그 모든 것이 완전히 사라지진 않았을 겁니다. 한 줌에 불과할지언정 아직 남아있는 것을 구할 수 있을지도 모르죠.\n\n자, 제 힘을 약간 드릴께요. 기억을 모아 제게로 가져다주시면 안전하게 보관하겠습니다. \n\n이 세상에 잊혀도 괜찮은 사람은 없어요.', '', '', '', '', '', '', 39653),
(64138, 'koKR', 'Tracking Quest', '', '', '', '', '', '', '', '', 39653),
(64131, 'koKR', 'Tracking Quest', '', '', '', '', '', '', '', '', 39653),
(64106, 'koKR', '단결된 노력', '나락에서 간수의 병력을 습격하는 성약의 단을 지원해야 합니다.', '너는 네 성약의 단은 말할 것도 없고, 어둠땅의 다른 성약의 단까지 감화시켜 강력한 우방으로 만들었다. 바로 그런 유대가 있기에 저들이 우리 대의에 힘을 실어주는 것이니라.\n\n우리가 나락으로 진격하면 저들이 함께 싸워줄 거다.\n\n각 성약의 단은 서로 다른 지역에서 간수에게 공세를 퍼부을 것이다. 저들을 도와 이 위험천만한 대지에 도사리는 조바알의 하수인을 모조리 격멸해라. 그의 커지는 영향력에 마침표를 찍을 때다.', '', '', '', '', '', '', 39653),
(64103, 'koKR', '오래된 방법이 가장 잘 통하는 법', '나락살이 사령관 모로스, 오이지스, 아페이트를 처치해야 합니다.', '$p, 또 이렇게 어둠땅의 수호를 위해 서로 어깨를 나란히 하고 싸우게 되었구먼.\n\n전황이 불리하게 돌아가고 있지만, 판도를 뒤집을 길이 없는 건 아닐세. 나락살이 군대에서 몇몇 사령관을 색출해 주게나. 자고로 군대라면 우수한 지휘관과 형편없는 지휘관이 존재하기 마련이지. 우수한 자를 제거하면 조잡한 놈팡이가 높은 지위에 오를 것이고, 군대 전체가 약화되는 결과로 이어질 걸세.\n\n눈의 첩자들이 살생부를 만들어뒀네. 자네는 집행만 하면 돼.', '', '', '', '', '', '', 39653),
(64101, 'koKR', '적절한 절차', '잃어버린 령 용기 $1oa개를 수집해야 합니다.', '나는 레벤드레스 출신들의 행실을 지켜보고자 이곳으로 왔다. 한데 염려스러운 소식이 날아들더군.\n\n$p, 따르는 자들은 용기에 령을 보관한다는구나. 그런데 그 용기를 다름 아닌 우리 동포들이 훔치고 있다는군. 있어선 안 될 일이야.\n\n령을 회수해주지 않겠느냐? 내가 책임지고 마땅히 있어야 할 장소로 반환하겠다.', '', '', '', '', '', '', 39653),
(64092, 'koKR', '훌른을 쫓아서', '변장을 착용한 후, 지배의 요새에서 경비병을 피하며 훌른 하이마운틴을 찾아야 합니다.', '훌른은 이곳 어딘가에 있는데... 문제는 돌장인이 그게, 음, 최근에 공포의 군주하고 마찰을 빚은지라 영역에 아무도 들이질 않고 있어요. 경비병이 출입을 원천 봉쇄하고 있는 건 둘째치고, 수상하다 싶으면 바로 내쫓아 버린단 말이죠.\n\n훌른은 운이 좋은 거예요. 곤봉얼굴하고 제가 빈틈없는 대책을 세웠거든요!\n\n그냥 안 수상하게 꾸민 다음 수소문해서 훌른을 찾으면 돼요. 참 쉽죠?', '', '', '', '', '', '', 39653),
(64091, 'koKR', '배은망덕한 자', '구속의 인장을 수집해야 합니다.', '<공포의 군주가 할 말이 있는 듯 당신과 눈을 마주칩니다. 이에 당신은 동료들에게 눈길을 보냈고, 문베리가 짓궂은 미소를 지으며 앞으로 떠밀어 댑니다. 결국 당신은 가능한 한 가까이 다가갑니다.>\n\n나를 이 감옥에서 풀어다오, 필멸자여. 그럼 이 은혜를 갚겠다. 나는 이따위 하찮은 꼭두각시나 그 주인보다 훨씬 지고한 힘과 뜻을 같이하고 있느니라. 저놈들은 진정한 힘이 무엇인지 새까맣게 모른다. \n\n나를 억류하는 구속의 인장만 있으면 된다. 나머지는... 내가 알아서 해결할 수 있어.\n\n나를 풀어주면 가공할 힘을 주마.', '', '', '', '', '', '', 39653),
(64090, 'koKR', '힘껏 쥐어짜기', '곤봉얼굴의 의견에 따라 훌른이 끌려간 것으로 추정되는 장소로 이동한 후, 섞여들어야 합니다.', '행방불명됐다던 그 푸르딩딩한 양반이 영혼을 있는 대로 짜내는 장소로 끌려간 모양입니다. 다행스럽게도 제가 훤히 꿰고 있는 동네죠.\n\n이렇게 합시다. 그곳에서 일하는 것처럼 부드럽게 섞여든 다음, 엘크 양반을 찾아 송곳니의 눈초리를 피하면서 스리슬쩍 빠져나가는 거예요. 알아들으셨습니까?', '', '', '', '', '', '', 39653),
(64086, 'koKR', '키리안 전술가', '오리보스 자치구에 있는 조소그를 만나야 합니다.', '주변을 둘러봐라, $n. 우뚝 선 엘리시안 요새는 우리가 일구어낸 성과임을 여실히 보여주고 있지. 네 덕분이다.\n\n조소그가 다시 한번 오리보스로 와 달라고 요청하더군. 어서 가보는 게 좋을 거다.\n\n중개단의 신뢰는 쉽게 얻을 수 있는 것이 아니니, 조 중개단의 호의를 얻을 절호의 기회를 놓쳐선 안 될 터.\n\n당신에게 더 큰 보상이 들어오게 될지도 모르지.', '', '', '', '', '', '', 39653),
(64085, 'koKR', '나이트 페이 전술가', '오리보스 자치구에 있는 조소그를 만나야 합니다.', '당신의 용감한 활약으로 몽환숲이 다시금 자라날 수 있게 되었어요. 게다가 그 활약에 중개자들의 이목이 다시 한번 당신에게 집중된 모양이에요.\n\n조소그가 오리보스로 와 주실 것을 다시 한번 요청했어요. 어서 가 보시는 게 좋겠어요.\n\n조 중개단의 호의를 얻을 좋은 기회를 날려 버릴 순 없는 노릇 아니겠어요? 중개단의 신뢰는 쉽게 얻을 수 있는 것이 아니니까요.\n\n아마도 당신께 드릴 보상이 더 있는 모양이에요.', '', '', '', '', '', '', 39653),
(64084, 'koKR', '강령군주 전술가', '오리보스 자치구에 있는 조소그를 만나야 합니다.', '강령군주에게 커다란 영광을 불러오셨군요. 다른 이들이 다시금 눈을 돌리게 될 만한 그런 영광을 말입니다.\n\n조소그가 오리보스로 와 주시길 다시 한번 요청했습니다. 어서 가 보십시오.\n\n조 중개단의 호의를 얻을 수 있는 좋은 기회를 날려 버릴 순 없는 노릇 아니겠습니까? 중개단의 신뢰는 노력 없이 얻을 수 있는 게 아니니까요.\n\n생각건대 당신께 드릴 보상이 더 있는 모양입니다.', '', '', '', '', '', '', 39653),
(64083, 'koKR', '죄악의 몰락지 전술가', '오리보스 자치구에 있는 조소그를 만나야 합니다.', '죄악의 몰락지의 위상이 데나트리우스가 그토록 바라 마지않던 것 이상으로 드높아졌습니다! 모두 당신 덕분입니다, $n.\n\n조소그가 다시 한번 오리보스에서 당신과의 만남을 요청했으니 어서 가서 만나보십시오.\n\n중개단의 신뢰는 쉽게 얻을 수 있는 것이 아니니, 조 중개단의 호의를 얻을 이번 기회를 놓쳐선 안 됩니다.\n\n아마도 이번엔 더 큰 보상을 받을 수 있을지도 모르겠습니다.', '', '', '', '', '', '', 39653),
(64080, 'koKR', '현실 자각', '코레인의 창을 사용해 나락살이 전령 $1oa명을 꿰뚫어야 합니다.', '저 하늘에서 나락살이가 날개를 펄럭이며 우리를 도발하는 소리가 들리는군. \n\n하지만 새란 동물은 손으로 붙잡기만 하면 뭉개버릴 수 있는 법이지. \n\n내 창을 줄 테니 어디 조준 실력을 증명해 봐. 몇 놈 끌어내려 응징하란 얘기야. \n\n무조건 창을 써야 해. 놈들 사이를 쏘다니며 땅으로 내려오게끔 추적을 유도해선 안 돼. 그건 논점에 어긋나는 짓이니까.\n\n당신이 놈들을 하늘에서 끌어 내리는 모습을 보고 싶어.', '', '', '', '', '', '', 39653),
(64070, 'koKR', '한결같은 싸움꾼의 자세', '나락살이 금속 조각 $1oa개를 수집해야 합니다.', '우리 군대는 언제나 무기, 방어구, 병력 부족에 시달리고 있소. 고질적인 문제이지.\n\n증원군이 속속들이 도착하곤 있는데, 이 추세면 내가 모두에게 제대로 된 무장을 들려줄 수가 없소. 완전한 설비를 갖춘 가열로와 조수가 없는 것도 이 문제에 단단히 한몫하고 있지.\n\n하지만 이가 없으면 잇몸이라도 써야 하는 법. 나가서 나락살이를 살펴 금속 조각을 최대한 모아다 주시오. 쓸 만한 무기로 바꿀 방법을 궁리해 보리다.', '', '', '', '', '', '', 39653),
(64065, 'koKR', '현지 재료', '파편가죽 갈퀴발톱 $1oa개, 뿔동이 발 $2oa개, 칼날날개 가시 $3oa개를 채취해야 합니다.', '코르시아는 독특한 곳이란다. 야생동물부터 다른데, 오랜 세월 금고와 그 안의 별의별 소장품에 노출된 영향이 아닐까 싶구나.\n\n실험에 임할 준비는 되었느냐? 재료를 넉넉하게 확보하는 것이 첫째란다.\n\n구도자의 성원 근처에서 파편가죽, 뿔동이, 칼날날개를 찾을 수 있을 것이야. 바늘에 안 찔리게 조심하렴!', '', '', '', '', '', '', 39653),
(64043, 'koKR', '치유사 급구 - 바로 당신을 원함!', '구도자의 성원에서 부상당한 성약의 단 아군 $1oa명을 회복시켜야 합니다.', '전장에 부상자가 많아도 너무 많소! \n\n\'두드려서 해결하기\'가 세상 만물에 통하진 않는다오. 치유사가 더 필요하오.\n\n냉큼 내 장치를 갖고 나가서 부상자를 일으켜 세우시오!', '', '', '', '', '', '', 39653),
(64042, 'koKR', '밤의 의식', '준비 작업과 의식을 도와야 합니다.', '티란데에게 허락된 시간이 얼마 없으니 서둘러 행동해야 한다. \n\n<근심에 젖어 인상을 찡그리는 이세라>\n\n밤 전사를 더 많이 모았으면 좋으련만. 지금 이 정도로 충분하길 빌며 진행하는 수밖에 없겠구나.\n\n<고개를 가로젓는가 싶더니 결의를 세운 표정을 짓는 이세라>\n\n시작하기에 앞서 의식 준비를 마쳐야 한다. 마지막 남은 물품들을 숲으로 가져오너라.', '', '', '', '', '', '', 39653),
(64018, 'koKR', '돌의 무게', '돌 군단을 도와 보급품과 령을 전달해야 합니다.', '대장정은 계속되고 있네, $p. 돌 군단은 전세를 뒤집을 걸세.\n\n우선 동맹군에 보급품을 전달해야 하네. 땅덩어리가 파괴된 코르시아의 여건상, 병력에 보급품을 공급할 수 있는 건 우리뿐일세.\n\n두 번째로 할 일은 나락살이와 포식자를 처리하는 걸세. 내게 아주 간단한 전략이 있어. 나락살이에 령을 투하하는 거지. 그럼 포식자가 령에 이끌러 공격할 것이야. 포식자가 나락살이의 숨통을 끊든, 나락살이가 포식자의 숨통을 끊든 둘 중 하나겠지. 어느 쪽이든 우리에겐 이득일세.', '', '', '', '', '', '', 39653),
(64014, 'koKR', '나락 설명회', '베나리에게 도움을 요청하여 격노뿔피리를 나락에 결속해야 합니다.', '영광스러운 전투의 막을 올리기 전에 마지막으로 해결해야 할 과업이 있다. 뿔피리를 나락에 고정해야지만 그 소리가 저 사악한 영역을 둘러싼 방벽을 꿰뚫을 수 있느니라. \n\n고정하는 방법에 관해서는 나도 모른다. 그 나락이란 장소의 불가사의함에 정통한 자를 찾아라. 분명 너를 인도해줄 수 있을 것이니.\n\n필요한 순간에 격노뿔피리를 울리면 다니카와 자매들이 부름에 응할 것이니라.', '', '', '', '', '', '', 39653),
(64012, 'koKR', '죽음의 진군의 보급품', '코르시아 수호자의 안식처에 있는 여공작 밍크스와 대화해야 합니다.', '간수의 진군을 막기 위한 네 노력은 결코 간과되지 않았다. 원하는 것이 힘이라면 지금처럼 정진하거라. 내 어느 정도는 도움을 줄 수 있을 것 같으니.', '', '', '', '', '', '', 39653),
(64007, 'koKR', '성약의 단의 진격', '나락으로 진격할 성약의 단 병력을 집결시켜야 합니다.', '널 비롯한 아제로스의 영웅들이 맹활약을 펼쳐준 덕분에 성약의 단은 강성해졌다. 그러나 간수가 다음 행동에 나설 때까지 기다리는 것도 이젠 한계에 봉착했느니라.\n\n나락으로 가는 길은 열렸고, 우리 병력은 준비를 마쳤다.\n\n$n, 성약의 단이 네 신호를 기다린다.', '', '', '', '', '', '코르시아에 있는 볼바르 폴드라곤과 대화해야 합니다.', 39653),
(63994, 'koKR', '나락 방랑자의 정체', '탈갈란의 나락 방랑자 시련에 참여해야 합니다.', '코르시아의 예언에는 우리를 재앙에서 구원할 나락 방랑자가 도래하는 날이 올 것이라고 나와 있소. \n\n오늘이 바로 그날일지도 모르겠구려. 아닐 수도 있지. 그대의 령을 살펴 주장이 사실인지 확인하고 싶소.\n\n그대의 말이 사실이라면 본격적인 대화를 나누기에 앞서 엄숙한 맹세에 따라 그대의 령을 강화할 것이오.', '', '', '', '', '', '', 39653),
(63990, 'koKR', '한밤의 칼날', '지식의 매장터에서 단서를 찾아야 합니다.', '고된 추적 끝에 다른 밤 전사들에 관한 유력 단서 두 개를 발견했네. 첫 번째 단서는 바로 이곳 말드락서스에 있지.\n\n이 탑에는 말드락서스에 당도한 자들에 관한 기록이 보관되어 있네. \"한밤의 칼날\"이란 인물에 대한 내용이 있더군. 짐작건대 우리의 다음 밤 전사일 걸세.\n\n이곳으로 오면서 적잖은 수의 덫을 마주쳤네. 십중팔구 탑 안에는 더 많이 있을 테지. 우리를 막으려는 사람이 있는 게야.\n\n그 속셈을 이루게 둘 순 없지.', '', '', '', '', '', '', 39653),
(63989, 'koKR', '개성 넘치는 수액', '투사의 망루에서 역병이의 감염 능력 시험을 도와야 합니다.', '제자야! 마침 찾고 있었다.\n\n케빈이 우리 실험에 아주 혁혁한 공을 세우지 않았더냐? 해서 다른 수액괴물들도 훈련시켜 조수 역할을 맡겨볼 생각이란다!\n\n역병이를 데리고 나가 유기 생명체를 감염시키는 능력을 시험해줄 수 있겠니?', '', '', '', '', '', '', 39653),
(63987, 'koKR', '베로르의 분실 소포', '', '', '', '', '', '', '', '', 39653),
(63986, 'koKR', '타자베쉬: 잃어버린 유물을 찾아서', '타자베쉬에 들어가 소레아를 쓰러뜨려야 합니다.', '우리 소중한 나락 방랑자님께서 한 번 더 가볍게 실력 행사를 하실 때가 온 것 같습니다. 타자베쉬 보안 요원들이 우릴 그냥 들여보내진 않겠죠.\n\n하지만 소레아를 반드시 저지해야 합니다. 설령 약간의 물리적인 방법으로... 설득하는... 필요악을 범하는 한이 있더라도 말이죠.\n\n동료들을 데려오세요, 나락 방랑자님. 보안 요원들도 나름대로 숨겨둔 수가 있을 것 같은 예감이 듭니다.', '', '', '', '', '', '', 39653),
(63985, 'koKR', '미지의 시장', '타자베쉬로 가는 납작배를 타야 합니다.', '제가 한번 맞혀볼까요... 타오쿠가 보냈죠? \n\n<당신이 건넨 주화를 살펴보는 타메리>\n\n그래, 타자베쉬로 가고 싶다 이 말씀이시죠. 일반적으로 이방인을 돕진 않지만, 이미 요금을 받았으니... 기쁜 마음으로 도와드리죠.\n\n올라타세요. 참, 손이든 다리든 무슨 일이 있어도 바깥으로 내밀면 안 됩니다. 중계지의 흐름은 꽤 변덕스러운 곳이거든요.', '', '', '', '', '', '', 39653),
(63984, 'koKR', '사공에게 뱃삯을', '오리보스에 있는 타메리와 대화해야 합니다.', '약속을 지키셨군요, 나락 방랑자님. 이제 보상을 받으실 차례입니다.\n\n제 중개단은 오리보스와 타자베쉬를 오가는 연락선을 운영하고 있습니다. 본디 목적은 화물을 수송하는 데 있지만, 세상만사가 그렇듯... 예외는 있기 마련이죠.\n\n이 주화를 받으세요. 타메리에게 보여주면 무사히 시장까지 가실 수 있을 겁니다.\n\n그 이후에 일어나는 일은 본인 책임입니다.\n\n<정중하게 인사한 후 킬킬대는 듯한 소리를 웅얼거리는 타오쿠>', '', '', '', '', '', '오리보스에 있는 타메리와 대화해야 합니다.', 39653),
(63983, 'koKR', '비밀 접선', '시험용 아퀼론을 회수해야 합니다.', '타안라가 고객을 대신해... 몹시... 특별한 물건을 주문했습니다.\n\n현재 키리안에서 새로운 유형의 백인대장을 만들고 있습니다. 아퀼론이라고 칭하더군요. 문제의 시험용 개체를 입수하기 위해 거래 전문가 여럿을 파견했지만, 돌아오지 못했습니다. \n\n당연한 얘기지만 아퀼론을 확보하기 전까진 타안라에게 보내지 못합니다. 그러니 상부상조의 정신을 실천해보는 건 어떨까요?\n\n아퀼론을 찾아 이곳에 가져오시면 타자베쉬에 갈 수 있도록 도와드리겠습니다.', '', '', '', '', '', '', 39653),
(63982, 'koKR', '권한 밖의 일', '야시장에 있는 차원문을 사용한 후 타오쿠와 대화해야 합니다.', '미지의 시장의 위치를 알긴 합니다만, 이동 수단 제공과 관련해서는 어떻게 도와드릴 방도가 없습니다.\n\n대신 일 하나를 처리하는 데 힘을 빌려주기로 하신다면 우리 둘 모두에게 보탬이 될 만한 사람을 소개해 드리겠습니다. 승천의 보루 중개자 구역의 타 교역소에 현상금 사냥꾼이 있어요. 그 사람이라면 나락 방랑자님께 제대로 된 도움을 드릴 수 있을 겁니다... 또, 제가 그 사람에게 받을 물건이 있기도 하고요.\n\n타오쿠를 찾아 타안라가 보냈다고 하세요.\n\n편의를 봐 드릴 겸 차원문을 쓸 수 있게 해드리죠. 동업자 좋은 게 뭐겠어요?', '', '', '', '', '', '타 교역소에서 현상금 사냥꾼 타오쿠와 대화해야 합니다.', 39653),
(63980, 'koKR', '밀수업자 수색', '야시장에서 식별자 타안라와 대화해야 합니다.', '우리 중개자는 언제든 자리를 옮길 수 있도록 하는 데 주안점을 둡니다. 은밀성도 중요하게 여기죠.\n\n그렇다 보니 꽤 많은 도시와 전초기지에 중계지에 자리를 두고 이곳저곳 옮겨다닙니다.\n\n원통하게도 타자베쉬의 위치는 파악이 안 됩니다.\n\n지금 상황에서 최선의 선택은 타 중개단에 물어보는 거예요. 그런 것들의 위치를 파악하는 걸 자랑으로 내세우는 집단이니 말이죠.\n\n레벤드레스 야시장으로 가서 운을 시험해보는 건 어떨까요? 오리보스에 있는 양반들보단 솔직하게 나올지도 모를 일입니다.', '', '', '', '', '', '레벤드레스의 야시장에서 식별자 타안라와 대화해야 합니다.', 39653),
(63979, 'koKR', '어둠 속에 묻어야 할 것들', '소 중개단의 배송 목록을 찾아야 합니다.', '소 중개단의 지도자가 어둠땅에 심각한 위협을 끼치고 있습니다, 나락 방랑자님.\n\n이름은 소레아라고 합니다. 태초의 존재의 유물을 완성한 다음 자신의 영달을 위해 그 힘을 이용할 생각을 하고 있지요.\n\n전해지는 이야기에 따르면, 유물의 편린이 당신 고향 세계에 숨겨져 있다고 합니다. 역사상 중개자가 그곳에 이르는 길을 찾아낸 적은 없습니다. 하지만 소레아가 해낸다면 아제로스 역시 위험에 처하고 말 거예요.\n\n그자를 저지해야 합니다.\n\n이 근처에 소 중개단의 표식이 새겨진 화물이 있습니다. 화물 목록에 지도자의 행방을 추정할 만한 단서가 있을지도 몰라요.', '', '', '', '', '', '', 39653),
(63977, 'koKR', '내부자 거래', '오리보스에 있는 여러 중개자 중개단과 대화해야 합니다.', '전 중개자 문화의 최고 권위자라 해도 과언이 아닙니다. 하지만 중개단 간의 관계는 복잡하고 위태롭죠.\n\n소 중개단은 오리보스에서 존재감이 작은 편입니다. 달리 말하자면 다른 중개단이 제가 모르는 지식을 알고 있을 수도 있다, 이 얘기죠. 한번 수소문해 보세요. 나락 방랑자님의 명성을 이용하면 분명 놓친 정보를 접할 수 있을 겁니다.', '', '', '', '', '', '', 39653),
(63976, 'koKR', '오리보스의 길고양이', '오리보스에서 수수께끼의 접선책을 만나야 합니다.', '아, 나락 방랑자님. 드릴 전언이 있습니다.\n\n구체적으로 말씀드리자면 어떤 인물이 제안을 하나 하고 싶다네요. 목가의 쉼터 뒤에서 만나자고 요청한 것만 제외하면 저도 자세한 사항은 모릅니다.', '', '', '', '', '', '오리보스에서 수수께끼의 접선책을 만나야 합니다.', 39653),
(63973, 'koKR', '수풀사령관 2인방', '수풀사령관 알리오테를 도와 그의 앞길을 가로막는 적을 쓰러뜨리고 군주 드레트날을 처치해야 합니다.', '숨부터 돌리세요, $p 님. 심호흡하시고요.\n\n<천천히 숨을 들이쉬었다 내뱉는 드림위버>\n\n상황이 점점 더 긴장스럽게 고조되고는 있지만, 그렇다고 해서 나락 방랑자님까지 긴장할 필요는 없어요.\n\n다 괜찮아질 거예요. 제 말이 못 미덥다면 알리오테 수풀사령관님과 태쉬무어 수풀사령관님의 위대한 활약을 보고 마음을 놓아 보세요.\n\n두 분은 우리가 갈 길을 내러 언덕으로 올라가셨어요. 눈 깜짝할 사이에 모조리 처리해 두실 걸요?', '', '', '', '', '', '커져가는 어둠이 내려다보이는 다리에서 군주 헤르네를 만나야 합니다.', 39653),
(63970, 'koKR', '어떤 영혼도 버리지 않는다', '고르고아에서 티르낙스의 구조용 요람을 사용해 길 잃은 드루이드 $3oa명을 구출한 후 티르낙스에게 보내야 합니다.', '고르고아에 갇혀 고통받는 영혼들의 절규가 들리십니까?\n\n우리 눈앞에 흐르는 저 뒤틀린 영혼의 강은 잔혹함과 부당한 희생자들의 괴로움으로 가득합니다.\n\n우리의 용감한 드루이드 영혼들이 길 잃은 영혼들을 찾아 강으로 진격했지만, 되레 그 고통의 행렬에 합류한 자들이 많은 것 같아 걱정입니다.\n\n용기를 내어 제 요람과 함께 강으로 나아가십시오. 길 잃은 영혼들을 요람에 태운 다음 저에게 돌아오도록 명령을 내려 주시면 됩니다.', '', '', '', '', '', '커져가는 어둠이 내려다보이는 다리에서 티르낙스를 만나야 합니다.', 39653),
(63969, 'koKR', '다가오는 어둠', '나락살이 의식의 서 $1oa권, 나락살이 서신 조각 $2oa개, 암흑의 골수 $3oa개를 수집해야 합니다.', '겨울 여왕 폐하께서 이 지점에 사냥단을 소집하셨소. 상부 지역에서 거대하고 비정상적인 어둠이 준동하고 있다는 보고가 들어온 탓이라오.\n\n야생 사냥단은 용맹하지만 어리석진 않소. 진격하기 전에 그 어둠의 정체를 파악해야 하오.\n\n이 근처에 있는 적의 시체를 살펴 단서를 찾아보시오.', '', '', '', '', '', '커져가는 어둠이 내려다보이는 다리에서 군주 헤르네를 만나야 합니다.', 39653),
(63964, 'koKR', '중개자의 현상 수배: 암울갈퀴', '암울갈퀴에게서 완전히 자란 골화한 부리를 채취해야 합니다.', '자고로 새로운 땅은 새로운 기회로 가득하기 마련입니다. 이른바 암울갈퀴라고 알려진 야수에게서 온전한 해골 부리를 채취해 가져오시는 분께 상당한 양의 금품을 제공해 드리겠습니다.\n\n심약한 수집가는 굳이 신경 쓰지 않아도 될 일이랍니다.\n\n표본을 습득하거든 수호자의 안식처에 있는 타나시에게 전달해 주시기 바랍니다.', '', '', '암울갈퀴', '', '', '', 39653),
(63963, 'koKR', '중개자의 현상 수배: 도륙난타', '도륙난타에게서 촘촘하게 가시 박힌 가죽을 채취해야 합니다.', '자고로 새로운 땅은 새로운 기회로 가득하기 마련입니다. 이른바 도륙난타라고 알려진 야수에게서 촘촘하게 가시 박힌 가죽을 채취해 가져오시는 분께 상당한 양의 금품을 제공해 드리겠습니다.\n\n심약한 수집가는 굳이 신경 쓰지 않아도 될 일이랍니다.\n\n표본을 습득하거든 수호자의 안식처에 있는 타나시에게 전달해 주시기 바랍니다.', '', '', '도륙난타', '', '', '', 39653),
(63962, 'koKR', '관찰 기록', '코르시아의 투사의 망루에서 관찰 기록 $1oa개를 수집해야 합니다.', '안녕하세요, 나락 방랑자님. 잠시 시간 좀 내어주실 수 있으실는지요?\n\n분명 이미 알고 계시겠지만, 제 중개단에서는 조용히 코르시아 곳곳에 관찰 장치를 설치해 두었습니다. 그렇지만 회수하지 않은 자료는 아무짝에도 쓸모가 없죠. 해서 나락 방랑자님의 힘이 필요합니다.\n\n투사의 망루라면 기록을 수집할 준비가 다 됐을 거예요. 장치 그 자체가 눈에 보이진 않을 거고, 자료가 밝은 보주의 형태로 나타날 겁니다.\n\n자료를 모아다 주시면 두둑하게 챙겨드리지요.', '', '', '', '', '', '', 39653),
(63961, 'koKR', '봉인된 비밀', '코르시아의 투사의 망루에서 봉인된 용기 $1oa개를 회수해야 합니다.', '아, 코르시아라. 과연 어떤 비밀이 드러날까요?\n\n제 협력자들이 그동안 열심히 일해왔답니다. 이 부서진 섬 각지에서 소소하지만 흥미로운 물품을 찾아다녔죠. 아무렴 중요한 물건은 없습니다.\n\n어쨌든 그렇게 확보한 물품을 지정된 상자에 넣어두었는데, 지금 투사의 망루에서 수거할 사람이 와주기만을 기다리고 있습니다. 참고로 내용물과 전달자 모두를 보호하기 위한 난공불락의 봉인으로 잠겨져 있으니 걱정하실 건 하나도 없습니다.\n\n봉인된 용기를 가져다주시면 아쉽지 않게 사례하겠습니다.', '', '', '', '', '', '', 39653),
