(63951, 'koKR', '어두컴컴한 곳', '균형을 잃은 균열석을 사용해 균열에 들어가 균열장막 덫을 파괴하고 균열결속 보르카이 $1a명을 구출해야 합니다.', '존재란 쉬운 개념이 아니다, $p. 현실이 켜켜이 쌓이고 쌓여 만들어진 결과라 할 수 있지.\n\n한데 간수의 덫이 아군을 통상적인 시야에 보이지 않는 그런 균열로 끌어당기고 있더구나.\n\n내 균형을 잃은 균열석을 마련해 두었다. 이것만 있으면 아군을 영원히 잃어버리기 전에 균열에 들어가 그들을 예속하는 덫을 파괴할 수 있을 것이야.\n\n균열장막 덫을 모두 파괴하고 빠져나오너라. 그럼 사로잡힌 병사들이 우리네 현실로 끌려 나올 거다.', '', '', '', '', '', '커져가는 어둠이 내려다보이는 다리에서 후작 신데인 만나야 합니다.', 39653),
(63950, 'koKR', '칼날날개 갈퀴발톱', '칼날날개 갈퀴발톱 $1oa개를 수집해야 합니다.', '내 사냥꾼들에게 있어 이 지역은 아직 생소한 곳이라오. 한데 이곳에도 강대한 야수들이 서식하더군.\n\n그중 하나가 바로 칼날날개요. 섬뜩한 갈퀴발톱과... 보르카이의 기질을 빼닮은 매서운 포식자들이지.\n\n<입꼬리를 올려 사나운 미소를 지어 보이는 헤르네>\n\n놈들의 갈퀴발톱을 뽑아오시오. 신입 사냥꾼들에게 앞으로 어떤 야수와 맞서 싸워야 하는지 알려주는 데 사용하겠소.', '', '', '', '', '', '', 39653),
(63949, 'koKR', '운명을 빚다', '코르시아와 나락 전역에서 간수의 활동을 타도해야 합니다. 성약의 단 습격 및 일일 퀘스트 완료, 보물 획득, 희귀 생명체 및 토르가스트의 고문관 처치를 통해 달성할 수 있습니다.', '간수의 힘과 악의가 끊임없이 거세지고 있소. 우리의 저항 역시 강해져야만 하오.\n\n동맹과 함께하시오, $n. 우리 모두를 집어삼키려하는 어둠을 몰아내 주시오.\n\n힘을 합치면 이길 수 있소.\n\n목적의 길이 그대의 손을 인도하길.', '', '', '', '', '', '', 39653),
(63944, 'koKR', '코르시아가 기다린다', '코르시아 수호자의 안식처에 있는 탈갈란에게 보고해야 합니다.', '준비하거라, $n. 우리 동맹이 코르시아에서 네 도착을 기다리고 있노라.', '', '', '', '', '', '', 39653),
(63936, 'koKR', '포식된 령', '각성의 강어귀에 있는 포식자에게서 포식된 령 $1oa개를 회수해야 합니다.', '시카에게 좋은 생각이 있어요!\n\n포식자들은... 포식을 해요. 뭐든지 먹어 치우죠! 그러니 령도 먹을 거예요.\n\n포식자에게서 령을 빼앗아 우리가 쓰는 것도 가능하지 않을까요?', '', '', '', '', '', '', 39653),
(63935, 'koKR', '귀중한 뿌리', '코르시아의 금고에서 령 잔류물 $1oa개를 수집해야 합니다.', '코르시아. 고통받는 자매 숲.\n\n하나 난무하는 파괴의 단말마 사이에도 아직 희망은 남아 있네. \n\n령을 모아 새롭게 재건하는 걸세.', '', '', '', '', '', '', 39653),
(63934, 'koKR', '공격적인 우편', '학자의 은신처에서 도둑맞은 전갈 $1oa개를 회수해야 합니다.', '안녕하십니까, 필멸자님!\n\n전 박진감 넘치는 코르시아 곳곳에 자리한 동맹에 전갈을 전달하는 임무를 수행하고 있습니다. 하지만 과업을 완수하지 못했습니다.\n\n본래 전하기로 했던 전갈을 그만 나락살이에게 도둑맞고 말았습니다. 엎친 데 덮친 격으로 전갈을 별의별 엉뚱한 장소에 가져다 놓았지 뭡니까.\n\n혹시 전갈을 찾아 반환해 주실 수 있겠습니까? 그럼 제가 원래 받기로 되어 있던 사람들에게 전하겠습니다.\n\n감사합니다!', '', '', '', '', '', '', 39653),
(63924, 'koKR', '고라크 발톱 우상', '회고의 성물함에 있는 기록관 로쉬르에게 고라크 발톱 우상을 가져가야 합니다.', '<기록관의 전서와 친숙한 당신은 이것이 유실된 유물 중 하나임을 확신하였습니다.\n\n기록관 로쉬르에게 전달하면 회고의 성물함에 우상을 보관할 것입니다.>', '', '', '', '', '', '', 39653),
(63923, 'koKR', '랭 가문의 나무 조각품', '회고의 성물함에 있는 기록관 로쉬르에게 랭 가문의 나무 조각품을 가져가야 합니다.', '<기록관의 전서와 친숙한 당신은 이것이 유실된 유물 중 하나임을 확신하였습니다.\n\n기록관 로쉬르에게 전달하면 회고의 성물함에 나무 조각품을 보관할 것입니다.>', '', '', '', '', '', '', 39653),
