(63921, 'koKR', '자아성찰의 반지', '회고의 성물함에 있는 기록관 로쉬르에게 자아성찰의 반지를 가져가야 합니다.', '<기록관의 전서와 친숙한 당신은 이것이 유실된 유물 중 하나임을 확신하였습니다.\n\n기록관 로쉬르에게 전달하면 회고의 성물함에 반지를 보관할 것입니다.>', '', '', '', '', '', '', 39653),
(63920, 'koKR', '수수께끼의 해독 장치', '회고의 성물함에 있는 기록관 로쉬르에게 수수께끼의 해독 장치를 가져가야 합니다.', '<기록관의 전서와 친숙한 당신은 이것이 유실된 유물 중 하나임을 확신하였습니다.\n\n기록관 로쉬르에게 전달하면 회고의 성물함에 장치를 보관할 것입니다.>', '', '', '', '', '', '', 39653),
(63919, 'koKR', '족쇄의 책: 고통받는 마술사', '하늘빛 책장 $1oa장을 수집한 후, 회고의 성물함에 있는 기록관 로쉬르에게 가져가야 합니다.', '<책에서 낮게 속삭이는 목소리가 지직거리는 잡음과 섞여 들려옵니다. 구체적으로 어떤 의미인지는 알아듣는 게 불가능에 가깝지만, 하늘빛 책장을 되찾아 달라는 반복적인 요청만큼은 파악이 됩니다.\n\n책을 펼쳐 쭉 넘겨보니 빠진 책장이 무척이나 많습니다.\n\n책장을 회수하면 기록관에게 책을 반환하여 복원할 수 있을지도 모릅니다.>', '', '', '', '', '', '', 39653),
(63918, 'koKR', '암울한 징조의 방첨탑', '회고의 성물함에 있는 기록관 로쉬르에게 암울한 징조의 방첨탑을 가져가야 합니다.', '<기록관의 전서와 친숙한 당신은 이것이 유실된 유물 중 하나임을 확신하였습니다.\n\n기록관 로쉬르에게 전달하면 회고의 성물함에 방첨탑을 보관할 것입니다.>', '', '', '', '', '', '', 39653),
(63917, 'koKR', '영생의 조각상', '회고의 성물함에 있는 기록관 로쉬르에게 영생의 조각상을 가져가야 합니다.', '<기록관의 전서와 친숙한 당신은 이것이 유실된 유물 중 하나임을 확신하였습니다.\n\n기록관 로쉬르에게 전달하면 회고의 성물함에 조각상을 보관할 것입니다.>', '', '', '', '', '', '', 39653),
(63916, 'koKR', '수상쩍은 토양 자루', '회고의 성물함에 있는 기록관 로쉬르에게 수상쩍은 토양 자루를 가져가야 합니다.', '<기록관의 전서와 친숙한 당신은 이것이 유실된 유물 중 하나임을 확신하였습니다.\n\n기록관 로쉬르에게 전달하면 회고의 성물함에 토양을 보관할 것입니다.>', '', '', '', '', '', '', 39653),
(63915, 'koKR', '죽음의 로아의 북', '회고의 성물함에 있는 기록관 로쉬르에게 죽음의 로아의 북을 가져가야 합니다.', '<기록관의 전서와 친숙한 당신은 이것이 유실된 유물 중 하나임을 확신하였습니다.\n\n기록관 로쉬르에게 전달하면 회고의 성물함에 북을 보관할 것입니다.>', '', '', '', '', '', '', 39653),
(63914, 'koKR', '이해의 암호', '회고의 성물함에 있는 기록관 로쉬르에게 이해의 암호를 가져가야 합니다.', '<기록관의 전서와 친숙한 당신은 이것이 유실된 유물 중 하나임을 확신하였습니다.\n\n기록관 로쉬르에게 전달하면 회고의 성물함에 암호를 보관할 것입니다.>', '', '', '', '', '', '', 39653),
(63913, 'koKR', '불안정한 폭발성 보주', '회고의 성물함에 있는 기록관 로쉬르에게 불안정한 보주를 가져가야 합니다.', '<기록관의 전서와 친숙한 당신은 이것이 유실된 유물 중 하나임을 확신하였습니다.\n\n기록관 로쉬르에게 전달하면 회고의 성물함에 장치를 보관할 것입니다.>', '', '', '', '', '', '', 39653),
(63912, 'koKR', '천공의 어둠땅 해도', '사후 세계 항해 연구물 두루마리 $1oa개를 수집한 후, 회고의 성물함에 있는 기록관 로쉬르에게 가져가야 합니다.', '<유물을 발견한 당신은 기록관의 전서에서 본 적이 있음을 떠올렸습니다.\n\n아무래도 이용 가치가 없다고 판단한 나락살이가 버린 듯합니다.\n\n기실 어둠땅 사후 세계의 상대적인 위치를 가늠하는 데 필요한 도표 자료가 없으면 무용지물이긴 합니다. 사망한 학자들에게서 도표 자료를 회수하면 온전히 제대로 기능하는 해도를 기록관에게 반환할 수 있을지도 모릅니다.>', '', '', '', '', '', '', 39653),
(63911, 'koKR', '노래하는 강철 주괴', '나락살이 침략자를 처치한 후, 회고의 성물함에 있는 기록관 로쉬르에게 노래하는 강철 주괴를 가져가야 합니다.', '<떨리는 선율로 통곡하는 주괴>\n\n오호통재라! 저 불한당들이 간악한 목적을 이루고자 일말의 측은지심도 없이 나의 육신을 망치로 두들기는구나.\n\n가증스럽고 가증스러운 족속이로다!\n\n<고음의 전투의 함성을 내지르는 주괴>\n\n저 나락살이 놈들을 혼쭐내 주어라!', '', '', '', '', '', '', 39653),
(63910, 'koKR', '황천별', '황천별을 충전한 후, 회고의 성물함에 있는 기록관 로쉬르에게 가져가야 합니다.', '<유물을 발견한 당신은 기록관의 전서에서 본 적이 있음을 떠올렸습니다.\n\n마력의 근원은 실질적으로 텅 빈 상태지만, 정제되지 않은 순수한 령에 노출하면 복원될 것입니다. 주변에 있는 균열이면 충분할 듯합니다.>', '', '', '', '', '', '', 39653),
(63909, 'koKR', '변신수의 복면', '회고의 성물함에 있는 기록관 로쉬르에게 변신수의 복면을 가져가야 합니다.', '<기록관의 전서와 친숙한 당신은 이것이 유실된 유물 중 하나임을 확신하였습니다.\n\n기록관 로쉬르에게 전달하면 회고의 성물함에 복면을 보관할 것입니다.>', '', '', '', '', '', '', 39653),
(63908, 'koKR', '신성한 의지의 보루방패', '회고의 성물함에 있는 기록관 로쉬르에게 신성한 의지의 보루방패를 가져가야 합니다.', '<기록관의 전서와 친숙한 당신은 이것이 유실된 유물 중 하나임을 확신하였습니다.\n\n기록관 로쉬르에게 전달하면 회고의 성물함에 방패를 보관할 것입니다.>', '', '', '', '', '', '', 39653),
(63904, 'koKR', '몽환숲의 심장', '숲의 심장부를 조사해야 합니다.', '내 인장은 숲의 심장부에 숨겨두었다. 나락의 병사들로부터 안전하게 지키기 위해서였지.\n\n한데 지원을 청하는 뿔피리 소리가 들려오는구나.\n\n동료들을 데리고 가보거라. 무엇 때문에 도움을 청했는지 경위를 알아보도록.', '', '', '', '', '', '숲의 심장부 바깥에 있는 겨울 여왕에게 가야 합니다.', 39653),
(63903, 'koKR', '성소 습격', '지배의 성소에서 실바나스 윈드러너를 쓰러뜨려야 합니다.', '간수가 네 성약의 단의 인장을 모두 손에 넣었다. 두말할 것도 없이 나락을 탈출해 오리보스에서 심판관의 인장을 훔칠 속셈이겠지.\n\n그 사태만큼은 방지해야 한다.\n\n토르가스트 최정상에는 간수의 권좌라 할 수 있는 지배의 성소가 있다. 그 어둠의 영지로 발을 내디딜 때가 되었구나.\n\n분명 실바나스 윈드러너가 병력을 이끌고 우리를 막으려 들 것이다. 반드시 실바나스를 쓰러뜨리고... 그 여자의 손아귀에서 안두인 린을 구출해야 해.\n\n병력을 불러 모아라, $n. 칠흑의 기사단이 너와 함께할 것이다.', '', '밴시 여왕은 간수의 계획의 핵심이다. 그 여자를 찾아... 저지하도록.', '실바나스 윈드러너', '', '', '', 39653),
(63902, 'koKR', '호외요, 호외!', '다니카와 함께 코르시아로 날아가 볼바르에게 소식을 전해야 합니다.', '따라와라, 친우여. 이 부정한 장소를 떠나도록 하지.\n\n눈이 패퇴했다는 소식을 들으면 네 동지들도 반색할 것이니라. 내가 데려다주지.\n\n떠날 준비되면 말하거라, $n.', '', '', '', '', '', '', 39653),
(63901, 'koKR', '시선 집중', '종착지 단상으로 이동한 후 격노뿔피리를 사용해 오딘의 분노를 소환해야 합니다.', '나락 방랑자님이 수확하신 비탄과 분노의 조합이면 원하는 용도대로 쓰기에 충분하실 겁니다. 아주 높은 확률로. \n\n이 경솔하디 경솔한 행각을 계속하고 싶으시다면 영혼의 강이 토르가스트를 향해 위로 흘러가는 종착지 단상에서 뿔피리를 사용하도록 하세요. 마력이 가장 강력한 곳입니다.\n\n간수의 눈이 나락 방랑자님의 황금빛 동료들에 이끌려 나타날 테지요. 다른 건 몰라도 당신이 최후를 맞는 일은 없으면 좋겠습니다. 투자금이 허공에서 분해되는 광경은 진심으로 보고 싶지 않거든요.', '', '간수의 눈은 간수의 적을 찾아 나락을 샅샅이 뒤집니다.', '간수의 눈', '', '', '', 39653),
(63899, 'koKR', '족쇄의 책: 미치광이 마녀', '진홍빛 책장 $1oa장을 수집한 후, 회고의 성물함에 있는 기록관 로쉬르에게 가져가야 합니다.', '<책에서 낮게 속삭이는 목소리가 지직거리는 잡음과 섞여 들려옵니다. 구체적으로 어떤 의미인지는 알아듣는 게 불가능에 가깝지만, 진홍빛 책장을 되찾아 달라는 반복적인 요청만큼은 파악이 됩니다.\n\n책을 펼쳐 쭉 넘겨보니 빠진 책장이 무척이나 많습니다.\n\n책장을 회수하면 기록관에게 책을 반환하여 복원할 수 있을지도 모릅니다.>', '', '', '', '', '', '', 39653),
(63896, 'koKR', '저주받은 자의 눈물', '영혼의 강 고르고아에서 저주받은 자의 눈물 $1oa개를 모아야 합니다.', '도구를 나락에 고정해 나락 방랑자님이 원하는 효과를 발휘하게 하려면 이 저주받은 감옥에 갇힌 영혼들이 감내한 순수하고 정제되지 않은 고뇌를 주입해야 합니다. \n\n여긴 슬픔이 충만한 곳이니, 간단하게 구할 수 있을 거예요. 멀리 나갈 것도 없이 고르고아에 가면 됩니다. 저주받은 자들이 영혼의 강에 휩쓸려 가면서 결정화된 비탄의 눈물을 잔뜩 흘리거든요.\n\n그들의 슬픔에 압도당하지 않도록 조심하셔야 합니다.', '', '', '', '', '', '저주받은 자의 눈물을 고르고아 경계에 있는 베나리의 투영에게 가져가야 합니다.', 39653),
(63895, 'koKR', '자루 챙기기', '베나리의 자루에서 찾은 운송 장치를 시험해봐야 합니다.', '흥미롭군요. 청각 분석 장치와 실체 없는 망토라. 잘 갖고 계십시오, $n 님. 왠지 요긴하게 쓸 구석이 있어 보입니다.\n\n아, 제게 어울리는 특별한 물품도 있네요. 제 착각이 아니라면, 대부분 그렇지만, 이건 투영 장치일 겁니다. 아주 유용하죠!\n\n이건 뭘까요? 일종의 운송 장치로 보이는 군요. 바로 시험해보는 게 좋겠습니다.\n\n그 말은 당신이 시험해야 한다는 뜻입니다.', '', '', '', '', '', '', 39653),
(63892, 'koKR', '예언자의 룬 석판', '룬 석판 $1oa개를 수집한 후, 회고의 성물함에 있는 기록관 로쉬르에게 가져가야 합니다.', '<주머니 안에 룬 석판이 하나 들어 있습니다. 마치 보이지 않는 손이 건드리기라도 하는 것처럼 혼자서 회전하거나 뒤집힙니다.\n\n돌에 브리쿨의 언어를 희미하게 닮은 룬이 새겨져 있으며, 석판 뒷면에는 묶음의 일부임을 시사하는 내용이 보입니다.>', '', '', '', '', '', '', 39653),
(63867, 'koKR', '분노 제어', '영혼의 강에서 흡수 장치를 사용해 분노한 망령에게서 분노를 흡수해야 합니다.', '전 음악가는 아니지만, 타자베쉬에서 공연을 즐기며 오랜 시간을 보낸 경험은 있습니다.\n\n이 뿔피리에 목소리를 부여하려면 강렬한 감정을 수확해야 할 거예요.\n\n불행하게도 영혼의 강에 갇힌 저주받은 이들은 내면에서 걷잡을 수 없는 분노가 끓어오르죠. 이 흡수 장치로 분노한 망령에게서 분노를 뽑아내 도구에 주입하세요.\n\n그렇게 모은 격노의 절규로 나락을 꿰뚫고 동맹에 닿을 수 있을 겁니다.\n\n대신 그 선율은... 인기를 끌기에 여러모로 어렵겠지요.', '', '', '', '', '', '영혼의 강 경계에서 베나리의 투영을 찾아야 합니다.', 39653),
(63864, 'koKR', '무시무시한 혼합차', '불안정한 잿불불꽃 $2oa개를 진화해야 합니다.', '무덤먼지와 반점 물풀은 무시무시한 배합이라네. 통통이가 그 재료를 써서 차를 잔뜩 만들었더군.\n\n보통 끔찍한 게 아닌지라 이 내가 찻주전자째로 불길에 던져버렸을 정도라네. 그런데 수분이 넘쳐나서 불을 끄는 데 아주 탁월한 효과를 발휘하는 게 아니겠나! \n\n통통이가 차를 짊어지고 자네를 따라다닐 걸세. 조바알의 용광로에 있는 불안정한 잿불불꽃에 던져 잘 사용해 보게나.', '', '', '', '', '', '', 39653),
(63863, 'koKR', '무리의 단결', '말페스투스, 도모노우스, 퓨리스를 처치해야 합니다.', '네미아와 나는 경쟁하는 관계에 있지만, 이토록 큰 위협이 닥치면 힘을 하나로 모으지. 깃사자와 스라수호기는 전장에서 매서운 전투원으로 활약할 수 있으니 말이다.\n\n다가올 전투에서 너를 도울 수만 있다면 우리 두 사람 모두 영광으로 알겠다.\n\n아군을 위협하는 간수의 용사를 무찌르는 데 안디라나 가타마토스가 힘을 보태도록 허락해다오.', '', '', '', '', '', '', 39653),
(63861, 'koKR', '수집의 시작', '회고의 성물함에서 기억의 전서를 회수해 기록관 로쉬르에게 전달해야 합니다.', '과업을 이어나가려면 학술 연구에서 제일 중요한 물품을 회수해야 합니다. 바로 잃어버린 전서를 말이죠.\n\n시간이야 걸리겠지만 과업을 해나갈수록 전서의 책장은 풍성해지고 다채로워질 겁니다. 코르시아가 영겁에 걸쳐 쌓아 올려진 것과 같은 이치라 할 수 있지요.\n\n그래서 물건은 어디 있느냐? 원래는 코르시아의 심층부, 즉 남쪽에 있는 사색의 동굴 내부에 있었습니다.\n\n아직 간수의 병력이 못 찾아냈기를 빌죠.', '', '', '', '', '', '', 39653),
(63860, 'koKR', '영원한 학자의 부적', '회고의 성물함에 있는 기록관 로쉬르에게 훼손된 부적을 가져가야 합니다.', '<부적이 찌그러진 것도 모자라 곳곳에 흙먼지가 묻어 있습니다. 누가 여기 보관했는지는 몰라도 거칠게 다룬 흔적이 역력합니다.\n\n기록관 로쉬르에게 전달하면 회고의 성물함에 이 부적을 보관할 것입니다.>', '', '', '', '', '', '', 39653),
(63857, 'koKR', '영원의 목소리', '계획을 들어야 합니다.', '<자신의 앞에 있는 장엄한 존재들과 저 멀리까지 늘어져 있는 무수한 관문을 바라보는 볼바르>\n\n이 방은... 실로 경이롭구나.\n\n하나 외경에 빠져있을 시간이 없다. 영광의 목소리에게 속히 회합을 시작하라고 촉구해야겠군.', '', '', '', '', '', '오리보스 자치구로 가야 합니다.', 39653),
(63856, 'koKR', '성약의 단의 회합', '탈이나라와 대화하여 심판관의 방에 들어가야 합니다.', '간수가 나락에 갇혀있다곤 해도, 그의 잔인함은 감옥의 경계 너머까지 뻗어 나가고 있다.\n\n집정관께서 공격의 여파로부터 회복하고 있으시니 다행일 따름이지. 다만 그분의 상처에... 심란한 성질이 깃들었다고 들었다.\n\n무궁한 존재들과 동맹이 심판관의 방에서 그대와 폴드라곤 대영주를 기다리고 있다. 길을 열어주마. \n\n이는 그분의 말씀이니라.', '', '', '', '', '', '', 39653),
(63855, 'koKR', '손쉬운 통행', '코르시아와 베나리의 은거처를 잇는 연결망을 구축해야 합니다.', '코르시아는 기회의 보고입니다. 흥미로운 물체들이 천지에 널렸죠.\n\n그래서 경이를 접할 수 있을 거란 기대감에 만반의 준비를 해왔답니다. 적당한 자리를 찾아 이곳과 제 은거처를 잇는 영구적인 연결망을 만들어 보죠.\n\n우리의 협업은 아직 끝나지 않았습니다.', '', '', '', '', '', '', 39653),
(63853, 'koKR', '불꽃 사냥', '테오타르를 위해 무한의 인페르누스를 처치해야 합니다.', '자네 눈에도 보이나? \n\n시야 언저리에서 꿋꿋이 버티면서... 밝은 빛을 뿜어내고 있잖나!\n\n주변에 불과 재를 떠올리게 하는 놈팡이가 멀쩡히 버티고 서 있는데 어찌 휴식과 차 한 잔의 여유를 즐길 수 있겠는가?\n\n내 부탁하겠네, 나락 방랑자... 내가 제일 좋아하는 차를 모두 함께 음미할 수 있도록 놈을 없애주게나!', '', '조바알의 용광로에 자리한 대장간처럼, 무한하게 타오릅니다.', '무한의 인페르누스', '', '', '', 39653),
(63849, 'koKR', '청각 보조', '데스모테론에 청각 분석 장치를 설치하여 베나리가 거주자들을 도청하도록 도와야 합니다.', '참 절묘하군요! 저 개인적으로... 관심을 두고 있는 장소로 이동되시다니요. 아까 건네드린 청각 분석 장치를 설치해 주시면 정상 신호를 연결해 보겠습니다.\n\n여간 위험한 곳이 아니니 최대한 신중하게 처신하셔야 합니다. 실체 없는 망토를 사용해 모습을 감추셔야 할 거예요.', '', '', '', '', '', '', 39653),
(63848, 'koKR', '감사의 표시', '코르시아 수호자의 안식처에 있는 베나리와 대화해야 합니다.', '나락 방랑자, 그대가 이곳을 찾아옴으로써 고대의 예언은 실현되었소. 그대와 동맹이 우리를 구원하리라 믿어 의심치 않는다오.\n\n내가 그대의 중개자 친구를 너무 매몰차게 박대한 것 같소. 어쨌거나 그대를 코르시아로 안내한 당사자인데 말이오. \n\n베나리에게도 감사의 인사를 전해 주시오. 궁금한 게 있으면 기꺼이 답해주겠단 말도.\n\n궁금한 점이... 한두 개가 아닌 건 확실히 알겠더군.', '', '', '', '', '', '', 39653),
(63845, 'koKR', '오딘의 분노', '선택받은 발키르가 힘을 받아 격노뿔피리와 결속되는 광경을 목격해야 합니다.', '뿔피리는 벼려졌고, 자격 있는 존재가 가려졌도다.\n\n자, $n. 이제 남은 일은 내 선택받은 발키르를 뿔피리와 결속해 힘을 주입하는 것이니라. 그리고 이 나의 분노를 담아 천벌을 내리는 거다.\n\n오너라. 두 눈을 크게 뜨고 목격하거라.', '', '', '', '', '', '', 39653),
(63844, 'koKR', '선택받은 소수', '영예의 원으로 가서 발키르와 대결을 펼쳐 가장 가치 있는 자를 가려내야 합니다.', '다가올 전투에서 다니카와 어깨를 나란히할 발키르가 더 필요하노라. $n, 가장 가치 있는 자를 간택할 영광을 베풀어주마.\n\n가장 강한 자가 영예의 원에서 도전을 청해올 거다. 있는 힘껏 맞서 싸워라, $c|1이여;여;. 무기에 예우를 갖추도록.', '', '', '', '', '', '', 39653),
(63842, 'koKR', '훌륭한 묘안', '나락의 구렁에서 적 15명을 축소하고 나락쥐 $2oa마리를 확대하여 축소된 적을 잡아먹게 해야 합니다!', '잔인한 고문관들 때문에 너무 화나요...\n\n부당하게 이곳으로 보내진 선한 영혼들이 간수의 불한당들에게 고문당하고 있어요. 저항하는 이가 없으니 그 사달이 벌어지는 거죠!\n\n흠. 이젠 제가 왔지만 말이에요. 완벽한 계획으로 놈들에게서 죗값을 받아낼 거예요.\n\n나락 방랑자님 생각은 어때요? 저 불한당들을 혼쭐내는 데 협조해 주시겠어요?', '', '', '', '', '', '나락의 구렁에서 계단 아래 몸을 숨기고 있는 왕자 레나탈을 만나야 합니다.', 39653),
(63840, 'koKR', '엊그제만 해도 콩알 같았는데', '시체를 먹여 게걸충을 성장시킨 후 올라타 승리를 쟁취해야 합니다!', '무슨 생각하시는지 다 아는데, 이 게걸충들은 제 완전한 통제 아래 있어요!\n\n벤티르 잿불 궁정에서 이 말썽꾸러기들을 제압하고 통제하는 비결을 한두 가지 터득했거든요.\n\n저 친구들의 힘을 전투에 활용하고 싶으시면 제 지팡이를 빌려드릴게요. 지팡이만 있으면 명령을 내릴 게걸충을 고른 다음, 적의 시체를 먹게 해 힘과 덩치를 성장시킬 수 있죠.\n\n먹이가 그렇게 많이 필요하진 않아요. 게걸충은 금방금방 큰답니다.', '', '', '', '', '', '나락의 구렁 내 게걸충 마구간 근처에 있는 렐도른을 만나야 합니다.', 39653),
(63839, 'koKR', '단 한 사람의 가치', '나락의 구렁에서 진정으로 가치 있는 자를 찾을 때까지 가치 없는 영혼을 조사해야 합니다.', '난 가치 있는 영혼이 부당하게 나락으로 떨어지는 모습을 직접 목도했다.\n\n여기 이 그레시트도 시종장을 추종하는 졸개들의 농간에 나락으로 떨어질 뻔했지. 나의 보살핌을 받으면서 충분히 자신을 입증해 보였는데 말이다.\n\n간수의 더러운 종자들이 \"가치 없는 자\"로 판결한 영혼들을 유심히 둘러보거라. 하나하나 살펴 정말 최후를 맞아 마땅한 자인지 검증해야 한다.\n\n나락의 구렁을 빠짐없이 헤집어 레벤드레스로 데려갈 만한 영혼을 단 하나만 찾아도 충분한 가치가 있는 일이니라.', '', '', '', '', '', '나락의 구렁에서 계단 아래 몸을 숨기고 있는 왕자 레나탈을 만나야 합니다.', 39653),
(63837, 'koKR', '모든 상황에 어울리는 차', '나락의 구렁에서 통통이와 잡동이를 도와 아군 $2oa명에게 차를 전달해야 합니다.', '나의 소중한 $p 아닌가! 역시 자네라면 시기적절하게 등장해 우리 모두를 따분함의 벼랑에서 구원해줄 줄 알았다네.\n\n마침 자네가 차의 치유력으로 날 잿불 지구에서 구해준 일화를 니야에게 얘기해주고 있었지!\n\n한데 회의적인 시선을 보내는 게 아니겠나. 자네가 통통이와 잡동이를 도와 저 친구에게 보여주는 건 어떻겠나? 차만 있으면 뭐든지 해낼 수 있다는 진리를!', '', '', '', '', '', '나락의 구렁에서 계단 아래 몸을 숨기고 있는 왕자 레나탈을 만나야 합니다.', 39653),
(63836, 'koKR', '흠송곳니 후원회', '흠송곳니가 차원문에서 끌어낸 토르가스트 적 $1oa명을 처치해야 합니다.', '흠송곳니는 제가 본 허드레꾼 중에서 제일 강한 친구입니다! 상상을 초월하죠!\n\n지금 저 밑에서 커다란 토르가스트 차원문에 손을 집어넣고는 악당 녀석들을 끄집어내고 있다니까요!\n\n자기들이 무슨 일을 당하고 있는지도 모르는 눈치입니다. 하하!\n\n저랑 곤봉얼굴은 여기 오자마자 흠송곳니 후원회에 가입했어요.\n\n나락 방랑자님도 들어오시렵니까? 다른 양반들과 같은 방식으로 회원 자격을 얻으셔야 합니다. 저 밑에 내려가 흠송곳니가 차원문에서 끌어내는 녀석과 한판 붙는 거죠!', '', '', '', '', '', '나락의 구렁에서 계단 아래 몸을 숨기고 있는 왕자 레나탈을 만나야 합니다.', 39653),
(63835, 'koKR', '연회의 전령의 분노', '나락의 구렁에서 연회의 전령 테멜을 도와 적 $2oa명에게 독 폭탄을 던져야 합니다.', '아, $p 님! 되게 일찍 돌아오셨네요.\n\n...아니지, 원래 만난 적이 없던가? 가끔 한 번씩 기억이 가물가물해서...\n\n아무튼 적을 약화시킬 묘지지기 카시르의 계획은 순조롭게 진행 중이리라 믿어요.\n\n구체적으로 어떤 계획이었는지는 깜빡했는데, 테멜이 관련된 건 확실해요. 요새는 \"연회의 전령\"이란 명칭을 자청하고 다니던데...\n\n<잠시 당신 너머를 응시하는 영지 관리인>\n\n\"연회의 전령\"이라... 아무래도 제가 생각 이상으로 레벤드레스를 오래 떠나있었던 모양이에요.', '', '', '', '', '', '나락의 구렁에서 계단 아래 몸을 숨기고 있는 왕자 레나탈을 만나야 합니다.', 39653),
(63834, 'koKR', '나락의 구렁의 무기', '나락살이 무기 $1oa개, 섬뜩한 왕관 $2oa개, 망령의 눈 $3oa개를 모아야 합니다.', '죄악의 몰락지 벤티르는 결단코 영혼을 낭비하지 않네. 더불어 돌숨결은 무기를 허비하는 법이 없지.\n\n우리 군대가 재활용하도록 적의 도구를 회수하게.', '', '', '', '', '', '나락의 구렁에서 계단 아래 몸을 숨기고 있는 왕자 레나탈을 만나야 합니다.', 39653),
(63833, 'koKR', '나락의 구렁을 공포의 구렁으로', '나락의 구렁에 있는 적 $1oa명을 처치해야 합니다.', '필경 내 동료나 장군들은 네 힘이 꼭 필요한 임무를 따로 맡기려고 하겠지.\n\n반면에 내 부탁은 간결하다. 현재 온 사방에 적이 포진해 있지 않느냐.\n\n저들을 몰아내 우리의 운신의 폭을 넓히거라.', '', '', '', '', '', '나락의 구렁에서 계단 아래 몸을 숨기고 있는 왕자 레나탈을 만나야 합니다.', 39653),
(63831, 'koKR', '분노의 목소리', '오딘의 용광로에서 수석 대장장이 헬가르를 도와야 합니다.', '나의 발키르를 향한 이 공격에 가차 없는 격노로 응수하리라!\n\n너의 역할이 무엇보다 중요하다, $c|1이여;여;. 오늘 몸소 보여준 용기를 끌어모아 나의 눈을 전장으로 끌어들일지어다.\n\n일단은 그보다 간단한 과업을 내려주지... 바로 나의 분노를 불러일으킬 뿔피리를 만들어야 한다. 수석 대장장이 헬가르가 도와줄 것이야.', '', '', '', '', '', '', 39653),
(63829, 'koKR', '누구도 흘려보내지 않는다', '붙잡힌 열망자 $1oa명을 구출해야 합니다.', '지금껏 잃은 줄로만 알았던 이들을 구출할 기회가 왔다!\n\n수없이 많은 열망자가 간수에게 붙잡혀 있다. 자기 군대의 병사로 만들 심산이었겠지. 그중 저항한 이들은 이 위에 떠 있는 우리에 갇혀 있더구나. 영혼이 부서질 때까지 방치당하고 있는 것이야. \n\n지배의 사슬을 부숴 우리에 갇혀 있는 열망자들을 구출해다오.', '', '', '', '', '', '', 39653),
(63827, 'koKR', '용기의 진언', '탈진한 수호병 $1oa명에게 전서의 글을 낭독해 주어야 합니다.', '우리 병력은 수 시간 내내 쉬지 않고 전투를 치렀다. 지치고 전의가 꺾이는 건 당연한 현상이지.\n\n이 전서를 받거라. 그 안에 적힌 진언을 아군 병사들에게 읊어주도록. 착각은 금물이니라. 일견 아무 의미 없는 글처럼 보이겠지만 실제로는 가공할 힘이 담겨 있다.\n\n탈진한 수호병들이 진언을 들으면 다시 희망을 품게 될 것이다.', '', '', '', '', '', '', 39653),
(63824, 'koKR', '키리안의 습격', '연옥의 요새와 망각의 표면에서 퀘스트 $1oa개를 완료해야 합니다.', '우리가 간수의 병력의 의표를 제대로 찔렀다. 연옥의 요새를 함락시키고 지배의 제단에 있는 그의 용사들을 무찌를 차례다!\n\n나락 방랑자, 그대의 도움이 필요하다. 전장에서 아군을 지원해다오!', '', '', '', '', '', '', 39653),
(63823, 'koKR', '나이트 페이의 습격', '연옥의 요새와 망각의 표면에서 퀘스트 $1oa개를 완료해야 합니다.', '우리가 간수의 병력의 의표를 제대로 찔렀어요. 연옥의 요새를 함락시키고 지배의 제단에 있는 그의 용사들을 무찌를 차례예요!\n\n나락 방랑자님, 당신의 도움이 필요해요. 전장에서 아군을 지원해 주세요!', '', '', '', '', '', '', 39653),
(63822, 'koKR', '벤티르의 습격', '', '', '', '', '', '', '', '', 39653),
(63811, 'koKR', '증오로 가득한 관계', '다니카와 함께 봉밀주 대전당으로 이동하여 오딘에게 헬리아의 만행을 알려야 합니다.', '처음 자매가 실종됐을 때 우린 염려를 감출 수 없었다. 행방을 쫓을 사람들을 보냈지만 돌아오지 않았지. 그다음에 보낸 이들도 마찬가지였다.\n\n우리가 알게 된 사실은 한때 신뢰했던 이의 섬뜩한 배반이었지.\n\n가자. 오딘 님께 우리가 나락에서 뭘 봤는지 알려야 한다.\n\n분명 그 사실에 진노하시겠지만.', '', '', '', '', '', '', 39653),
(63810, 'koKR', '유유상종', '황금 깃털의 흔적을 따라가 깃털을 흘린 것의 정체를 알아내야 합니다.', '나락에서 검게 물든 날개는 수없이 많이 봤지만, 이토록 찬란한 황금빛을 발산하는 건 처음 보네요.\n\n청각 분석 장치가 안정적으로 정보를 전달하고 있으니 깃털의 출처를 알아내는 건 일도 아닙니다.\n\n흔적을 따라가세요, 나락 방랑자님. 언뜻 보기에도 보상이 따를 것만 같은 수수께끼를 놓칠 순 없죠.\n\n당신이 온 곳에서는 금이 가치 있는 물건이잖아요, 그렇지요?', '', '', '', '', '', '', 39653),
(63794, 'koKR', '중개자의 현상금: 굶주린 거수', '굶주린 거수에게서 상당한 양의 포식자 피를 채취해야 합니다.', '자고로 새로운 땅은 새로운 기회로 가득하기 마련입니다. 포식자의 피, 특히 거수의 피를 대량으로 가져오시는 분께 상당한 양의 금품을 제공해 드리겠습니다.\n\n심약한 수집가는 굳이 신경 쓰지 않아도 될 일이랍니다.\n\n표본을 습득하거든 수호자의 안식처에 있는 타나시에게 전달해 주시기 바랍니다.', '', '', '굶주린 거수', '', '', '', 39653),
(63793, 'koKR', '중개자의 현상금: 파멸자 엔시디우스', '파멸자 엔시디우스를 쓰러뜨려야 합니다.', '파멸자 엔시디우스라는 이름을 가진 날개 달린 나락살이가 코르시아에서 활동하는 중개단을 방해하고 있습니다.\n\n누구든 이 악을 처단하는 자에게 보상을 드릴 생각입니다. \n\n다만 조심하세요. 엔시디우스는 강력한 적수입니다. 여러 동료의 힘을 빌려야 쓰러뜨릴 수 있을 거예요.', '', '', '파멸자 엔시디우스', '', '', '', 39653),
(63792, 'koKR', '중개자의 현상 수배: 종결자 녹터너스', '종결자 녹터너스를 쓰러뜨려야 합니다.', '종결자 녹터너스라는 이름을 가진 악랄한 나락의 학자가 코르시아에서 활동하는 중개단을 방해하고 있습니다.\n\n누구든 이 악을 처단하는 자에게 보상을 드릴 생각입니다. \n\n다만 조심하세요. 녹터너스는 강력한 적수입니다. 여러 동료의 힘을 빌려야 쓰러뜨릴 수 있을 거예요.', '', '', '종결자 녹터너스', '', '', '', 39653),
(63791, 'koKR', '중개자의 현상금: 저주살이 발디나르', '저주살이 발디나르를 쓰러뜨려야 합니다.', '저주살이 발디나르라는 이름을 가진 쐐기 갑옷의 나락살이가 코르시아에서 활동하는 중개단을 방해하고 있습니다.\n\n누구든 이 악을 처단하는 자에게 보상을 드릴 생각입니다. \n\n다만 조심하세요. 발디나르는 강력한 적수입니다. 여러 동료의 힘을 빌려야 쓰러뜨릴 수 있을 거예요.', '', '', '저주살이 발디나르', '', '', '', 39653),
(63790, 'koKR', '중개자의 현상금: 군주 아조라크', '군주 아조라크를 쓰러뜨려야 합니다.', '군주 아조라크라는 이름을 가진 강력한 공포의 군주가 코르시아에서 활동하는 중개단을 방해하고 있습니다.\n\n누구든 이 악을 처단하는 자에게 보상을 드릴 생각입니다. \n\n다만 조심하세요. 아조라크는 강력한 적수입니다. 여러 동료의 힘을 빌려야 처단할 수 있을 거예요.', '', '', '군주 아조라크', '', '', '', 39653),
(63789, 'koKR', '지속적인 지원: 학자의 은신처', '학자의 은신처에 있는 나락살이를 소탕해야 합니다.', '나락살이가 우리 거점과 인접한 위치에 교두보를 마련하게 둬선 안 되네. 저들의 눈에 들지 않도록 이 장소를 숨겨두었다고 따르는 자들에게 듣긴 했지만, 정작 내 눈에는 놈들이 들어오는데 어찌 두 발 뻗고 쉴 수 있겠나.\n\n학자의 은신처로 가서 간수의 병력을 정화하게나.', '', '', '', '', '', '', 39653),
(63788, 'koKR', '지속적인 지원: 인도의 성역', '인도의 성역에 있는 포식자를 소탕해야 합니다.', '따르는 자들은 간수의 손에 고향이 파괴당하고 말았네. 이 고난의 시기에 우리가 도와줄 수 있지 않겠나?\n\n이 옆이 바로 인도의 성역이네. 따르는 자들이 경외심과 큰 슬픔을 담아 언급하더군. 그들이 기도를 올리고 진리를 탐구하는 곳이라고 하네. 지금은 포식자가 창궐하고 있는 상황이지.\n\n따르는 자들이 다시금 의식과 기도를 통해 안식을 찾을 수 있도록 포식자들을 소탕하게.', '', '', '', '', '', '', 39653),
(63787, 'koKR', '지속적인 지원: 투사의 망루', '투사의 망루에 있는 파편가죽을 소탕해야 합니다.', '나의 눈들이 알리길 나락에서 코르시아로 통하는 새로운 경로 인근에 투사의 망루가 자리하고 있다는군. 전략 전술 측면에서 요주의 거점이라 할 수 있지.\n\n문제는 파편가죽이 들끓는 지역이라는 점이다.\n\n그곳을 손에 넣기만 하면 서쪽으로 통하는 길을 확보할 수 있다. 간수의 병력의 동태를 살필 관측 지점이 생기는 것은 말할 필요도 없지.', '', '', '', '', '', '', 39653),
(63786, 'koKR', '바람맞이 둥지 휩쓸기', '바람맞이 둥지로 이동해 적대적인 생명체들이 있는 지역을 소탕해야 합니다.', '코르시아의 하늘은 위험하네.\n\n나락살이가 아군을 위협하는 것은 둘째치고, 토착 생물들까지 공공연히 적개심을 드러내고 있지. 날개 달린 아군과 야수들을 위해서라도 하늘을 안전하게 정리해야 해.\n\n토착 비행 생물들은 바람맞이 둥지에 그 뿌리를 두고 있네. 가서 공격적인 생명체들을 일소하게나.\n\n그럼 제공권은 우리에게 넘어올 것이네.', '', '', '', '', '', '', 39653),
(63785, 'koKR', '지속적인 지원: 구도자의 성원', '코르시아의 구도자의 성원에서 간수의 병력을 격퇴해야 합니다.', '조바알의 군대가 끊임없이 맹공을 퍼부으며 이 땅을 파괴하고 있다.\n\n저들에게 확실한 뜻을 보여 주어야 한다. 우린 물러나지 않는다는 걸 보여 주도록 해라, $n.\n\n몽환숲의 힘이 당신과 함께하지.', '', '', '', '', '', '', 39653),
(63784, 'koKR', '돈 따위 중요치 않아', '칙칙한 뿔동이 $1oa마리를 잡아들여야 합니다.', '$p 님! 아무쪼록 안녕하십니까?\n\n이곳에 온갖 흥미로운 물건이 있단 소식을 들어서 말이죠.\n\n그 왜, 은근슬쩍 숨어다니는 뿔동이 녀석들 있잖습니까? 참 보기 힘든 녀석들이죠? 놈들의 반짝이는 가죽만 있으면 저희도 시선을 피하는 데 사용할 수 있습니다. 우두머리를 따돌린다든지 말이에요.\n\n녀석들 몇 마리만 잡아 주세요. 돈은 문제가 안 되니 걱정 마시고, 살려서 잡아 오시기만 하면 됩니다.', '', '', '', '', '', '', 39653),
(63783, 'koKR', '령 회수 작업', '인도의 성역에 있는 포식자에게서 포식된 령 $1oa개를 회수해야 합니다.', '우리가 이곳에서 활동하려면 병력, 보급품, 령의 꾸준한 보급이 이뤄져야 한다. 말할 것도 없이 마지막 자원이 가장 조달하기 어렵지. 하지만 난 수완을 부릴 줄 안다. \n\n이 근처에 풍족한 령 공급원이 있다. 현재 인도의 성역에 들끓고 있는 포식자들을 말하는 것이야. 영혼에게서 끌어내는 것만큼 쉽진 않지만 충분한 힘이 따라준다면 같은 효율을 내지. 할 수 있겠느냐?', '', '', '', '', '', '', 39653),
(63782, 'koKR', '나락살이 의식', '나락살이 고서 $1oa개를 수집해야 합니다.', '나락살이 병력은 다양한 마법사를 휘하에 두고 있다. 우리에게 알려지지 않은 마법이기에 치명적이지.\n\n제대로 된 방어 수단을 준비하려면 우선 놈들의 역량을 알아야 한다. 물론 녀석들의 수법과 의식에 대한 내 호기심을 채울 부수적인 목표도 있지.\n\n부정한 마법사들을 추적한 다음 고서를 가져오너라.', '', '', '', '', '', '', 39653),
(63780, 'koKR', '어디 한번 당해봐라', '나락살이 문장 $1oa개를 수집해야 합니다.', '간수의 군대가 몽환숲에 침입했을 때를 떠올리기만 해도 머리끝까지 화가 치밀어 올라요! \n\n전 화난 만큼 갚아주는 사람이에요.\n\n아니, 정확히는 당신의 도움을 받아 갚아줄 생각이지만요! 나락살이를 처단하고 놈들의 문장을 가져오세요. 몇 놈이나 해치웠는지 확인하고 싶어요. \n\n어디서 입수하든 그런 건 상관없어요. 그냥 그 나락의 족속들에게서 빼앗기만 하면 돼요!', '', '', '', '', '', '', 39653),
(63779, 'koKR', '평범했던 시절의 향취', '제단 공물 $1oa개를 모아야 합니다.', '$p 님, 코르시아의 따르는 자들을 도와야 합니다. 갑작스럽게 너무나 많은 걸 잃은 사람들입니다.\n\n이 근처 인도의 성역에서는 공물을 가져가 제단에 봉헌하곤 했다더군요. 나락살이가 침공한 이후로는 성역에 들어가지도, 귀중한 공물을 회수하지도 못했다고 합니다.\n\n나락 방랑자님이 공물을 회수해 주실 순 없을까요? 따르는 자들이 평범했던 시절의 향취라도 느낄 수 있을 겁니다.', '', '', '', '', '', '', 39653),
(63777, 'koKR', '봉인된 비밀', '학자의 은신처에서 봉인된 용기 $1oa개를 회수해야 합니다.', '아, 코르시아라. 과연 어떤 비밀이 드러날까요?\n\n제 협력자들이 그동안 열심히 일해왔답니다. 이 부서진 섬 각지에서 소소하지만 흥미로운 물품을 찾아다녔죠. 아무렴 중요한 물건은 없습니다.\n\n어쨌든 그렇게 확보한 물품을 지정된 상자에 넣어두었는데, 지금 학자의 은신처에서 수거할 사람이 와주기만을 기다리고 있습니다. 참고로 내용물과 전달자 모두를 보호하기 위한 난공불락의 봉인으로 잠겨져 있으니 걱정하실 건 하나도 없습니다.\n\n봉인된 용기를 가져다주시면 아쉽지 않게 사례하겠습니다.', '', '', '', '', '', '', 39653),
(63776, 'koKR', '관찰 기록', '학자의 은신처에서 관찰 기록 $1oa개를 수집해야 합니다.', '안녕하세요, 나락 방랑자님. 잠시 시간 좀 내어주실 수 있으실는지요?\n\n분명 이미 알고 계시겠지만, 제 중개단에서는 조용히 코르시아 곳곳에 관찰 장치를 설치해 두었습니다. 그렇지만 회수하지 않은 자료는 아무짝에도 쓸모가 없죠. 해서 나락 방랑자님의 힘이 필요합니다.\n\n학자의 은신처라면 기록을 수집할 준비가 다 됐을 거예요. 장치 그 자체가 눈에 보이진 않을 거고, 자료가 밝은 보주의 형태로 나타날 겁니다.\n\n잊지 말고 지상 아래 동굴까지 확인해 주시기 바랍니다!\n\n자료를 모아다 주시면 두둑하게 챙겨드리지요.', '', '', '', '', '', '', 39653),
(63775, 'koKR', '암호와 열쇠', '금고와 구도자의 성원 바깥에서 도둑맞은 암호 $1oa개를 회수해야 합니다.', '코르시아에 있는 지식의 보고에는 여러 겹의 보안책이 적용되어 있는데, 그럴 만한 이유가 있죠.\n\n각 금고의 방벽을 해독하고 비활성화하려면 암호가 필요합니다. 이 이상 적당한 표현은 없을 듯한데, 말하자면 모든 비밀로 통하는 열쇠인 것이죠.\n\n금고 바깥을 살펴 나락살이가 훔쳐 간 암호를 되찾아 주세요. 암호와 더불어, 그 암호가 지키는 비밀을 안전히 간직하도록 하겠습니다.', '', '', '', '', '', '', 39653),
(63774, 'koKR', '넘쳐나는 시체의 향연', '새로운 육체를 만들어 줄 최전선 봉합사에게 몸과 분리된 영혼 $1oa명을 데려가야 합니다.', '주변을 둘러보세요, $p 님. 고개를 돌리는 곳마다 시체의 산이 쌓이고 있어요. 몸과 분리된 영혼들이 전장에 돌아가고 싶어서 안달이 난 상태랍니다.\n\n그들의 열의를 이용해 흐름을 우리 쪽으로 가져오려 합니다.\n\n전장에서 몸과 분리된 영혼을 집결시키고 시체 더미에 있는 봉합사들에게 데려가세요. 저들이 영혼들에게 새로운 몸을 만들어줄 겁니다!', '', '', '', '', '', '남작 드라카에게 가야 합니다.', 39653),
(63772, 'koKR', '기다림의 날개', '연옥의 요새 남쪽 관문 바깥에 있는 아르테메데와 키리안 병력을 지원해야 합니다.', '공격을 지원할 키리안 병력이 도착했네. 이미 우리의 측면을 확보했고 이제는 연옥의 요새 남쪽 관문을 공략할 걸세.\n\n아르테메데에게 보고한 다음 있는 힘껏 키리안을 도와주게나!', '', '', '', '', '', '', 39653),
(63764, 'koKR', '하늘의 지배자', '다니카와 함께 하늘보루에 있는 오딘의 전당으로 날아가야 합니다.', '자매들을 잃어 가슴이 찢어질 것만 같구나. 원수를 갚을 수만 있다면 소원이 없으련만. 하나 내가 마녀의 마법이나 그 뒤를 따르는 나락살이 군대에 상대조차 안 된다는 현실은 스스로도 인지하고 있다.\n\n지혜를 이정표 삼아 이곳을 벗어나야 해. \n\n붙잡혀 있느라 쇠약해지긴 했지만 너를 이곳에서 데리고 나갈 힘은 남아 있다.\n\n가자, 친구여.', '', '', '', '', '', '', 39653),
(63763, 'koKR', '우리 가운데 첩자가 있어', '수호자의 안식처에 있는 볼바르 폴드라곤에게 아조디우스의 머리카락을 가져가야 합니다.', '<아직 온기가 남아 있는 공포의 군주 아조디우스의 인상이 일그러집니다.\n\n수호자의 안식처에 있는 따르는 자들에게 운명필경사의 납치 사실을 알려야 합니다.\n\n더불어 폴드라곤 대영주에게도 이 뜻밖의 위협을 알려야 합니다.>', '', '', '', '', '', '수호자의 안식처에 있는 볼바르 폴드라곤에게 머리카락을 가져가야 합니다.', 39653),
(63762, 'koKR', '환영의 그늘 아래', '운명필경사의 도구를 사용해 환영을 무효화해야 합니다.', '운명필경사님은 이 방에서 환영을 만드는 데 필요한 재료를 마련하셨어요. 다행인 점은 그분의 도구로 환영을 무효화하고 모습을 드러낼 수 있다는 거죠.\n\n우호적인 사람을 보면 그분도 화색하실 겁니다. 제가 장담해요.\n\n과업을 완수하는 데 나락 방랑자님이 정말 큰 공을 세우셨어요. 혼자서는 절대 해내지 못했을 겁니다.', '', '', '', '', '', '', 39653),
(63761, 'koKR', '미뤄진 복수', '인도의 성역에서 포식자 $1oa마리를 처치해야 합니다.', '<위중한 상처를 입어 사력을 다해 입을 여는 코르시아 수호자>\n\n포식자들이... 성소에 몰려들었습니다. 우리 머릿수가 너무나 적었습니다...\n\n저는 아직... 임무를 완료하지... 못했습니다.\n\n목적의 길이시여... 저는...\n\n<희미해지는 수호자의 목소리>', '', '', '', '', '', '', 39653),
(63760, 'koKR', '운명의 메아리', '인도의 성역에 있는 제단에서 운명필경사의 도구를 공명시켜야 합니다.', '사방팔방 포식자가 없는 곳이 없지만 그래도 운명필경사님을 찾아내는 데 집중해야 합니다.\n\n이곳에서 예배를 올린 따르는 자는 제단에 령 공물을 남기곤 하죠.\n\n운명필경사님이 이 주변을 지나갔다면 도구가 공명을 일으킬 거예요. 운이 따른다면 그분이 어디로 갔는지 알 수 있겠죠.', '', '', '', '', '', '', 39653),
(63759, 'koKR', '수색의 새로운 국면', '코르시아의 인도의 성역 입구에 있는 관리인 카탄을 만나야 합니다.', '운명필경사님은 인도의 성역으로 향하신 것 같네요. 코르시아에 기거하는 따르는 자들에게는 성지와도 같은 곳이죠.\n\n쓰레기란 쓰레기는 가리지 않고 모조리 줍는 당신의 습관 덕분에 운명필경사의 도구를 찾았으니 다행이에요!\n\n장담컨대 그분을 찾아내는 데 도움이 될 겁니다. 일단 성역으로 출발하실까요?', '', '', '', '', '', '코르시아의 인도의 성역 입구에 있는 관리인 카탄을 만나야 합니다.', 39653),
(63758, 'koKR', '꼭 끝까지 둘러봐야 하더라', '구도자의 성원에서 사라진 운명필경사를 찾아야 합니다.', '전 운명필경사님이나 그분을 찾는 데 도움이 될 단서를 찾아 이곳에 왔습니다.\n\n증거에 따르면 운명필경사님이 여기 있었고, 나락살이의 공격에서 살아남으셨어요. 아직 살펴보지 못한 곳이 딱 한 군데 있는데, 그게 명상의 방입니다. 폐허 반대편에 있죠.\n\n저 혼자 구도자의 성원에 다시 들어가기엔 너무 위험할 것 같습니다. 도와주실 수 있나요? 워낙 중요한 사안이라 운명필경사님을 꼭 찾아야 합니다.', '', '', '', '', '', '', 39653),
(63757, 'koKR', '약탈자를 약탈하는 법', '나락살이에게서 코르시아 유물 $1oa개를 회수해야 합니다.', '<나락살이는 코르시아 유물을 운반하고 있었습니다.\n\n적이 유물을 어떻게 할 속셈인지는 불분명하지만, 어쨌든 수호자의 안식처에 있는 따르는 자들에게 돌려주면 반길 것입니다.>', '', '', '', '', '', '', 39653),
(63756, 'koKR', '고문으로부터의 구원', '구도자의 성원에서 고통받는 따르는 자 $1oa명을 구출해야 합니다.', '나락살이는 구도자의 성원에서 색출한 이들의 목숨만 앗아가고 있진 않습니다. 생존자들을 심문하고 있기까지 하죠.\n\n힘닿는 데까지는 구해야 합니다. 운명필경사님을 본 사람이 있을지도 모르니 말이지요.', '', '', '', '', '', '', 39653),
(63755, 'koKR', '긴급 사태', '코르시아의 운명필경사를 찾아야 합니다.', '나락 방랑자님, 시급한 문제가 생겼습니다.\n\n운명필경사님이 사라지셨습니다. 이곳에는 아직 도착 안 하셨어요. 일행이 원래는 구도자의 성원에 있었다는데...\n\n<말을 멈추는 여행필경사 로베스>\n\n혹시 운명필경사님을 찾아봐 주실 수 있을는지요? 따르는 자들이 나락살이를 피해 모여들어 숨은 동굴이 폐허 주변에 있을 겁니다.', '', '', '', '', '', '', 39653),
(63754, 'koKR', '새장에 갇힌 새', '키엘룬에게서 지옥벼림 문장을 입수한 후 다니카를 풀어주어야 합니다.', '침묵을 지켜라. 주의를 끌어선 안 돼.\n\n이미 수많은 자매를 잃었다. 곧 있으면 내 차례가 온다. 그 마녀의 부정한 의식에 희생당해 스러지겠지.\n\n나를 이 우리에서 풀어다오. 함께 안전한 곳으로 탈출하자. 수호자 오딘 님께 이 추악한 배신을 알려야 한다!\n\n키엘룬이라 불리는 나락살이가 날 해방할 수 있는 문장을 갖고 있다. 지금쯤 근처 전당에서 실컷 으스대고 있을 것이야.', '', '', '수탈자 키엘룬', '', '', '', 39653),
(63740, 'koKR', '전문가 상담', '기록관의 기념물과 교감을 나눠야 합니다.', '끌림의 지팡이의 기능을 복원할 순 있지만, 그러려면 기록관의 지혜가 필요해요.\n\n비단 저 하나뿐만이 아니라, 앞서 왔던 기록관들을 말하는 겁니다. 이 근처에서 영면에 들었죠. 코르시아의 현재 파괴 규모, 파괴가 계속될 가능성을 고려해보면, 고인들의 기념비가 돌이킬 수 없을 만큼 훼손되기 전에 방문할 기회는 아마 이번이 마지막일 거예요.\n\n로쉬르와 함께 기록관의 기념비로 가 보세요. 그라면 기록이 사라지기 전에 기록관들의 뜻을 알아낼 수 있을 겁니다.', '', '', '', '', '', '', 39653),
(63739, 'koKR', '희망의 승천', '희망의 오르막 정상 근처에서 기록관 로세나라와 학자 로쉬르를 만나야 합니다.', '마지막으로 해야 할 일이 있어요.\n\n희망의 오르막 정상에서 뵙죠.', '', '', '', '', '', '', 39653),
(63738, 'koKR', '기록 보관소 건립', '수호자의 안식처에서 학자 로쉬르를 만나야 합니다.', '전 그나마 안전해 보이는 수호자의 안식처로 가겠습니다.\n\n그곳에 새로운 기록 보관소를 세울 거예요.\n\n여유가 생기거든 찾아 주시길.\n\n다시 한번 나락 방랑자님을 의지할 수 있길 바랄 뿐입니다. 훗날 당신의 도움이 필요한 시점이 올 테니까요.', '', '', '', '', '', '', 39653),
(63737, 'koKR', '진정한 사명의 발견', '끌림의 지팡이를 조율하는 의식에 참여합니다.', '뼈를 깎는 노력 끝에 이 순간까지 이르렀군요.\n\n하나로 모은 기록관들의 지혜와 $r $c님의 힘을 약간 빌려 끌림의 지팡이를 우리가 찾는 유물에 조율할 겁니다.\n\n성공만 하면 기록 보관소를 재건하는 데 필요한 준비물이 갖춰지는 셈이죠.\n\n그럼 우리의 신성한 직무를 이어나갈 수 있겠지요.', '', '', '', '', '', '', 39653),
(63736, 'koKR', '령의 주입', '끌림의 지팡이에 령을 주입해야 합니다.', '여느 때 같았으면 끌림의 지팡이에 또 하나의 중요한 유물인 황천별의 마력을 주입했을 겁니다.\n\n애석한 점은 지금 그런 선택지를 고를 여력이 없다는 것이죠. 그래도 유사시에는 령으로 대체해도 괜찮습니다.\n\n끌림의 지팡이를 가져가세요. 저 밑에 있는 령 균열이나 죽은 지 얼마 안 된 게걸충 주변에서 휘두르면 됩니다.\n\n그럼 지팡이가 령을 끌어들여 흡수할 거예요.', '', '', '', '', '', '', 39653),
(63734, 'koKR', '조각난 지팡이', '끌림의 지팡이의 파편 세 개를 회수해야 합니다.', '이렇게 된 이상 끌림의 지팡이의 비밀을 알려드리는 것 외에는 달리 도리가 없겠군요.\n\n알맞은 사용자, 이를테면 훈련받은 기록관이 그 지팡이를 다루면 어둠땅의 사후 세계에서 강한 영향력을 끼치는 유물을 찾아낼 수 있습니다.\n\n하지만 악인의 수중에 들어가지 않도록 방지하는 차원에서 세 개의 조각으로 나누어졌죠. 침략자들이 조각을 찾아내긴 했지만, 그 중요성은 아직 인지하지 못한 상태입니다.\n\n지팡이 파편을 회수해 주셨으면 합니다. 각 조각은 서로 다른 나락살이 구성원이 갖고 있습니다.', '', '', '', '', '', '', 39653),
(63733, 'koKR', '활로를 열다', '나락살이 침략자 $1oa명을 처치해야 합니다.', '전 폭력을 혐오합니다. 이성적인 대응으로 갈등을 해결하는 것을 선호하죠. 한데 지금은 대안이 없군요.\n\n로쉬르와 제가 무사히 대피하려면 구도자의 성원을 침공한 나락살이에게 결정적인 타격을 입혀야 할 거예요.\n\n우리가 도망칠 수 있도록 길을 열어주세요.', '', '', '', '', '', '', 39653),
(63732, 'koKR', '심문 방해', '기록관 로세나라를 구출해야 합니다.', '쉿... 조용히 하세요!\n\n침입자들이 절 찾으면 바로 해치우려고 달려들 겁니다. 놈들의 손에 이미 목숨을 잃은 사람이 한둘이 아니에요!\n\n<나락살이가 있는 방향을 부산스럽게 가리키는 로쉬르>\n\n저자들이 기록관님을 고문하고 있어요!\n\n무슨 수를 써서라도 구출해야 해요. 나락살이들이 기록관님의 정보를 알아내게 둘 순 없어요!', '', '혐오스러우면서도 무자비하기 이를 데 없는 심문관입니다.', '심문관 젠크', '', '', '', 39653),
(63731, 'koKR', '코르시아 유물 연구', '학자 로쉬르를 찾아 유물에 대해 자세히 알아봐야 합니다.', '<코르시아 내에 보관되어 있던 유물에 관한 내용이 담긴 찢어진 책을 발견했습니다.>\n\n<순간 책에서 로쉬르라는 이름이 빛을 발하기 시작합니다.>\n\n<책이 손 위에서 회전하더니 어떤 방향을 가리킵니다. 이 와중에도 로쉬르라는 이름은 계속 고동치고 있습니다.>\n\n<이 로쉬르라는 인물이 발견한 유물에 대해 자세히 알려줄 수 있을지도 모릅니다.>', '', '', '', '', '', '', 39653),
(63728, 'koKR', '의회에서의 사냥', '이세라와 대화하여 자세한 내막을 알아낸 후, 지식의 매장터에서 훌른 하이마운틴을 찾아야 합니다.', '티란데 위스퍼윈드가 몽환숲의 존속에 핵심적인 역할을 하는 것을 나는 꿈으로 똑똑히 보았다.\n\n나이트 페이들은 한때 밤 전사였던 이들을 찾아다니고 있다. 먼 옛날 아제로스에서 동맹이 되어주었던 훌른 하이마운틴을 포섭해 밤 전사를 물색하고 있기도 하지.\n\n엘룬의 힘은 티란데를 포함한 그 어떤 필멸자도 다 담을 수 없다. 그녀가 얼마나 더 버틸 수 있을지 불투명하다.\n\n내가 자세히 설명해줄 테니, 다 듣거늘 속히 말드락서스로 가서 훌른을 만나거라.', '', '', '', '', '', '', 39653),
(63727, 'koKR', '시초자의 귀환', '수호자의 안식처에서 시초자를 만나 새로운 공격 계획을 수립해야 합니다.', '간수는 계획을 이루는 데 필요한 인장 다섯 개 중에 네 개를 손에 넣었다.\n\n우리를 살려놓은 것 자체가 놈의 우행이나 다름없지. 우리의 의지를 비틀어 자기를 따르게 하려는 바로 그 욕망이 간수의 숨을 끊을 것이야.\n\n가망이 없는 건 아니다. 혼신의 힘을 쏟을 의지가 필요할 뿐이지, 아직 할 수 있는 일은 남아 있다.\n\n오너라. 남은 병력을 만나 다음 공격을 계획해야겠구나.', '', '', '', '', '', '코르시아에 있는 시초자와 대화해야 합니다.', 39653),
(63726, 'koKR', '인장의 결속 풀기', '볼바르와 대화하여 인장의 처분을 논의해야 합니다.', '시초자의 인장에 기억의 마법이 결속되어 있구나. 예전에 네가 조우한 어떤 물체가 떠오르는군.\n\n룬조각사를 아군으로 포섭하지 않았더냐. 토르가스트의 심부에 갇혀 있는 딱한 영혼 말이다. 네가 전달한 기억을 받아들여 그걸 무기와 방어구로 벼려내는 데 보탬을 주었지.\n\n룬조각사라면 이 얽히고설킨 기억의 덩어리에서 인장을 분리해낼 수 있을지도 모른다.\n\n인장을 손에 넣을 가장 확실한 방법이지. 다만 그 과정은 위험으로 가득할 터.', '', '', '', '', '', '토르가스트에서 시초자와 대화해야 합니다.', 39653),
(63725, 'koKR', '금고 속으로', '코르시아의 금고 안에서 시초자의 인장을 회수해야 합니다.', '그야말로... 압도적이란 말이 부족하지 않은 파괴의 현장이로군.\n\n<조용히 기도를 외는 탈갈란>\n\n령이 금고의 남은 부분으로 흘러 들어가고 있소. 이제 입장할 수 있을 거요.\n\n들어가면 시초자의 인장을 회수하리다. \n\n금고 안에서는 경건한 자세를 갖춰 주시오. 극소수의 인원에게만 박람이 허락된 신성한 장소니까.\n\n하물며 그 예언에조차 살아있는 필멸자가 금고 안의 비밀을 보게 될 거라는 내용은 없었소.', '', '', '', '', '', '코르시아에 있는 볼바르 폴드라곤에게 시초자의 인장을 가져가야 합니다.', 39653),
(63722, 'koKR', '코르시아의 수호자', '비밀의 금고에서 기록 관리자 3명을 구출해야 합니다.', '우린 지금 간수의 병력을 막아내기도 벅찬 상황입니다. 그래도 나락 방랑자님이 도착했으니 교착을 벗어날 수 있을 겁니다.\n\n금고로 가는 게 목적이신 건 알고 있습니다만, 기록 관리자들도 구출해야만 합니다.\n\n금고에 있는 다른 모든 물품에 대한 지식을 보유한 이들입니다. 간수가 더 많은 걸 알아내는 일은 없어야 합니다.', '', '', '', '', '', '비밀의 금고 안에서 검사 메빅스를 만나야 합니다.', 39653);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(63717, 'koKR', '금고 방어', '수호자 카레브를 도와 침략자 나락살이 병력을 물리쳐야 합니다.', '금고까지 가려면 공격해오는 나락살이를 돌파해 길을 개척해야 합니다.\n\n성약의 단 병사들이 최선을 다해 흉물들을 막아내곤 있지만, 동맹군이 언제까지고 버티는 건 불가능한 일입니다. 나락살이는 나락 방랑자님보다 먼저 보물을 얻을 작정일 테지요.\n\n간수의 군세에 맞서 싸우는 데 나락 방랑자님의 도움이 필요합니다.\n\n목적의 길이 우리 모두를 이끌어 주시길.', '', '', '', '', '', '비밀의 금고 안에서 검사 메빅스를 만나야 합니다.', 39653),
(63714, 'koKR', '금고를 향하여', '가죽뜯깃 수송자를 타고 비밀의 금고로 이동해야 합니다.', '뼈장장이가 두 도관을 수리해준 덕분에 이제 금고에 령이 유입되고 있을 거요. 안에 들어갈 기회가 생긴 셈이지. 그곳에 도달할 수 있다는 전제하에.\n\n우리 말드락시 동료들이 금고 안팎을 오갈 이동 수단을 마련해 두었소. 서두르는 게 좋을성싶소만.\n\n간수의 하수인들이 먼저 시초자의 인장을 가졌다간 코르시아만 고통받는 선에서 끝나지 않을 거요. 어둠땅 전역이 영락할 수도 있소.\n\n이만 출발합시다, 나락 방랑자. 병력이 우릴 기다리오.', '', '', '', '', '', '비밀의 금고에 있는 수호자 카레브와 대화해야 합니다.', 39653),
(63713, 'koKR', '갈고리 여행', '작살을 이용해 부유 섬으로 이동하여 령 도관을 수리해야 합니다.', '난 지금까지 적지 않은 작살과 갈고리 지점을 만들어 왔소. 걱정 마시오. 내 무게를 견딘다면 당신도 멀쩡할 거요!\n\n이걸로 틈새를 건너 다음 령 도관으로 갈 수 있소.\n\n먼저 가서 기다리겠소. 저기에 뭐가 도사리고 있을지 모르니.\n\n얼른 령 도관을 가동해야 하루빨리 금고에 들어가 시초자님의 인장을 확보할 수 있지 않겠소?', '', '', '', '', '', '', 39653),
(63712, 'koKR', '잃어버린 기록', '행렬 신호기을 사용하여 잃어버린 기록 $2oa개를 회수해야 합니다.', '코르시아가 나락으로 끌려왔을 때 몇몇 기록 관리자들이 이 산으로 피신했소.\n\n그들의 흔적은 오간 데도 없지만, 기록은 남아 있을지도 모르는 일. \n\n이 신호기를 받으시오. 이전에 그대가 구출해준 기록 관리자의 정보를 바탕으로 만들었소.\n\n이 산에 있는 온전한 기록의 위치로 안내해줄 것이오.', '', '', '', '', '', '', 39653),
(63711, 'koKR', '뼈 도구', '야생동물에게서 령이 주입된 뼈 $1oa개를 채취해야 합니다.', '말인즉슨 금고를 여는 데 필요한 장치가 둥둥 떠 있는 섬에 있다, 그 말 아니오?\n\n문제없소.\n\n보니까 이 지역엔 튼튼한 생명체들이 차고 넘치더군. 내가 입버릇처럼 달고 사는 말이 있다오. 그 어떤 뼈도 낭비해선 안 되는 법!\n\n저들의 뼈를 무더기로 모아 오시오. 그것들로 작살을 고정해 넘어갈 만한 지점을 만들어 보리다.', '', '', '', '', '', '', 39653),
(63710, 'koKR', '령의 자취', '령의 자취를 따라 다음 도관으로 이동해야 합니다.', '간수가 시초자의 인장을 노리고 있소. 나락살이보다 먼저 선수를 쳐야 하오. 금고를 열려면 령으로 동력을 공급해야 하지.\n\n그대의 도움 덕택에 뼈장장이가 첫 번째 도관을 수리할 수 있었소. 앞에 있는 령의 자취를 따라가면 다음 도관이 나올 것이오.\n\n그 도관을 활성화하면 코르시아에 령이 넉넉하게 유입될 것이고, 금고에 들어갈 수 있을 터.\n\n갑시다. 서둘러야 하오!', '', '', '', '', '', '령의 자취 끝자락에서 탈갈란과 뼈장장이 에어미르를 만나야 합니다.', 39653),
(63709, 'koKR', '금고의 비밀', '탈갈란과 함께 회수한 기록을 조사해야 합니다.', '다행이오! 나락살이에게 금고 소장품에 관한 지식을 강탈당하기 전에 기록 관리자들을 구출했다니.\n\n문제는 기록이 조각조각 나뉘었다는 거요. 말인즉슨 불완전하다는 얘기지. 진실을 알아내기에 충분하길 바랄 뿐이오.\n\n남은 지식을 한데 모아 전언으로 구성해 보겠소. 목적의 길의 뜻과 궤를 같이한다면 간수의 목표를 알아내고 원주인의 정체를 알아낼 수 있을 것이오.\n\n잠시 집중해야 하니, 시작할 준비가 되면 말씀하시오.', '', '', '', '', '', '', 39653),
(63708, 'koKR', '찰나의 환상', '베나리의 은거처에 있는 베나리에게 왜곡된 환상령을 가져가야 합니다.', '<기이하고 이질적인 마력의 티끌이 불규칙한 빛을 발산합니다. \n\n베나리가 관심을 보일지도 모릅니다.>', '', '', '', '', '', '', 39653),
(63706, 'koKR', '령은 흐르고 흐르네', '뼈장장이 에어미르를 도와 령 도관을 수리해야 합니다.', '상황 설명은 탈갈란에게 대충 들었소. 금고의 작동 방식에 대해서도 알려주더군. 뭐, 백면서생이 할 수 있는 최선의 노력을 다해 설명하더구려.\n\n우선 금고에 동력을 공급해야 하오. 지하에 심어놓은 도관을 통해 령을 공급하는 방식이더군.\n\n따르는 자의 말에 따르면 그 도관 중 하나가 학자의 은신처 동굴에 숨겨져 있다고 하더이다.\n\n날 데려다주면 어떻게 수리할 방법을 찾아내 보겠소. 코르시아 장치를 파악할 동안 내 뒤를 잘 봐주기만 하면 된다오.', '', '', '', '', '', '', 39653),
(63705, 'koKR', '지식의 수호자', '학자의 은신처에서 기록 관리자 $1oa명을 구출해야 합니다.', '우리 금고는 셀 수 없이 많은 비밀과 유물을 보관하도록 건설되었소. 입구를 열더라도 간수가 무엇을 찾는지 확실히 아는 건 불가능하오.\n\n몇몇 따르는 자는 기록 관리자의 직위를 받아 금고에 보관된 물품을 파악하는 과업을 수행한다오. 극한의 신중함을 갖춘 것으로 유명하지.\n\n관리자 상당수가 나락살이에게 붙잡혀 고문당하고 있소. 정보를 뽑아내려는 심산이겠지.\n\n기록 관리자들을 구출해 주시오, $n. 그들의 도움을 받으면 추방당한 자가 원하는 물건을 알아낼 수 있을 것이오.', '', '', '', '', '', '', 39653),
(63704, 'koKR', '코르시아의 복수', '학자의 은신처에서 나락살이 $1oa명을 처치해야 합니다.', '금고를 여는 것이 우선이긴 하지만, 개인적으로 하고 싶은 부탁이 있소.\n\n코르시아가 나락으로 끌려올 때, 우리 종족은 공포에 사로잡혔다오. 그래서 지금 그대 앞에 보이는 이곳으로 도망쳤지. 이른바 학자의 은신처라고 하는 평화의 보금자리라오.\n\n하나 얼마 안 가 나락살이가 들이닥쳤소. 동포 대부분은 무참하게 학살당했고, 남은 이들은 포로로 잡혀갔지.\n\n내 힘으로 복수를 쟁취할 수 있었더라면 진작 그리했을 거요. 하지만 난 전투 장비가 없소. 그대와 다르지.\n\n간곡히 부탁하리다. 코르시아를 더럽히는 만행은 결단코 용납하지 않는다는 걸 저 괴물들에게 똑똑히 보여주시오!', '', '', '', '', '', '', 39653),
(63703, 'koKR', '비밀의 금고', '학자의 은신처 바깥에서 탈갈란을 만나야 합니다.', '나락 방랑자, 그대의 조력에 힘입어 안정된 형색이라도 꾸밀 수 있었소. 그러나 앞날은 암담하기만 하오.\n\n간수의 군세가 코르시아 외곽에 있는 금고의 폐허에 전면 공세를 퍼붓기 시작했소. 추방당한 자가 그 안에 있는 어떤 보물을 찾고 있는 모양이오.\n\n구조물이 위협을 받으면 금고의 방어 체계가 작동된다오. 그러니 쉽게 들어갈 순 없소. 하지만 무슨 수를 써서라도 나락살이보다 먼저 간수가 찾는 물건을 회수해야 하오.\n\n하여 금고 개방을 도울 수 있는 강령군주에게 협조를 구해놨다오.', '', '', '', '', '', '학자의 은신처 바깥에서 탈갈란과 대화해야 합니다.', 39653),
(63690, 'koKR', '알렉산드로스 모그레인의 가장 친한 친구', '', '', '', '', '', '', '', '', 39653),
(63689, 'koKR', '백작의 가장 친한 친구', '', '', '', '', '', '', '', '', 39653),
(63688, 'koKR', '미카니코스의 가장 친한 친구', '', '', '', '', '', '', '', '', 39653),
(63683, 'koKR', '겨울의 인장', '숲의 심장부에 있는 이세라에게 자매의 눈물을 전달해야 합니다.', '나의 자매가... 그 오랜 시간이 흘렀음에도... 날 저버리지 않았구나...\n\n<겨울 여왕의 얼굴에 무척이나 희미한 미소가 퍼지더니 이내 사라집니다. 이윽고 그녀가 당신에게 영겁의 무게가 담긴 시선을 보냅니다.>\n\n따라오너라, $n. 내 자매의 눈물을 숲의 심장부로 가져오도록.', '', '', '', '', '', '', 39653),
(63682, 'koKR', '엘룬의 힘', '의식을 도와야 합니다.', '우린 허락된 시간 내로 할 수 있는 일을 모두 다 했다.\n\n이제 티르낙스와 다른 이들에게 힘을 빌려주어야 하느니라. 티란데가 무사하길 빌자꾸나.', '', '', '', '', '', '', 39653),
(63681, 'koKR', '다시 심장부로', '몽환숲의 숲의 심장부 정문에 있는 이세라에게 가야 합니다.', '빨리 몽환숲으로 돌아가야 해요!\n\n먼저 가서 이세라 님을 찾아보세요. 전 돌장인을 데리고 갈게요. 훌른이 무사히 돌아갈 수 있도록 살펴야 하니 말이죠.', '', '', '', '', '', '몽환숲의 숲의 심장부 정문에 있는 이세라에게 가야 합니다.', 39653),
(63680, 'koKR', '벼랑 끝에서', '훌른 하이마운틴을 추적해야 합니다.', '훌른이 돌장인에게 잡혀서 다른 곳으로 끌려갔나 봐요!\n\n돌장인이 지역을 지나면서 남긴 흔적을 찾아보죠. 훌른에게로 이어져야 할 텐데!', '', '', '', '', '', '', 39653),
(63679, 'koKR', '마법의 수수께끼 여행!', '레벤드레스에서 대신 문베리를 찾아야 합니다.', '<두루마리에서 서서히 떠오르는 문베리의 목소리>\n\n$n 님! 훌른에게 무슨 문제가 생긴 모양이에요. 그게... 상황이 좀 복잡해요. 꼭 레벤드레스에 와서 도와주시면 좋겠어요! 지배의 요새에 있을게요.\n\n조만간 만나요!', '', '', '', '', '', '레벤드레스에서 대신 문베리를 찾아야 합니다.', 39653),
(63678, 'koKR', '아카렉의 복수', '의식의 의회 엑소라마스에서 후작 신데인을 만나야 합니다.', '이걸로 아카렉 후작님을 몰락시키는 데 관여한 배신자들 모두의 목숨을 거뒀네. \n\n후작님이 돌아오시진 않겠지만 속이 후련하구먼.\n\n남작님께서 먼저 신데인 후작님께 일을 마쳤음을 알린 다음 몽환숲으로 출발하라고 하셨네.', '', '', '', '', '', '의식의 의회 엑소라마스에서 후작 신데인을 만나야 합니다.', 39653),
(63677, 'koKR', '허락된 것은 오로지 죽음뿐', '엑소라마스에서 폴징기를 처치해야 합니다.', '살생부의 마지막 이름은 폴징기라는 리치일세.\n\n켈투자드의 다음 계획을 파헤치고자 신데인 님께서 특히 눈여겨보고 있던 인물이지. \n\n그자만큼은 잔혹하게 처형하라고 따로 주문까지 하셨다네. \n\n그는 의식의 의회 엑소라마스에 있을 걸세.', '', '폴징기를 처치해야 합니다.', '폴징기', '', '', '', 39653),
(63676, 'koKR', '숨을 곳은 없다', '켈투자드의 호의의 징표를 회수한 후 드라바오라를 처치해야 합니다.', '켈투자드가 본색을 드러낸 이후에도 그와의 공모 관계를 비밀에 부친 자들이 있네. 우리 후작님의 몰락에 관여한 자들이니 죽어 마땅하지.\n\n내가 알기로 드라바오라가 그중 하나일세. 물론 더 있어. 배신자들은 동맹의 징표를 갖고 있다고 신데인 님께서 일러주셨네. 누가 가졌는지는 모른다고 하셨지만. 뭐, 색출할 때까지 피를 보면 되지 않겠는가?\n\n남은 자들은 본보기를 보고 어련히 알아들을 테지.', '', '', '', '', '', '', 39653),
(63675, 'koKR', '도망칠 곳은 없다', '단서를 수집한 후 젤마니를 처치해야 합니다.', '젤마니는 우리 후작님의 몰락에 결정적인 역할을 했네.\n\n신데인 님은 놈이 켈투자드 충성파 병력을 결집해 다음 계획을 실천하려 한다고 생각하시더군. \n\n젤마니의 행방을 알아낼 만한 단서를 모아 그 숨통을 끊어버려야 하네.', '', '', '', '', '', '', 39653),
(63674, 'koKR', '허락 구하기', '시초자의 권좌에서 여군주 바쉬를 만나 칼리크의 협조를 구해야 합니다.', '난 나의 남작이신 바쉬 여군주께서 맡긴 과업을 마쳐야 하네. 자네의 힘을 빌리면 순식간에 복수를 쟁취할 수 있겠지. 다만 자네와 도움을 주고받으려면 남작님의 허락을 받아야 해.\n\n시초자의 권좌로 향하게. 남작님과 말씀을 나눠보세나.', '', '', '', '', '', '', 39653),
(63673, 'koKR', '의회에서의 사냥', '말드락서스에서 훌른 하이마운틴을 찾아야 합니다.', '좋은 소식이 있다, $n. 성약의 단들이 긴밀하게 협력하면서 훌른의 사냥이 큰 성과를 거뒀다. 또 다른 밤 전사 두 명의 행방에 관한 뚜렷한 단서를 찾았더구나. 바로 이 어둠땅에 있는 모양이다.\n\n우선 말드락서스에서 널 만나보고 싶다는군. 훌른은 지식의 매장터에 있다.\n\n분초를 다투는 일이다, $n. 엘룬의 힘이 티란데의 정수를 찢어발기고 있어. 그녀가 얼마나 더 버틸 수 있을지 불투명하다.', '', '', '', '', '', '', 39653),
(63672, 'koKR', '심장부에서 들려오는 비명', '숲의 심장부에서 이세라를 만나야 합니다.', '<두루마리를 읽어 내려가자 찬찬히 들려오는 이세라의 목소리>\n\n$n,\n\n네 도움이 꼭 필요한 중대사가 생겼다. 최대한 빨리 숲의 심장부로 와다오.', '', '', '', '', '', '', 39653),
(63665, 'koKR', '오리보스로 통하는 길', '차원석을 활성화해 오리보스로 이동해야 합니다.', '예언에 따르면 언젠가 나락 방랑자가 이 휴면에 빠진 차원석을 필요로 하는 날이 올 것이라고 하였소. 어둠땅의 운명에 막중한 역할을 할 것이라고.\n\n그날이 도래한 것 같구려.\n\n내면의 령을 끌어내 차원석을 활성화하시오. 그럼 그대의 대의에 동참하는 모든 이가 사용할 수 있을 것이오.\n\n그대 말마따나 탈이나라가 오리보스에 고정 장치를 마련해 두었다면... 그것을 통해 우리에게로 돌아오게 될 터.\n\n가시오, $n. 동맹에 전하시오. 나락이 기다리고 있으며... 코르시아는 그대들의 도움이 필요하다고 말이외다.', '', '', '', '', '', '전이의 고리에 있는 볼바르 폴드라곤과 대화해야 합니다.', 39653),
(63664, 'koKR', '진공 작전', '연옥의 요새 내부에 있는 전진 기지를 방어해야 합니다.', '지배의 제단으로 통하는 다리 인근 거점이 맹공격을 받고 있다! 그곳에 설치한 쇠뇌를 잃을 순 없어.\n\n나락 방랑자, 아군 병력이 전진할 수 있을 때까지 거점을 사수해다오!', '', '', '', '', '', '남작 드라카에게 가야 합니다.', 39653),
(63663, 'koKR', '비밀의 도시 코르시아', '베나리가 지역을 살펴보게 한 후, 발견한 부분을 조사해야 합니다.', '곧 우리의 목적을 이룰 수 있을 겁니다, 나락 방랑자님.\n\n조금만 더 가면 당신이 찾는다는 그 거창한 차원석이 나올 거예요. 제 소망은 그보단 훨씬 검소하답니다. 요긴한 정보 약간에, 값어치를 헤아릴 수 없는 유물 하나 정도면 충분하죠...\n\n인근 지역에 쓸 만하거나 위험한 건 없는지 살펴보겠습니다. 그런 다음에 이동하지요.', '', '', '', '', '', '비활성화된 차원석 주변에서 탈갈란과 대화해야 합니다.', 39653),
(63662, 'koKR', '나락의 수수께끼', '베나리와 함께 나락에 새로 나타난 땅덩어리로 이동해야 합니다.', '나락이 변화하고 있습니다, 필멸자님. 그리고 변화는 기회와 일심동체라 할 수 있죠.\n\n간수가 어둠땅 깊은 곳에 숨겨져 있던 영역을 나락으로 끌어냈습니다. 제가 어느 정도... 흥미를 두고 있는 곳이지요. 다만 혼자 접근할 엄두가 안 나더군요.\n\n나락살이가 바글대고 있거든요. 무언가 귀한 물건을 찾고 있다는 의미겠죠.\n\n그 주변에 안전한 은신처를 마련해 두었습니다. 동행해 주시면 말씀하신 차원석을 찾는 걸 도와드릴 용의가 있습니다.\n\n조건을 받아들이시겠어요?', '', '', '', '', '', '새로운 지역 바깥에서 베나리와 대화해야 합니다.', 39653),
(63661, 'koKR', '나락과의 연결', '베나리에게 두 번째 차원석의 위치를 물어봐야 합니다.', '운명필경사가 나락에 두 번째 차원석이 출현했다며 호언장담하더구나. 찾아내는 것은 그대의 역할이니라. \n\n이곳 오리보스에 그대의 령과 연결되는 고정 장치를 만들어 놓겠다. 새로이 출현한 차원석에 그대를 조율하면 고정 장치가 알아서 결속될 테지.\n\n그대가 성공만 하면 성약의 단은 다시 한번 나락에 병력을 보내고 무사히 빠져나올 수 있게 될 것이야.\n\n나락에서 주어진 자원을 활용해 차원석을 찾거라.\n\n행운을 빈다, 필멸자여. 목적의 길이 우리 모두를 인도하길.', '', '', '', '', '', '베나리의 은거처에 있는 베나리와 대화해야 합니다.', 39653),
(63660, 'koKR', '나락 개방', '탈이나라가 령을 살펴보게 해야 합니다.', '간수가 또 하나의 인장을 손에 넣었고, 그의 군대가 오리보스에 맹공을 퍼붓고 있다.\n\n볼바르 폴드라곤과 말드락서스의 드라카는 적극적인 항전을 펼치자고 주장하더구나.\n\n그러기 위해서는 저들 병력이 나락을 무사히 드나들 수 있는 길이 필요하다.\n\n그대가 당도하기 전까지만 해도 불가능한 일이라 여겨졌지만... 지금은 가능성이 있다고 생각한다.\n\n그대의 령을 살피게 해다오. 이것이 진정 목적의 길의 뜻인지 알아야겠구나.', '', '', '', '', '', '전이의 고리에서 탈이나라와 대화해야 합니다.', 39653),
(63659, 'koKR', '공포의 군주가 나타났다!', '코르시아에서 시초자와 대화해야 합니다.', '우리 병력에 침투한 공포의 군주를 잡아낸 게 이번 주만 해도 다섯 번째로군. 놈들을 견제하지 않으면 이 거점에 막심한 피해를 입힐 거다.\n\n생전에 나는 악마사냥꾼에게서 이 미물들을 식별하는 방법을 배웠다. 덕분에 힘들이지 않고 찾아낼 수 있지만, 내가 모든 곳에 존재하는 건 아니지 않느냐.\n\n시초자님께 이 소식을 알려야겠다.', '', '', '', '', '', '코르시아에서 시초자와 대화해야 합니다.', 39653),
(63656, 'koKR', '분노의 의미', '시초자에게 보고해야 합니다.', '내 즉시 병력을 집결시킨 뒤 그 일부를 코르시아로 보내도록 하마. 더불어 바쉬 남작과 캘타스가 만들어낸 도구를 공급해 또 다른 나스레짐의 침입을 미연에 방지하겠다.\n\n다만 이 내가 코르시아로 내려가기엔 다른 책무가 발을 붙잡는구나. 우선 추가적인 침입에 맞서 지배의 요새의 안전을 확보해야 한다.\n\n시초자께서 새로운 소식을 목이 빠지도록 기다리고 계시겠구나. 가서 좋은 성과를 거두었다고 전하면 될 거다.', '', '', '', '', '', '시초자에게 보고해야 합니다.', 39653),
(63655, 'koKR', '격노의 메달', '죄악의 몰락지에 있는 연단으로 격노의 메달을 가져가야 합니다.', '나락 방랑자. 내 돌숨결을 이끌고 나락의 심연으로 진격해 그곳에 도사리는 나스레짐이란 나스레짐은 모조리 참해버릴 것이야.\n\n하나 잘못된 만용에 레벤드레스를 잃기엔 이 전쟁에서 지니는 전략적 가치가 너무나 크지. \n\n그러니 2대 분노의 수확자의 이름으로 나의 메달을 넘겨주겠다. 내가 전장에 나가 있는 동안 안전하게 보관하되, 이용해도 좋다.\n\n데나트리우스가 무심코 돌아와 가벼운 손짓으로 주도권을 되찾지 못하도록 수확자를 강화하는 데 사용하거라.', '', '', '', '', '', '죄악의 몰락지에 있는 연단으로 격노의 메달을 가져가야 합니다.', 39653),
(63654, 'koKR', '나스레짐', '나스레짐에게서 격노의 메달을 회수해야 합니다.', '격노의 메달은 단순히 강력하기만 한 유물이 아니다. 나스레짐의 손에 들어가면 그들의 사악한 목적에 맞춰 이 영역을 빚어낼 수 있지. 게다가 메달이 놈들 손에 넘어간 동안 우리는 새로운 인장을 벼려낼 수도 없다.\n\n놈들은 무모한 계획으로 잿불 지구를 파멸 직전까지 몰아간 장본인이다. 내 메달이 그것들의 목적에 쓰이는 일은 없게 할 것이야.\n\n따라오너라. 얼른 되찾으러 가야겠다.', '', '', '', '', '', '새벽요새에서 왕자 레나탈과 대화해야 합니다.', 39653),
(63653, 'koKR', '왕관의 힘', '격노의 메달로 가는 길을 따라가야 합니다.', '준비는 끝났다.\n\n수확자의 궁정이 지금까지 모은 메달의 힘을 사용해 격노의 메달을 찾아낼 것이야. 영역에서 사라졌으면 모를까, 그게 아니라면 존재감을 인지할 수 있다.\n\n이건 결코 쉬운 의식이 아니다. 게다가 나스레짐은 감지를 피하는 데 잔뼈가 굵은 종족이지. 그러니 길이 보이면 신속하게 따라가라.\n\n나스레짐을 찾거든 달려들지 말고 우리를 기다리도록.', '', '', '', '', '', '새벽요새에서 돌장인과 대화해야 합니다.', 39653),
(63652, 'koKR', '\"환영받지 못한\" 손님', '죄악의 몰락지 내부에 있는 나스레짐 $1oa명을 처치해야 합니다.', '첼라... 아니, 날라가스가 홀로 암약하진 않았을 거다. 최악의 경우를 가정하고, 친우나 동맹이라고 해서 겉모습이 전부는 아니라고 봐야겠구나.\n\n수확자의 궁정이 감지 의식을 준비하려면 시간이 좀 걸린다. 게다가 그러는 동안에 노출되기까지 하겠지. 지배의 성문에서 사용한 그 기술을 죄악의 몰락지에서도 사용해다오. 우리 중에 숨어 있는 나스레짐을 발본색원하는 거다. \n\n즐거운 사냥이 되기를 빌지.', '', '', '', '', '', '', 39653),
(63651, 'koKR', '암호문', '지옥불 암호문 $1oa개를 판독해야 합니다.', '나스레짐이 죄악의 몰락지에 침투했다면 연락을 주고받고 있을 거다. 단지 손짓이나 언어 같은 수단을 쓰지 않을 뿐이지. 그치들은 마법을 애용한다. 글로 쓴 전갈을 간단한 주문으로 은폐하는 것이야. 그럼 일반적인 관찰자의 눈에는 보이지 않아.\n\n하지만 내가 그런 전갈을 볼 수 있게 해주는 주문을 만들었지.\n\n암호문을 찾아 그 내용물을 가져오너라. 네가 이해하지 못하더라도 나는 해독할 수 있다.', '', '', '', '', '', '', 39653),
(63650, 'koKR', '방첩 활동', '죄악의 몰락지에 있는 왕자 레나탈을 만나야 합니다.', '말가니스.\n\n그의 이름을 입 밖에 내보기는 정말 오래간만이군. 이젠 놈을 추적해 처단해야만 하는 상황이 됐고 말이야.\n\n말가니스가 격노의 메달을 갖고 있다면 숨을 곳은 없다. 이전에 회수한 다른 메달들을 사용해 위치를 알아내면 그만이야.\n\n공포의 군주 사냥단을 이끌고 죄악의 몰락지로 오너라. 그자들이 필요할 테니.', '', '', '', '', '', '', 39653),
(63649, 'koKR', '첩보원을 첩보하다', '공포의 군주 침투자 $1oa명을 추적해 쓰러뜨려야 합니다.', '나스레짐. 공포의 군주. 보이지 않는 손님.\n\n명칭이야 어떻든, 그들은 아주 먼 옛날 모든 현실을 아우르는 최고의 첩자이자 침투원으로서 창조되었다. \n\n그렇게 침범을 일삼는 녀석들이 간과한 세 가지가 있지. 바로 캘타스 선스트라이더, 남작 바쉬, $n의 존재이니라!\n\n일리단 님을 섬길 당시, 캘타스와 내가 나스레짐을 탐지하는 데 썼던 도구를 가져왔다. 이 몸이 첩자의 여제 아니겠느냐?\n\n침입자 사냥을 시작하자꾸나.', '', '', '', '', '', '', 39653),
(63648, 'koKR', '날라가스', '날라가스를 뒤쫓아 쓰러뜨려야 합니다.', '나스레짐이 돌장인의 메달을 이용하게 두어서는 안 된다. \n\n규탄자에게 전해 들은 임무 설명대로라면 벤티르의 인장을 새로 벼려내는 데 메달이 필요한 모양이더군. 그러니 날라가스와 그 족속이 이 시점에 습격을 감행한 거겠지.\n\n메달에 깃든 마법은 절대 희미하지 않다. 또, 이 영역에 끼치는 영향 역시 손쉽게 추적할 수 있지. 그러니 날라가스가 지원을 받기 전에 흔적을 뒤쫓아 제거하는 건 어떻겠나?', '', '유능한 나스레짐 침투원입니다.', '날라가스', '', '', '왕자 레나탈과 대화해야 합니다.', 39653),
(63647, 'koKR', '보이지 않는 손님', '돌장인과 함께 특사를 조사해야 합니다.', '공포의 군주라.\n\n그럼 그렇지. 이런 공교로운 시기에 안 돌아오는 게 이상하지. 가뭄이 창궐할 무렵 놈들이 돌아온 건 아닌지 의구심이 들긴 했다. \n\n널 처음 만났을 때 같은 패거리가 아니라는 확신이 없었어. 놈들이 레벤드레스를 떠난 이후로 영겁의 세월이 흐르면서 점점 더 영리해졌으니 말이야.\n\n뭐 영리해졌다고 해도 어림없지만... 아마도.\n\n따라와라, 나락 방랑자. 따라오되 소란은 피우지 말도록. 언제든 무기를 뽑을 수 있게 준비해. 네가 데려온 특사들은 생각처럼 선한 자들이 아니니라.', '', '', '', '', '', '', 39653),
(63646, 'koKR', '성약의 단의 호송대', '특사들을 모아 지배의 성문으로 이동해야 합니다.', '새로운 벤티르의 인장을 벼려내려면 일곱 메달이 모두 필요하다.\n\n시초자의 판단이 옳았다. 우리에겐 돌장인이 필요하다. 보이지 않는 자를 향한 그녀의 원한은 도서관을 채우고도 남는 데다, 우리에게 필요한 마지막 메달을 보유하고 있기까지 하지. 우리의 대의에 동참하도록 진작 설득했어야 했거늘.\n\n내 자리를 마련해보마. 이번에는 선물과 외교술을 두루 준비해 제대로 찾아가 보자꾸나. \n\n첼라에게 언질을 전하거라. 그 친구가 호위대를 편성할 거다.', '', '', '', '', '', '시초자의 전언을 돌장인에게 전달해야 합니다.', 39653),
(63645, 'koKR', '새벽요새의 죄수', '왕자 레나탈을 통해 대영주 데나트리우스의 운명을 알아내야 합니다.', '아, 소식을 아직 못 접했나 보군.\n\n그의 신병은 우리에게 있다. 레벤드레스의 주인 대영주 데나트리우스는 다름 아닌 자신의 검에 갇혔거든.\n\n최근 나스리아 성채를 급습했을 때 그를 무찌르는 데 성공했지.\n\n타의 추종을 불허하는 용기와 준비성을 겸비한 군대가 필요했다. 실력과 재보는 물론이고, 기적이 따라주었기에 가능했지.\n\n구원자는 구원의 길을 걷게 될 것이야. 더 자세히 알아보고 싶은가?', '', '', '', '', '', '', 39653),
(63644, 'koKR', '공포의 소식', '레벤드레스의 새벽요새에서 왕자 레나탈과 대화해야 합니다.', '나스레짐이 아군에 끼치는 위협을 절대 쉬이여겨선 안 된다. 그들의 교활함은 눈의 의회의 백전노장에 비견될 수준이지. 설상가상으로 우린 나스레짐의 계획을 다 알지 못한다.\n\n벤티르 중에 나스레짐이 수천 년 동안 어둠땅에 얼씬조차 못 하도록 집요하게 막아낸 자가 있다. \n\n죄악의 몰락지로 가서 레나탈 왕자를 찾아 이 서신을 전하거라. 내 휘하에 있는 첩자 중 하나인 바쉬 남작을 그쪽으로 보내 주겠다. 그녀는 나스레짐을 상대해본 적 경험이 있으니 잘 활용해 보거라.', '', '', '', '', '', '새벽요새에서 왕자 레나탈과 대화해야 합니다.', 39653),
(63639, 'koKR', '오리보스에 보고하기', '오리보스에 있는 탈이나라에게 가야 합니다.', '몽환숲은 나락의 가차 없는 공세를 견뎌냈다.\n\n하나 그 정도로는 역부족이었지.\n\n오리보스에 있는 동맹을 찾아가거라. 이 손실과 앞으로의 행동에 대한 해답이 있을 것이다.', '', '', '', '', '', '오리보스에 있는 탈이나라에게 가야 합니다.', 39653),
(63638, 'koKR', '배수의 진', '겨울 여왕을 확인해야 합니다.', '일단... 실바나스와 나락살이 문제는 해결됐네요.\n\n어쨌거나 여왕 폐하와 인장의 안전을 서둘러 확보해야 해요!\n\n겨울 여왕님은 숲의 심장부 바로 바깥에 계세요. 도둑맞은 야생씨앗을 나락의 마수로부터 보호하고 계시죠.', '', '', '', '', '', '', 39653),
(63625, 'koKR', '나는 사령관을 잡을 테니 너는 진격을 하거라', '나락살이 병력 $1oa명과 사령관 말라모르트를 처치해야 합니다.', '아군이 거센 저항에 부딪혔네! 무기를 집어 들고 맞서 싸우게, 나락 방랑자!\n\n관문을 지키는 나락살이 병력과 사령관을 처단해야 해.', '', '', '사령관 말라모르트', '', '', '남작 드라카에게 승전보를 전해야 합니다.', 39653),
(63624, 'koKR', '우리가 걷는 길', '드라카의 승급 의식을 목격해야 합니다.', '말드락서스의 군대는 강인하다. 바이라즈가 끼친 해악을 딛고 일어설 것이야. \n\n첫 번째 당면 과제는 재건이니라. 나락 방랑자여, 말드락서스의 새로운 시대가 열리는 광경을 똑똑히 지켜봐다오!', '', '', '', '', '', '', 39653),
(63623, 'koKR', '왕좌의 공백을 채우다', '시초자의 권좌로 가야 합니다.', '나락 방랑자.\n\n내가 오랜 시간 자리를 비우고 있는 동안 강령군주 성약의 단의 질서를 바로 세우고 힘을 돌려놓고자 많은 일을 했더구나. 그 공을 치하하는 의미에서 너를 의식에 초대하노라.\n\n말드락서스에 있는 나의 권좌로 가자꾸나. 우리의 대의에 그 누구보다 깊은 충절을 바친 자에게 보상을 내릴 때가 되었다.', '', '', '', '', '', '시초자의 권좌에서 시초자와 대화해야 합니다.', 39653),
(63622, 'koKR', '우리의 이름으로 일군 승리', '코르시아에 있는 시초자에게 가야 합니다.', '오늘 우리는 헬리아와 바이라즈를 처리하며 나락살이에 맞서 대승을 거뒀네. 더불어 하나 된 어둠땅의 용력을 보여주기도 했지.\n\n다른 일이 생기기 전에 코르시아로 돌아가세나.', '', '', '', '', '', '', 39653),
(63621, 'koKR', '먹이 사슬', '사슬지기를 처치해야 합니다.', '사슬지기라고 불리는 존재가 있습니다. 그의 힘을 얕봐선 안 됩니다. 우리를 공격할 준비를 하면서 인근에 있는 영혼들을 속박했더군요.\n\n아군 병력을 노리기 전에 나락 방랑자님이 먼저 나서서 위협을 제거해 주셨으면 합니다.', '', '그의 사슬에 속박된 영혼은 누구든 의지가 꺾이고 맙니다.', '사슬지기', '', '', '', 39653),
(63620, 'koKR', '배신의 대가', '바이라즈를 처치해야 합니다.', '바이라즈는 우리를 배신한 이후로 한순간도 놓치지 않고 말드락서스를 방해했네. 선택받은 자의 의회 남작으로서 위협을 제거하고 후작님의 원수를 갚는 것은 나의 의무일세.\n\n시초자님의 말씀처럼 뱀의 머리를 쳐내야 해.\n\n그 때는 바로 지금이네!', '', '말드락서스를 배신한 남작 바이라즈의 시간은 얼마 남지 않았습니다.', '남작 바이라즈', '', '', '', 39653),
(63619, 'koKR', '이탈자와 잊힌 자', '이탈자 포로 $1oa명을 구출해야 합니다.', '잠깐... 당신은? 나락 방랑자님 아니십니까!\n\n제 형제자매들은 뒤틀리고 더럽혀졌습니다. 일부는 헬리아의 힘을 순순히 받아들였지만, 다른 이들은 저항했죠. 이젠 우리 모두를 강제로 힘에 굴종시켰습니다.\n\n전 싸움이 일어났을 때 빠져나왔지만 남아있는 이탈자 대부분은 끔찍한 의식의 희생양이 되고 있습니다.\n\n제발 이탈자들을 구출해 주세요. 그렇게만 해 주시면 승천의 보루로 돌아가 집정관님의 처분을 달게 받겠습니다!', '', '', '', '', '', '', 39653),
(63618, 'koKR', '말드락서스의 특기', '데스모테론 상부에서 나락살이 $1oa명을 처치해야 합니다.', '여기서 적을 하나 격파할 때마다 우리 군대가 상대해야 할 적이 하나 줄어드는 셈이네. 말드락서스의 진정한 사명이 무엇인지 뼛속 깊숙이 새겨주세나. 어둠땅에 위협이 된다고 여겨지는 자에게 어떤 일이 생기는지 보여줘.\n\n나락살이를 눈에 띄는 대로 쓸어버리게.', '', '', '', '', '', '', 39653),
(63617, 'koKR', '창살을 비틀어', '강철지기 살릭스를 처치해야 합니다.', '난전이 벌어진 덕분에 상부 관문이 고스란히 열린 채로 남았더군. 은밀하게 지나가면 녀석들은 한발 늦을 때까지 눈치 못 채겠지.\n\n다만 헬리아의 부관 하나가 우리와 헬가드 요새 사이를 막고 있네. 바로 해치워버리게나.', '', '이 나락살이 정복자는 데스모테론에서 사후 세계의 연합군에 맞서 병력을 지휘합니다.', '강철지기 살릭스', '', '', '', 39653),
(63616, 'koKR', '적절한 일 처리', '제레크리스에 신호를 보내 공격을 시작해야 합니다.', '슬슬 공격을 개시해도 되겠어.\n\n제레크리스에 신호하게. 말드락서스 죽음의 요새와 어둠땅 연합군의 힘을 똑똑히 보여주세나!', '', '', '', '', '', '', 39653),
(63615, 'koKR', '날개 자르기', '나락살이 사슬을 사용해 저승살이 영혼파괴자 $1oa명을 처치해야 합니다.', '헬리아의 키리안 추종자들이 하늘을 검게 물들이고 있네. 저들의 머릿수를 줄여놓지 않으면 제레크리스와 공중 병력이 진격하는 데 차질이 생길 게야.\n\n나락살이는 마법 사슬을 애용하더군. 그들의 장비를 역이용하면 하늘에서 끌어 내릴 수 있을 걸세.', '', '', '', '', '', '', 39653),
(63614, 'koKR', '손안의 무기', '스랄의 도끼 드라고라를 찾아야 합니다.', '잠시 기다리게, $n.\n\n일전에 나락에서 첫 전투를 벌일 때, 헬리아에게 내 도끼 드라고라를 던졌었네. 그 이후로 도통 찾지를 못했지. 이곳이 정녕 헬리아의 병력이 머무르는 거점이라면 도끼도 여기 보관되어 있을지도 모르네.\n\n내가 나그란드에서 손수 만든 무기일세. 그게 있으면 가족과 함께한 온갖 즐거운 추억이 떠오르곤 한다네. 다시 한번 이 두 손으로 그 무게를 느껴보고 싶어.', '', '', '', '', '', '', 39653),
(63613, 'koKR', '저주받은 자의 관문', '죽음의 관문 $1oa개를 소환해야 합니다.', '제레크리스에 신호하기 전에 우선 공격 준비를 해야 하네. 우리 아군은 요새가 도착하는 대로 죽음의 관문을 이용해 공격을 개시할 걸세.\n\n그러기 위해선 이쪽 방면에 죽음의 관문을 소환해야 해. 전략적 요충지를 물색하세나.', '', '', '', '', '', '', 39653),
(63612, 'koKR', '지휘 계통', '데스모테론 근처에서 드라카를 만나야 합니다.', '간수의 영토와 밀접한 곳에 거점을 두려면 확고한 초석을 다져야 한다.\n\n바이라즈와 헬리아가 데스모테론의 성벽 안쪽으로 후퇴했지. 안전을 당연시하며 한껏 안일해졌더구나. 다른 말로는 우리에게 기회인 셈이니라.\n\n놈들의 허를 찌르는 거다. 날렵하고 무자비한 공격으로 뱀들의 머리를 쳐낼 수 있을지도 모르지.', '', '', '', '', '', '데스모테론 근처에서 드라카와 대화해야 합니다.', 39653),
(63608, 'koKR', '하마의 영혼', '숲의 심장부에 있는 여군주 무우운에게 하마의 영혼을 가져가야 합니다.', '<사나운 하마의 영혼입니다. 하마의 형상을 불러낼 수 있게 될 것입니다.>', '', '', '', '', '', '숲의 심장부에 있는 여군주 무우운에게 하마의 영혼을 가져가야 합니다.', 39653),
(63607, 'koKR', '공포뿔의 영혼', '숲의 심장부에 있는 여군주 무우운에게 공포뿔의 영혼을 가져가야 합니다.', '<거칠고 완강한 공포뿔의 영혼입니다. 공포뿔의 형상을 불러낼 수 있게 될 것입니다.>', '', '', '', '', '', '숲의 심장부에 있는 여군주 무우운에게 공포뿔의 영혼을 가져가야 합니다.', 39653),
(63606, 'koKR', '거미의 영혼', '숲의 심장부에 있는 여군주 무우운에게 거미의 영혼을 가져가야 합니다.', '<날렵하고 교묘한 거미의 영혼입니다. 거미의 형상을 불러낼 수 있게 될 것입니다.>', '', '', '', '', '', '숲의 심장부에 있는 여군주 무우운에게 거미의 영혼을 가져가야 합니다.', 39653),
(63605, 'koKR', '사우로리스크의 영혼', '숲의 심장부에 있는 여군주 무우운에게 사우로리스크의 영혼을 가져가야 합니다.', '<기민하고 영리한 사우로리스크의 영혼입니다. 사우로리스크의 형상을 불러낼 수 있게 될 것입니다.>', '', '', '', '', '', '숲의 심장부에 있는 여군주 무우운에게 사우로리스크의 영혼을 가져가야 합니다.', 39653),
(63603, 'koKR', '야크의 영혼', '숲의 심장부에 있는 여군주 무우운에게 야크의 영혼을 가져가야 합니다.', '<다정하고 쾌활한 야크의 영혼입니다. 야크의 형상을 불러낼 수 있게 될 것입니다.>', '', '', '', '', '', '숲의 심장부에 있는 여군주 무우운에게 야크의 영혼을 가져가야 합니다.', 39653),
(63593, 'koKR', '키리안의 새로운 인장', '코르시아에 있는 시초자에게 돌아가 보고해야 합니다.', '새로이 탄생한 인장은 연대와 헌신의 미래를 앞둔 승천의 보루의 길을 상징하노라.\n\n여지껏 완수했던 네 업적을 시초자에게 보고하거라. 시초자가 준비되었을 때, 우리가 인장을 전할 테니.\n\n간수의 계획을 타도하고 어둠땅을 구원하는 데 쓰이기를.', '', '', '', '', '', '코르시아에 있는 시초자에게 돌아가 보고해야 합니다.', 39653),
(63592, 'koKR', '새로운 길', '집정관의 권좌에서 칼리스테네와 대화하여 의식에 참여해야 합니다.', '오늘 새로운 용장이 임명될 것이니라. 사원을 재정립하여 서로를 향한 헌신의 상징으로 세우는 것은 우리의 영역에 여명이 밝아온 이후로 처음 있는 일이다.\n\n새로운 용장, 새로운 인장, 모든 키리안을 위한 새로운 길이 탄생하는 것이야.\n\n대단히 영광스러운 의식이 되겠지!', '', '', '', '', '', '헌신의 용장 아드레스테스와 대화해야 합니다.', 39653),
(63591, 'koKR', '성대한 환영', '칼리스테네와 대화하여 회합에 참여한 후, 영혼결속자를 비롯한 다른 키리안과 어울려야 합니다.', '$n, 그대는 어느 때보다 어려운 시기에 키리안에게 힘이 되어주었다. 우리의 대의를 향한 그대의 헌신이 있었기에 모두가 새로운 출발을 맞이할 수 있었지.\n\n의식에 앞서 회합에 참여해 자리를 빛내줄 수 있겠나? 오늘에 이르기까지 그대가 보여준 노고에 감사를 표하고 싶어 하는 성약의 단 구성원이 한둘이 아니니라.\n\n실로 기쁘기 한량없는 날이로다. 그대가 참관하게 되어 얼마나 즐거운지!', '', '', '', '', '', '충성의 샘에서 칼리스테네와 대화해야 합니다.', 39653),
(63590, 'koKR', '기도의 종이 울리네', '충성의 사원을 재정립하는 군정관 아드레스테스를 보호해야 합니다.', '충성은 이제 길을 따르는 데 있어 반드시 요구되는 덕목이 아닌, 체득하는 덕목이 될 것이다. 하나의 선택지인 셈이지.\n\n새로 온 영혼이 되었든, 우리의 도움이 필요한 동포가 되었든, 우린 힘겹게 몸부림치는 자들에게 헌신을 보여줘야 한다.\n\n지금 주어진 모든 령을 동원해야 하지만, 사원을 재정립하고 키리안의 새로운 시대를 알리는 종을 울리겠다.\n\n나락살이들은 우리의 계획을 저지하려고 하겠지. 의식을 치르는 동안 나를 지켜다오, $n. 어떻게든 헤쳐나가야 한다.', '', '', '', '', '', '', 39653),
(63589, 'koKR', '헌신의 방향', '충성의 성채에서 사원으로 령을 전환해야 합니다.', '승천의 보루의 다섯 사원은 창조된 이래로 굳건하게 자리를 지켜왔다. 그런 사원 하나를 재정립하는 발상은 일찍이 대두된 전례가 없지. 막대한 령이 필요한 일임은 말할 필요도 없다.\n\n사원 지하에는 가뭄을 대비해 비축해둔 령이 있느니라. 지금이야 령은 돌아오고 있으니, 이 비축분을 우리의 목적에 사용해도 무방할 거다.\n\n령을 최상부로 보내려면 곳곳에 비치된 수송관과 수집기를 사용해야 한다. 그럼 내게 필요한 힘이 전달될 것이야.', '', '', '', '', '', '', 39653),
(63588, 'koKR', '믿음의 재건', '이탈자 $1oa명을 설득하여 다시 길을 따르도록 해야 합니다.', '$n 님, 이탈자는 정처 없이 방황하고 있습니다.\n\n마치 충성의 사원을 떠도는 유령 같죠. 마땅히 갈 곳이 없으니까요. 지도자와 목적을 잃고 버려진 신세입니다.\n\n저들에게 앞으로 나아갈 길을 보여주어야 합니다.\n\n제가 나락 방랑자님을 따라 사원으로 가겠습니다. 그들의 감정에 호소할 기회를 주십시오. 아드레스테스 님의 새로운 길을 따르도록 설득할 수 있을지도 모릅니다.', '', '', '', '', '', '', 39653),
(63587, 'koKR', '회수할 만한 령', '이탈자 백인대장으로부터 오염된 백인대장 핵 $1oa개를 입수해야 합니다.', '$n 님, 미카니코스 님께서 이탈자 백인대장에 대해 세세히 설명해 주셨어요.\n\n완전히 이해했다고는 말 못 하겠지만, 이탈자 백인대장들이 정상 가동하도록 만들 확실한 방법은 아직 알아보고 계신 것 같습니다.\n\n그렇지만 령은 유용하게 쓸 수 있죠!\n\n아드레스테스 님은 사원을 재정립하는 데 몰두하시느라 본인의 안위는 뒷전으로 밀어놓고 계십니다. 그러다 령을 너무 많이 소진하시진 않을까 걱정이에요.\n\n이탈자 백인대장의 핵을 회수한 다음 아드레스테스 님을 위한 령 저장 장치로 사용하는 건 어떻겠습니까?', '', '', '', '', '', '', 39653),
(63586, 'koKR', '헌신 속 연민', '청지기의 쉼터에 있는 아드레스테스를 만나야 합니다.', '가장 먼저 할 일은 충성의 사원을 재정립하는 것이다.\n\n펠라고스는 이곳에 남아 의식 준비를 돕겠다고 자원했다. 나는 니콜론에게 동료들을 데리고 청지기의 쉼터로 오라고 해뒀지. 우리의 새로운 길을 따르도록 이탈자를 설득하는 데 힘을 빌려줄 거다.\n\n여유가 생기거든 찾아오너라.', '', '', '', '', '', '청지기의 쉼터에 있는 아드레스테스를 만나야 합니다.', 39653),
(63585, 'koKR', '눈먼 충성심', '엘리시안 요새에서 군정관 아드레스테스와 합류한 후, 그와 함께 집정관을 알현해야 합니다.', '비로소 키리안이 나아갈 길이 선명하게 보이는구나.\n\n우선 니콜론과 대화를 나눠봐야겠다. 부디 곁에 남아 들어다오.\n\n얘기를 마치면 엘리시안 요새로 향할 것이다.\n\n그곳에서 집정관님을 알현할 수 있도록 요청할 것이다. 모두 함께해 주면 좋겠군.', '', '', '', '', '', '', 39653),
(63584, 'koKR', '금의환향', '엘리시안 요새에 있는 칼리스테네를 만나야 합니다.\n\n키리안 급사가 데려다줄 수 있을 것입니다.', '이 사원은 승천의 보루의 새로운 시대를 상징하노라, $n.\n\n헌신의 사원은 승천의 보루에서 동지애를 가꾸는 장이 될 것이니라. 우리는 모든 경험과 출신의 이탈자, 열망자, 키리안과 힘을 합쳐 모두가 자부심을 가질 만한 미래를 만들어나가리라.\n\n엘리시안 요새로 돌아가자. 새로운 용장이 승천하고 인장이 다시 만들어지는 이 기념비적인 순간에 네가 빠져서야 되겠느냐.', '', '', '', '', '', '엘리시안 요새에 있는 칼리스테네를 만나야 합니다.', 39653),
(63583, 'koKR', '불사라는 이름의 염원', '우서가 세 번째 기억을 다시 체험하도록 도와야 합니다.', '부탁한다, $n. 아직 끝나지 않았어.\n\n꼭 봐야 할 기억이 하나 더 있다. 반드시 직시해야 해.\n\n쉽지는... 않을 테지. 모두의 도움이 필요해.\n\n어쨌든, 반드시 해야 할 일이다.', '', '', '', '', '', '', 39653),
(63582, 'koKR', '옛 시절의 제자', '우서가 두 번째 기억을 다시 체험하도록 도와야 합니다.', '아서스 왕자에 대한 기억이 우서에게 심한 번뇌를 안겨주고 있구나. 우서의 영혼이 조각조각 나누어진 것도, 데보스가 그렇게 타락해버린 것도 이 인물 때문이었지.\n\n기억에 담긴 고통이 절절하게 전해지는군.\n\n좀 더 깊이 파고들어야겠다. 우서가 이 어둠의 근원을 직시해야 하노라.\n\n다시 한번 우서의 과거에 들어가 그의 미래를 지켜다오.', '', '', '', '', '', '', 39653),
(63581, 'koKR', '빛 속으로', '영혼 거울을 사용하여 우서가 과거를 체험하도록 도와야 합니다.', '제가 우려했던 대로군요.\n\n이 우서의 영혼 파편은 자신을 베어버린 서리한에 물들여졌습니다. 기억이 산산이 조각나 뒤틀리고 말았죠.\n\n우서가 괴로움과 회한을 뒤로하기 위해서는 과거를 또 한 번 경험해야 합니다.\n\n하지만 혼자 임할 필요는 없지요.\n\n제 영혼 거울을 사용하면 우서가 기억을 되짚어가며 그 안에 담긴 감정을 받아들일 때 힘이 되어줄 수 있을 겁니다. 그가 왜곡 너머에 있는 진실을 이해할 수 있도록 우리가 도와줘야 합니다.', '', '', '', '', '', '', 39653),
(63580, 'koKR', '상처받은 기억', '우서가 정의의 잔재와 연결을 맺을 수 있도록 도와야 합니다.', '우서의 상처받은 영혼은 온갖 사건의 기폭제가 되었고, 우리가 고난과 역경에 빠지는 결과로 이어졌다.\n\n데보스의 무너진 신뢰. 그녀와 헬리아의 야합. 이탈자의 탄생까지.\n\n승천의 보루에 변화가 필요한 시점이나, 해결책을 찾는 데는 어려움이 따르고 있다.\n\n이 영혼 파편이 귀중한 혜안을 제시해줄지도 모르지.', '', '', '', '', '', '', 39653),
(63579, 'koKR', '성기사의 영혼', '토르가스트 추방당한 자의 납골당에서 정의의 잔재를 회수해야 합니다.', '볼바르 폴드라곤은 토르가스트 심층부에 숨겨진 금고의 환영을 보았습니다. 간수가 귀중하게 여기는 영혼을 보관하는 장소지요.\n\n우서는 한의 검에 목숨을 잃었습니다. 분노를 머금고 휘두른 한의 검은 능히 영혼을 산산이 조각낼 수 있죠.\n\n간수가 우서의 영혼 일부를 갖고 있다면 그 잃어버린 조각을 회수하기 전까지 완전한 회복은 요원합니다.\n\n이 조율된 파편을 갖고 토르가스트로 향하세요, $p 님. 당신을 금고로 이끌어줄 겁니다.\n\n잃어버린 영혼 파편을 찾아 우서가 다시 완전해질 수 있게 해주셨으면 합니다.', '', '', '', '', '', '승천의 보루 지혜의 사원에서 테니오스를 만나야 합니다.', 39653),
(63578, 'koKR', '몽환숲 전투', '몽환숲 전투에서 겨울 여왕의 인장을 지켜야 합니다.', '대영주 데나트리우스는 배신을 저질렀고, 말드락서스의 시초자는 종적을 감췄으니 간수의 다음 표적은 분명 겨울 여왕님이 될 거예요.\n\n여왕님의 인장을 가져가게 둘 순 없죠!\n\n몽환숲이 큰 고통을 받았다고는 해도 강력하고 신비한 힘이 깃든 영역이라는 사실은 변하지 않아요. 언제나 보이는 게 전부는 아니다, 이 말이죠.\n\n그 누가 여왕 폐하를 노리든 바로 이런 점을 유리하게 이용할 거예요!', '', '', '', '', '', '', 39653),
(63576, 'koKR', '첫 수', '오리보스에서 군정관 아드레스테스와 대화해야 합니다.', '성약의 단들이 부지런히 어둠땅을 지키곤 있지만, 간수 역시 토르가스트에 앉아 손을 놓고 있진 않았다. 아무래도 음모의 다음 단계를 실행에 옮길 작정인가 보더군.\n\n군정관 아드레스테스가 엘리시안 요새에서 불길한 소식을 가져왔다. 네가 도착하는 대로 어떤 일이 있었는지 알려줄 거다.\n\n서두르거라. 시간이 얼마 안 남은 것 같으니.', '', '', '', '', '', '', 39653),
(63543, 'koKR', '강령군주의 습격', '연옥의 요새와 망각의 표면에서 퀘스트 $1oa개를 완료해야 합니다.', '우리가 간수의 병력의 의표를 제대로 찔렀네. 연옥의 요새를 함락시키고 지배의 제단에 있는 그의 용사들을 무찌를 차례일세!\n\n나락 방랑자, 자네의 도움이 필요하네. 전장에서 아군을 지원해 주게나!', '', '', '', '', '', '', 39653),
(63435, 'koKR', '사원에서의 승부', '애완동물 대전에서 안시아를 꺾어야 합니다.', '우리 부모님은 그... 여덟... 야자의 제단인가? 그걸 지키느라 정신없이 바쁘세요. 저야 별 관심 없지만요. 그래서 여기 두고 가신 거겠죠.\n\n여기서 커다란 하얀 고양이하고 같이 훈련할 수 있다고 하셨어요! 전 커서 자객이 될 거예요!\n\n<당신을 향해 여러 차례 발차기 동작을 선보이는 안시아>\n\n이얍! 합! 조심하셔야 할걸요!\n\n...\n\n심심한데 애완동물 대전이나 하실래요? 저 아끼는 애완동물들을 다 데리고 왔거든요.', '', '', '', '', '', '', 39653),
(63100, 'koKR', '불행의 동반자', '영혼의 강 고르고아에 있는 절망한 혼령 $1oa명을 처치해야 합니다.', '<모든 것을 빼앗긴 불우한 영혼의 껍데기입니다. 존재 자체가 말살되기 직전인 상태입니다.\n\n이런 고통이 이어지게 놔둘 수는 없습니다. 저들을 비탄으로부터 구해내야 합니다.>', '', '', '', '', '', '', 39653),
(63043, 'koKR', '분리된 영혼', '나락의 구렁에서 영혼 분리의 덫 $1oa개를 파괴해야 합니다.', '덫은... 우리에게 아무런 영향을 끼치지 못했어. 덕분에 수많은 영혼들이... 탈출했지.\n\n그래서 놈들은... 달아나는 영혼들을 찢어발길... 새로운 덫을 만들었지.\n\n나는 이미 너무 늦었으니... 다른 이들이 달아날 수 있게... 덫을 파괴해줘!', '', '', '', '', '', '', 39653),
(62917, 'koKR', '영혼의 공유', '결속의 제련소에서 규탄자를 만나야 합니다.', '수확자의 힘이 네 필멸의 육신을 타고 흐르는구나. 다른 이와 영혼결속을 한다면 그보다 막강한 권능을 다룰 수 있을 것이다.\n\n영혼결속의 알려진 문제점은 없다. 그러면서도 결속을 맺는 양쪽 모두 어마어마한 이익을 누릴 수 있지.\n\n규탄자가 영혼결속 절차를 감독해줄 거다. 준비되면 결속의 제련소에서 만나보거라.', '', '', '', '', '', '', 39653),
(62852, 'koKR', '야생 사냥단과 불멸의 동맹', '숲의 심장부에 있는 아이슬린과 대화해야 합니다.', '반갑습니다, $n 님!\n\n몽환숲의 모든 주민에게 실력을 증명해 보이셨더군요. 그 맹위와 기민함을 인정해 보상을 드리겠습니다.\n\n숲의 심장부로 와주셨으면 합니다.', '', '', '', '', '', '', 39653),
(62851, 'koKR', '죽지 않는 군대와 불멸의 동맹', '고통의 투기장에 있는 날코른 탈센과 대화해야 합니다.', '꾸준히 죽지 않는 군대의 목표를 달성하신 끝에 병력의 한결같은 존경을 받게 되셨습니다. \n\n이에 대한 감사의 표시로 최근 입수한 전리품을 내어드리도록 허가를 받았습니다. 최대한 빨리 시초자의 권좌를 찾아 전리품을 받아주셨으면 합니다.', '', '', '', '', '', '', 39653),
(62850, 'koKR', '승천자와 불멸의 동맹', '승천의 보루 영웅의 안식처에 있는 부관 니코스와 대화해야 합니다.', '나락 방랑자님. \n\n당신의 노고 덕분에 승천자는 목표를 이루는 데 결정적인 쐐기를 꽂을 수 있었습니다.\n\n보상과 더불어 감사의 말씀을 전하고 싶습니다.', '', '', '', '', '', '', 39653),
(62849, 'koKR', '수확자의 궁정과 불멸의 동맹', '어둠안식처에서 장교 미하엘라와 대화해야 합니다.', '나락 방랑자. \n\n네 노고가 있었기에 수확자의 궁정은 데나트리우스 대영주의 패망한 대의에 매달리는 광신도와 아첨꾼을 상대로 결정적인 우위를 점할 수 있었다.\n\n어둠안식처로 오면 우리의 감사한 이 마음을... 좀 더... 물질적인 방식으로... 전하도록 하지.\n\n보물이 뒤따를 거란 건 두말할 필요도 없고.', '', '', '', '', '', '', 39653),
(62611, 'koKR', '곰팡이 순찰대: 심장나무 터', '페이 고리를 타고 심장나무 터에서 지배된 신성모독자 $2oa명을 처치해야 합니다.', '가면을 쓴 마귀 놈들이 심장나무 터를 점령했다더군. 그래서 내가 녀석들의 음모를 저지하려 하네.$b$B심장나무 터는 참으로 아름다운 곳이었어. 한데 지금은... 아니, 그게 무슨 상관이겠나. 자네와 내가 당장이라도 재건하면 되는 일인데.$b$B자, 함께 전장으로 가세. 저 괴물들에게 몽둥이찜질을 해주는 걸세. 그럼 녀석들의 주인도 성지를 훼손하려는 마음을 고쳐먹게 될 터이니.', '', '', '', '', '', '', 39653),
(62563, 'koKR', '또 한 번의 귀환!', '도살자 고르간투스를 쓰러뜨려야 합니다.', '고르간투스는 포기하지 않을 겁니다.\n\n이미 수 차례 쓰러졌음에도 불구하고 말입니다. 청소부들이 회수한 육체를 손보기만 하면, 다시 전장에 들어설 수 있어서 그런 거겠지요.\n\n이번에는 자신이 이길 수 있다고 생각하나 본데... 허튼수작이란 걸 보여주세요.', '', '오래전부터 살아온 피조물입니다. 쓰러지고 다시 만들어지기를 수 차례 반복했습니다.', '도살자 고르간투스', '', '', '', 39653),
(62451, 'koKR', '회랑 습격', '', '', '', '', '', '', '', '', 39653),
(62435, 'koKR', '순록의 영혼', '숲의 심장부에 있는 여군주 무우운에게 순록의 영혼을 가져가야 합니다.', '<고귀하고 강한 순록의 영혼입니다. 순록의 형상을 불러낼 수 있게 될 것입니다.>', '', '', '', '', '', '숲의 심장부에 있는 여군주 무우운에게 순록의 영혼을 가져가야 합니다.', 39653),
(62432, 'koKR', '올빼미냥이의 영혼', '숲의 심장부에 있는 여군주 무우운에게 올빼미냥이의 영혼을 가져가야 합니다.', '<독특한 요술쟁이 올빼미냥이의 영혼입니다. 올빼미냥이는 유쾌한 조화 속에서 살아가는 다재다능한 야수로, 언제나 새로운 도전을 찾아다닙니다. 올빼미냥이의 형상을 불러낼 수 있게 될 것입니다.>', '', '', '', '', '', '숲의 심장부에 있는 여군주 무우운에게 올빼미냥이의 영혼을 가져가야 합니다.', 39653),
(62427, 'koKR', '히포그리프 영혼', '숲의 심장부에 있는 여군주 무우운에게 히포그리프의 영혼을 가져가야 합니다.', '<총명하고 용맹한 히포그리프의 영혼입니다. 히포그리프의 형상을 불러낼 수 있게 될 것입니다.>', '', '', '', '', '', '숲의 심장부에 있는 여군주 무우운에게 히포그리프의 영혼을 가져가야 합니다.', 39653),
(62294, 'koKR', '리치에겐 쓰레기일지언정...', '의식의 의회 내부에 있는 잔해 무더기를 뒤져 과거와 관련된 단서를 수집한 후, 흥미로운 고대 유물을 입수해야 합니다.', '\"누군가에게는 쓰레기여도, 누군가에게는 보물일 수 있다.\"라고들 하잖나. 유물을 두고 한 얘기라면, 전적으로 사실이라네.\n\n의식의 의회는 자신들이 어떤 일을 벌이는지를 철처히 비밀에 부치기로 악명이 높지. 다시 말해 놈들의 지식을 손에 넣는다면 그보다 달콤한 일은 없을 거란 뜻이야.\n\n놈들의 쓰레기 더미를 잘 살펴보면 분명 온갖 종류의 보물이 튀어나올 걸세.', '', '', '', '', '', '', 39653),
(62256, 'koKR', '자산 회수', '몽환숲으로 이동해 타비티아를 찾아낸 후 다른 세상의 알을 회수해야 합니다.', '이게 누구야? $n 아닌가! 곤란한 상황이라서 그러는데, 얘기 좀 들어보겠나? 나는 아우래리나라는 중개자와 협상을 진행하는 중이라네. 그런데 그 작자가 거래를 받아들이기에 앞서 해결해야 할 문제가 있다고 그러더군.\n\n그리고는 희귀한 물건을 챙기고서 모습을 감춘 동료가 있는데... 내게... 아니, 우리에게 그 잃어버린 재산을 회수해달라고 청하더라니까.\n\n마지막으로 목격된 장소는 몽환숲일세. 참 기묘한 곳으로 향했군. 내게는 너무나도 눈부신 곳인지라... 나를 위해... 아니, 우리를 위해서라도 이 거래를 성사시켜주게!\n\n그럼 나설 준비는 되었나?', '', '', '', '', '', '아우래리나에게 다른 세상의 알을 가져가야 합니다.', 39653),
(62239, 'koKR', '설치류 박멸', '야수소굴에서 거대 나락쥐 $1oa마리에게 고문관의 지팡이를 시험해야 합니다.', '<무기가 어둡고 찌릿찌릿한 마력으로 윙윙거립니다. 나락살이가 무엇을 시험했는지는 모르지만, 주변의 설치류에게는 꽤 효과적이었던 모양입니다.\n\n자세히 조사해보면 추가적인 정보를 알아낼 수 있을지도 모릅니다.>', '', '', '', '', '', '발견한 정보를 베나리의 은거처에 있는 베나리에게 알려야 합니다.', 39653),
(62235, 'koKR', '공포의 완화', '', '', '', '', '', '', '', '', 39653),
(62224, 'koKR', '실낱 같은 희망', '령이 깃든 비단 $1oa개를 수집해야 합니다.', '밤의 궁정은 갈증에 허덕이는 꽃과 같아요. 순식간에 영양분을 소모하죠. 즉 제대로 공급받으면 활짝 만개하지만, 반대로 끊기면 시들어버리고 말아요.\n\n문제는 우리 뿌리가 마르기 시작했다는 거죠. 령이 부족해요!\n\n그래서 일꾼들을 보내 몽환숲의 여러 오솔길을 따라 비단잡이를 설치하도록 했어요. 비단잡이는 령을 잡아낼 수 있거든요. 양이 많거나 그런 건 아니지만 필요한 만큼은 된답니다.\n\n령이 깃든 비단을 찾아 가져다주세요.', '', '', '', '', '', '', 39653),
(62208, 'koKR', '말드락시 의례', '', '', '', '', '', '', '', '', 39653),
(62188, 'koKR', '별 따기', '반짝이는 별빛불이 $1oa마리를 채집해야 합니다.', '다소... 섬세한 문제와 관련해서 $n 님의 도움이 필요해요.\n\n별빛불이 날개는 몇몇 용품을 만드는 데 있어 필수적인 재료예요. 문제는 비축분이 소진되었다는 거죠.\n별빛불이는 덩치도 작은 데다 한없이 연약해요. 저는 녀석들은 세심하게 다룰 능력이 없어요.\n\n대신 별빛불이를 모아주실 수 있을까요? 날개가 상하면 안 되니 반드시 산 채로 잡아야 해요. 없어선 안 될 재료예요. \n\n귀한 시간을 내어 주시는 일이니 보상은 당연히 챙겨드릴 겁니다.', '', '', '', '', '', '', 39653),
(62148, 'koKR', '하늘에서 령이 내린다면', '', '', '', '', '', '', '', '', 39653),
(62144, 'koKR', '돌의 유산', '', '', '', '', '', '', '', '', 39653),
(62115, 'koKR', '연회 훼방꾼', '', '', '', '', '', '', '', '', 39653),
