(61949, 'koKR', '몽환숲의 요술쟁이들', '애완동물 대전에서 그릭시스 타이니팝을 꺾어야 합니다.', '', '', '', '', '', '', '', 39653),
(61883, 'koKR', '불굴의 생존자', '애완동물 대전에서 그릭시스 타이니팝을 꺾어야 합니다.', '', '', '', '', '', '', '', 39653),
