(61848, 'koKR', '파멸의 칙령: 죄악석 골렘', '레벤드레스에 있는 죄악석 골렘 $1oa마리를 파괴해야 합니다.', '진정한 수확자의 궁정의 이름으로, 온 영역을 통틀어 위험한 수준으로 응축된 죄악석 골렘에 파멸의 칙령을 선포하노라. \n\n이들 존재는 구원받는 데 실패하고 나락으로 추방된 영혼들의 해결되지 않은 죄악이 현현한 소산이다. 최근 일대에 령이 스며드는 현상이 발생하면서 위험하리만치 강해지고 말았다.\n\n죄악석 골렘의 존재를 멸하는 자에겐 마땅한 보상이 내려질 것이니라.', '', '', '', '', '', '', 39653),
(61787, 'koKR', '초소형 방어 병력', '애완동물 대전에서 그릭시스 타이니팝을 꺾어야 합니다.', '', '', '', '', '', '', '', 39653),
(61737, 'koKR', '도난', '나즈그림과 납치에 관해 대화해야 합니다.', '할 얘기가 정말 많다, $n.\n\n스컬지가 돌아왔다. 지배의 투구가 파괴되는 바람에 놈들의 악이 일파만파로 뻗어 나가고 있지. 일말의 견제도 없이 말이다.\n\n더 최악인 건 실바나스 윈드러너가 왕국의 심장부에 하수인을 보내 전쟁에서 자신을 실각시킨 이들을 잡아가려 했다는 거다.\n\n나즈그림을 찾아 이야기를 마저 들어 보도록.', '', '', '', '', '', '나즈그림에게 납치에 관해 물어봐야 합니다.', 39653),
(61736, 'koKR', '도난', '샐리 화이트메인과 납치에 관해 대화해야 합니다.', '할 얘기가 정말 많다, $n.\n\n스컬지가 돌아왔다. 지배의 투구가 파괴되는 바람에 놈들의 악이 일파만파로 뻗어 나가고 있지. 일말의 견제도 없이 말이다.\n\n더 최악인 건 실바나스 윈드러너가 왕국의 심장부에 하수인을 보내 전쟁에서 자신을 실각시킨 이들을 잡아가려 했다는 거다.\n\n화이트메인을 찾아 이야기를 마저 들어 보도록.', '', '', '', '', '', '샐리 화이트메인에게 납치에 관해 물어봐야 합니다.', 39653),
