(61523, 'koKR', '시체 운반', '도살자 구역에 있는 라산에게 해골 시체를 가져가야 합니다.', '여기 뭔가 손을 써줘야 할 일이 있네. 으흠, 으흠.\n\n근처에 커다란 시체를 발견했네. 거기서 쓸만한 부위를 건져볼까 하는데.\n\n함께 가는 게 어떻겠나. 그걸 라산에게 넘겨준다면 굉장히 기뻐할 게야. 으흠, 으흠.\n\n그나저나 자네를 들쳐 메고 다녀와도 괜찮을 것 같네. 커다란 덩치가 아니잖나.\n\n자, 출발할 준비는 되었나?', '', '', '', '', '', '', 39653),
(61510, 'koKR', '넉넉한 전리품', '초르디를 이용해 몽환숲에 있는 귀중한 회수품 $2oa개를 찾아 수집해야 합니다.', '초르디는 모험을 떠나고 싶어요! 당신도 그런가요?\n\n그러면 무기나 갑옷은 물론이고, 값진 복덩이까지 챙길 수 있답니다! 요즘은 복덩이를 구하기가 무척 힘든 모양이더라고요.\n\n나무 인간들이 사는 곳으로 가봐요. 그 주변이라면 복덩이가 여럿 튀어나올 거예요!', '', '', '', '', '', '', 39653),
(61467, 'koKR', '채광: 영롱한 솔레늄 덩어리', '', '', '', '', '', '', '', '', 39653),
