(61157, 'koKR', '핵심을 찌르는 뿔', '뿔 달린 야수에게서 엘리시안 뿔 $1oa개를 입수해야 합니다.', '승천의 보루의 뿔 달린 야수들은 한때 열망자들의 수련 상대가 되었지만, 지금은 백인대장이 그 자리를 대신하고 있습니다. 야수들의 개체수는 세월을 거쳐 늘어만 났는데, 이제는 이를 조절해야만 합니다.\n\n야수의 뿔은 우리 과업에서 중요한 역할을 하는 물건입니다. 뿔을 이용해 싸우는 야수라 뿔이 온전하지 못한 경우도 부지기수입니다. 성한 뿔을 얻으려면 신경써야만 하지요.\n\n야수들을 찾아가서 쓰러뜨린 다음, 뿔을 회수해 주십시오.', '', '', '', '', '', '', 39653),
(61156, 'koKR', '가시가 가는 길에는...', '비행 야수에게서 일렁이는 비행의 가시 $1oa개를 입수해야 합니다.', '먼 옛날 열망자들은 승천의 보루에 서식하는 동물을 상대로 훈련했다고 합니다. 백인대장이 만들어지고 그런 정립되지 않은 방식은 쇠퇴하게 되었죠.\n\n이 영역에서 살아가는 수많은 비행 생물은 가시를 지닌 것으로 유명합니다. 가볍고 견고해 우리가 사용하기에 안성맞춤이지요.\n\n최대한 많이 모아오시면 됩니다. 어떤 비행 생물이든 상관없이요.', '', '', '', '', '', '', 39653),
(61060, 'koKR', '포자 패배자', '', '', '', '', '', '', '', '', 39653),
(60962, 'koKR', '리치 왕의 분노: 모험을 찾아 노스렌드로', '얼어붙은 노스렌드 대륙으로 이동해야 합니다.', '리치 왕은 아제로스의 모든 생명체 위에 군림하는 그날까지 멈추지 않을 거예요.$b$b노스렌드로 돌아가 모험을 계속해 보세요!', '', '', '', '', '', '', 39653),
