(60761, 'koKR', '스컬지의 재림', '오그리마 힘의 골짜기에 있는 사령관 트로그에게 부관 알테라의 보고서를 전달해야 합니다.', '이 보고서를 트로그 사령관님께 전해 주십시오. 어떤 위협이 당면했는지 사령관님께서 모든 정황을 아셔야 합니다.\n\n스컬지에 맞서 전선을 사수하지 못하면... 그땐 빛에 운명을 맡겨야겠죠.', '', '', '', '', '', '', 39653),
