(60482, 'koKR', '눈에 띄는 물건', '숨겨진 무기 $1oa개를 수집해야 합니다.', '의회가 몰락한 이후, 일대의 거미들이 적대적으로 변했습니다. 영역을 넓히면서 그나마 남아 있던 생존자들까지 먹잇감으로 삼을 정도로 말이죠.\n\n호신용으로 쓸 무기가 있긴 한데, 보이지 않는 자의 소굴에 숨겨져 있다는 게 문제입니다. 지금쯤이면 그 안에서 살아가는 녀석이 흩뿌린 거미줄에 범벅이 되어 있겠지요.\n\n그리로 가서 보이지 않는 시야를 활용하세요. 무기를 찾거나, 눈에 띄는 물자를 회수할 수도 있을 테니까요.', '', '', '', '', '', '', 39653),
(60132, 'koKR', '천공서와 저승석', '', '나락은 개척의 여지가 무궁무진하게 남아있는 땅입니다. 심지어 그 중 상당수를 훗날의 이익으로 탈바꿈시킬 수 있죠.\n\n정보는 곧 투자와 같습니다.\n\n이곳에는 흥미로운 물건들이 많이 있으니, 그런 걸 찾아 가져오시면 기쁜 마음으로 거래하겠습니다.\n\n하나 찾아오시는 대로 협상을 시작하죠.', '', '', '', '', '', '', 39653),
(60117, 'koKR', '십자군의 귀환', '스톰윈드 상업 지구에 있는 사령관 그레고르와 대화해야 합니다.', '스컬지가 끝 모를 굶주림을 드러내기 시작했네. 놈들이 길거리를 뒤덮는 것도 시간 문제겠지.\n\n그러니 이러한 위협에 일가견이 있는 자들이 필요한 걸세. 칠흑의 기사단에 소속된 죽음의 기사들이 힘을 보태기는 했으나, 저들만으로 어찌 되진 않을 거야.\n\n다행히도 은빛십자군 역시 부름에 응했다네. 그들과 함께 백성들의 안위를 돌봐주게, $n.\n\n은빛십자군의 사령관에게 자네가 찾아갈 거라고 귀띔해뒀으니, 성문 안쪽에 자리한 주둔지에서 만나보면 될 걸세.', '', '', '', '', '', '', 39653),
