(59598, 'koKR', '영혼을 위하여', '메릭과 대화해야 합니다.', '영혼 하나보다는 둘이 나은 법 아니겠느냐! 함께라면 홀로 있을 때보다 더 큰 성취를 이룰 수 있을 게다.\n\n그렇다고 해서 우리 둘이서만 모든 위협을 이겨내야 하는 건 아니란다. 앞으로도 더 많은 이가 전투에 힘을 보탤 테니 말이야.\n\n메릭과 자세한 얘기를 나눠 보자고. 부끄러워 하지 말고. 내가 잘 소개해 줄 테니!', '', '', '', '', '', '', 39653),
(59259, 'koKR', '영원의 심문관', '', '', '', '', '', '', '', '', 39653),
(58505, 'koKR', '계획된 종말', '적 병력과 거점을 섬멸해야 합니다.', '방어책이라 해봐야 보잘것없는 수준인데 적은 공격하길 주저하고 있습니다.\n\n놈들이 저희를 두려워하니, 당장은 방어 태세를 확인하려 들지 않을 겁니다.\n\n적에게 계속 압박을 넣어주십시오. 방어선을 따라 늘어선 적들의 진지를 공격하는 겁니다.', '', '', '', '', '', '', 39653),
(58490, 'koKR', '목숨을 건 경고', '적 병력과 거점을 섬멸해야 합니다.', '방어책이라 해봐야 보잘것없는 수준인데 적은 공격하길 주저하고 있습니다.\n\n놈들이 저희를 두려워하니, 당장은 방어 태세를 확인하려 들지 않을 겁니다.\n\n적에게 계속 압박을 넣어주세요. 방어선을 따라 늘어선 적들의 진지를 공격하는 겁니다.', '', '', '', '', '', '', 39653),
