(57537, 'koKR', '흔적 감추기', '드라카와 함께 선택받은 자의 의회로 가야 합니다.', '난 선택받은 자의 의회 소속일세. 남쪽에 있는 우리 요새라면 안전할 게야.\n\n남은 여정은 하늘길을 통하세나. 준비되면 내 가죽뜯깃에게 다가가게.', '', '', '', '', '', '', 39653),
(57513, 'koKR', '적군의 적군', '고통의 투기장에서 탈출해야 합니다.', '분명 궁금한 점이 많을 테지. 이 땅에는 공공의 적이 있다는 걸 알아두게.\n\n우선 움직이지. 안전한 곳으로 안내해줄 테니 얘기는 도착해서 하세나.', '', '', '', '', '', '', 39653),
