(56470, 'koKR', '해골 개야 물어!', '거대 골수벌레에게서 골수벌레 살점 $1oa개를 채취해야 합니다.', '루이슨이 골수벌레를 찾기가 수월해질 거라면서 해골 개를 내어줬단다. 화로를 손보느라 바빠서 그러는데, 날 대신해 사냥에 나서 주지 않으련?\n\n해골 개는 조그만 거머리에게 달려들길 좋아해. 난동을 피우다시피 하지. 몸집이 커다란 골수벌레는 그 소리에 겁먹어서 달아나려고 할 거야. 바로 그때를 노리면 돼.\n\n이 뼈다귀로 해골 개를 거머리 근처로 유인해 보렴. 아참, 골수벌레에게서 살점을 뜯어내는 것도 잊지 말고! 그것 때문에 이렇게 고생하는 거니까.', '', '', '', '', '', '', 39653),
(56364, 'koKR', '녹슨나사 징발품: 광포한 송곳니 청어', '광포한 송곳니 청어 $1oa개를 스카짓에게 전달해야 합니다.', '', '', '', '', '', '', '', 39653),
(56363, 'koKR', '녹슨나사 징발품: 광포한 송곳니 청어', '광포한 송곳니 청어 $1oa개를 길라 크로스와이어에게 전달해야 합니다.', '', '', '', '', '', '', '', 39653),
(56075, 'koKR', '힘 강탈', '쉬라케스의 두루마리 $1oa개를 수집해야 합니다.', '공허에서 힘을 끌어와 사용하는 나가들이 있어요. \n\n그들이 기록한 두루마리에는 지식이 담겨있는데, 지식은 곧 힘이죠.\n\n그러니 놈들의 지식을 빼돌리면 힘을 강탈할 수 있어요.\n\n제 논리가 완전무결한 건 아니지만, 한번 부딪혀보죠!', '', '', '', '', '', '', 39653),
(56071, 'koKR', '비동기화 진동날', '녹슨나사에 있는 리켓에게 비동기화 진동날을 전달해야 합니다.', '<거칠게 떨리는 칼날을 보고 있자니, 녹슨나사 파수병들이 사용하는 검이 불현듯 뇌리를 스쳐 지나갑니다. 틀림없이 수리할 수 있는 자가 존재할 것입니다.>', '', '', '', '', '', '', 39653),
