(49545, 'koKR', '대족장의 명령: 서리불꽃 마루!', '서리불꽃 마루에 있는 선견자 드렉타르와 대화해야 합니다.', '신체 건강한 호드 병사는 즉시 서리불꽃 마루에 있는 선견자 드렉타르에게 보고하십시오.\n\n어둠의 문을 파괴해 아제로스를 침략하려는 강철 호드를 막았지만, 이제는 놈들과 싸워야 합니다.\n\n선견자 드렉타르가 도와준다면 드레노어에서 적과 대치하기 좋은 전략적인 위치를 잡을 수 있을 겁니다.\n\n호드를 위하여!', '', '', '', '', '', '서리불꽃 마루에 있는 선견자 드렉타르와 대화해야 합니다.', 39653),
