(32630, 'koKR', '선임기술자 자르드의 일지', '천둥 제련소를 조사해 안정된 번개의 비밀을 찾아야 합니다.', '매우 특이한 동력원입니다. 어떻게 동작하는지, 이것으로 무엇을 만들 수 있는지 궁금하십니까?', '', '', '', '', '', '안정된 번개의 비밀을 찾아야 합니다.', 39653),
(32595, 'koKR', '천공의 정점', '장막의 계단에 있는 석공의 우둔함 꼭대기에서 래시온을 만나 보상을 받아야 합니다.', '우리가 전에 만났던 동쪽의 언덕, 석공의 우둔함을 기억하느냐?$b$b이제 번개 창을 이용해 특별한 것을 만들 참인데, 여기선 할 수가 없구나.$b$b석공의 우둔함 꼭대기에서 만나 우리의 승리를 자축하자꾸나!', '', '', '', '', '', '', 39653),
(32105, 'koKR', '온전한 기념물 장부', '유물을 전시해야 합니다.', '유물이 매우 훌륭한 상태로 복원되었습니다. 전승지기와 고고학자들이 연구할 수 있도록 지식의 연단에 전시해도 될 것 같습니다.', '', '', '', '', '', '', 39653),
(25624, 'koKR', '불구덩이 속으로!', '하이잘 산의 번개치는 절벽 위에 있는 화염관문으로 들어간 다음, 그 안의 조던 올라프손과 대화해야 합니다.', '$n! 로고쉬 님께는 자네가 필요하네. 황혼의 망치단이 번개치는 절벽 위에 거대한 화염관문을 세웠네. 그 문이 어디로 통하는지는 나도 몰라. 한 가지 확실한 건, 그 문으로 들어갔다 돌아온 자가 아무도 없었다는 거지. 자네가 거기로 들어가 로고쉬 님의 송곳니 역할을 했으면 하네.$B$B화염관문으로 들어가, 그 안에 있는 조던 올라프손과 이야기를 나누게. 그 세계에서 로고쉬 님의 힘을 사용할 수 있게 해 주는 징표를 자네에게 줄 거야. 자, 가서 화염관문이 어디로 통하는지 확인하게!', '', '', '', '', '', '하이잘 산의 번개치는 절벽 위에 있는 화염관문으로 들어간 다음, 그 안의 조던 올라프손과 대화해야 합니다.', 39653),
(14083, 'koKR', '던 모로에서 타는 법 배우기', '던 모로의 앰버스틸 목장에 있는 울담 아이언혼에게 이 전단지를 가져가야 합니다.', '타기 훈련과 탈것을 광고하는 이 전단지는 울담 아이언혼이 발송한 것입니다.$B$B울담은 아이언포지 외곽 동쪽 길을 따라가다 보면 나오는 던 모로의 앰버스틸 목장에서 만날 수 있습니다.', '', '', '', '', '', '', 39653),
(8067, 'koKR', '마력의 보물: 수렵꾼의 어깨덧옷', '줄구룹에서 다음의 마력의 보물을 구해 가시덤불 골짜기의 요잠바 섬에 있는 장님 팔디르에게 가져가야 합니다: 고대 학카리 아이기스 1개$B$B잔달라 부족에게 매우 우호적 이상의 평판이어야 합니다.', '우리 잔달라 부족은 업적 달성을 상징하기 위해 착용하는 물건을 아주 소중히 여긴답니다. 하지만 그 물건에서 뿜어져 나오는 힘을 감지하기 위해 착용하고 있는 물건을 꼭 눈으로 봐야 할 필요는 없지요. 힘은 눈에 보이는 것을 초월하니까요. 잔달라 수렵꾼의 장비가 그런 것인데, 그중에서도 가장 소중히 여겨지는 것이 바로 어깨덧옷입니다. 수렵꾼의 어깨덧옷은 착용한 자가 눈에 띄지 않도록 해 주고... 원하는 경우 자신의 존재를 드러낼 수도 있답니다.$B$B줄구룹에서 마력의 보물이 당신을 기다리고 있습니다. 내가 찾는 물건을 가져오면 수렵꾼의 어깨덧옷을 드리도록 하겠습니다.', '', '', '', '', '', '', 39653),
(8066, 'koKR', '마력의 보물: 수렵꾼의 허리띠', '줄구룹에서 다음의 마력의 보물을 구해 가시덤불 골짜기의 요잠바 섬에 있는 장님 팔디르에게 가져가야 합니다: 고대 학카리 어깨걸이 1개$B$B잔달라 부족에게 우호적 이상의 평판이어야 합니다.', '수렵꾼은 자신의 사냥감을 추적하는 법을 알지만, 성공한 수렵꾼은 거리를 좁히는 즉시 사냥감을 공격하는 법도 알고 있답니다. 줄구룹에서 성공할 가능성... 그리고 잔달라 수렵꾼처럼 될 가능성을 조금이라도 얻으려면 이 두 가지를 모두 통달해야 합니다.$B$B줄구룹에서 내가 원하는 마력의 보물을 가져오십시오. 나는 그 장신구에서 나오는 힘을 얻고, 당신은 잔달라 수렵꾼의 허리띠를 얻게 될 겁니다. 교환할 만한 가치가 충분히 있는 장비지요.', '', '', '', '', '', '', 39653),
(8062, 'koKR', '마력의 보물: 수렵꾼의 팔보호구', '줄구룹에서 다음의 마력의 보물을 가시덤불 골짜기의 요잠바 섬에 있는 장님 팔디르에게 가져가야 합니다: 고대 학카리 팔보호구 1개$B$B잔달라 부족에게 약간 우호적 이상의 평판이어야 합니다.', '구루바시 제국의 멸망 이후 찾아온 암흑기에는 잔달라 수렵꾼들이 자신들의 역량을 발휘해 부족의 생계를 유지했다고 합니다. 사냥꾼들은 우리 부족의 수렵꾼들과 매우 비슷하다고 하지요. 물론, 사냥감을 쫓는 것이 수렵꾼의 본질을 구현하는 것이긴 하답니다. 하지만 줄구룹에서 사냥을 함으로써 우리 최정예 수렵꾼들 사이에서 진정한 당신의 수준이 드러나게 될 겁니다.$B$B줄구룹 내에서 마력의 보물을 몇 개 가져와 보십시오. 그러면 제2의 수렵꾼이 되기 위한 첫 걸음을 내딛는 것이 될 테니까요.', '', '', '', '', '', '', 39653);
